INSERT INTO `ent_enterprise_info` VALUES (2,1041,'中国人寿','忽群','人寿保险、健康保险、意外伤害保险等各类人身保险业务;人身保险的再保险业务;国家法律法规允许的或国务院批准的资金运用业务;各类人身保险服务、咨询和代理业务;国家保险监督管理部门批准的其他业务。^','914403008923071977','1000000万元','2019-09-01 11:23:03','国有',2,'深圳市福田区福田街道福安社区福华一路123号中国人寿大厦1、2、8层部分,7、9-12、34、35层','深圳宝安区中央大道A座17楼第二职场','中国人寿保险（集团）公司，是国有特大型金融保险企业，总部设在北京，世界500强企业、中国品牌500强，属中央金融企业。2016年8月，中国人寿保险（集团）公司在2016中国企业500强中，排名第12。2018年《财富》世界500强排名第42位。\r\n\r\n银行保险部是中国人寿设立管理银行保险业务的部门：银行保险是由银行、基金组织以及其他金融机构与保险公司合作，通过共同的销售渠道向客户提供产品和服务；银行保险是不同金融产品、服务的相互整合，互为补充、共同发展；银行保险作为一种新型的保险概念，在金融合作中，体现出银行与保险公司的强强联手，互联互动。','1',NULL,'2019-09-24 14:40:48','0'),(3,3,'星巴克咖啡','蔡德粦','餐饮服务;销售食品（以上各项限分支机构经营）;出版物零售;销售自产产品、咖啡用具、厨房用品、日用品、日用杂货、服饰、工艺品、玩具、家用电器、电子产品、办公用品、单用途商业预付卡;代理出售电话磁卡、上网卡和充值卡;提供票务代理服务;销售带有星巴克标志的纪念品;会议服务;礼仪服务;市场营销策划;经济贸易咨询。（出版物零售以及依法须经批准的项目,经相关部门批准后依批准的内容开展经营活动。）','91110000600043354R','1100万美元','2019-09-18 11:53:18','外企',3,'北京市朝阳区西大望路1号2号楼17层全层及18层1808房间','杭州下城区新北街98号\r\n','星巴克咖啡公司成立于1971年，始终致力于商业道德采购并烘焙世界上高品质的阿拉比卡咖啡。今天，在全球76个国家和地区，拥有28,000多家门店的星巴克是世界上首屈一指的专业咖啡烘焙商和零售商。\r\n\r\n自1999年进入中国以来，秉承“激发并孕育人文精神——每人、每杯、每个社区”的公司使命，我们始终致力于在中国成为一家与众不同的公司：在传承经典咖啡文化的同时，关爱我们的伙伴，为顾客提供超越期望的星巴克体验，并为所在社区的繁荣做出自己的贡献。目前星巴克已经在中国大陆130多个城市开设了3,000多家门店，拥有40,000多名身穿绿围裙的星巴克伙伴。这一独特优势使我们能够在每一天，通过每一家星巴克门店，践行我们的承诺。\r\n\r\n我们热爱我们的咖啡。我们相信通过一杯高品质的手工咖啡可以传递和分享真挚情感，而这样简单的行为或许可以为顾客提供一些正能量。因此，星巴克始终致力于通过道德采购，烘焙并提供高品质的阿拉比卡咖啡豆。我们还在中国云南普洱建立了星巴克中国咖啡种植者支持中心，旨在整合和促进可持续种植规范在当地的推广，助力云南咖啡产业的发展。从一粒种子到一杯咖啡，每一个环节都倾入了星巴克的心意和努力，只为每一次光顾我们门店的顾客可以享受醇香的浓缩咖啡及其钟爱的咖啡饮品。\r\n\r\n我们热爱我们的顾客。星巴克在为顾客提供始终如一的优质星巴克体验的同时，也一直致力于提升我们的顾客体验。在对产品质量和服务精益求精的基础上，星巴克强调创新，强调产品和服务的个性化，强调不断给顾客带来愉悦和惊喜。同时，星巴克充分尊重中国历史悠久的传统文化，在门店设计、地方食品和饮料供应等方面，完美地将当地习俗融合到星巴克体验之中。目前，星巴克在北京、上海和成都开设了四家风格鲜明的旗舰店。\r\n\r\n我们热爱我们的伙伴。星巴克不仅是一家“咖啡”公司，更是一家“人”的公司。星巴克的核心和灵魂是“星巴克人”。在星巴克，员工被称作“伙伴”，因为他们除了拥有保险、医疗等方面的福利外，还拥有获得公司“咖啡豆股票”的权利，真正成为公司的一员。同时，星巴克还积极为伙伴打造实现梦想的平台，坚信把伙伴利益放在第一位，尊重他们所做出的贡献。星巴克连续获得怡安翰威特2013年度、2015年度、2017年度“中国最佳雇主奖”及2017美世最佳福利创新奖，肯定了星巴克在中国对于企业文化及人才发展等方面的持续投入和卓越成绩。\r\n\r\n如果你想了解更多星巴克中国的信息，请登陆星巴克公司主页：www.starbucks.com.cn','0',NULL,'2019-09-24 14:40:51','1'),(4,1013,'广西奥顿电子有限公司','李裕杰','电子元器件生产零售','91450400MA5NTUUAXC','5000000元','2019-09-20 15:17:35','私营',2,'梧州市工业园区','梧州市工业园区','梧州市工业园区','0',NULL,'2019-09-24 14:40:53','1'),(5,1014,'南宁市零众度通讯','刘益权','南宁市零众度通讯','45095595965QWSAF2221','5000000元','2019-09-04 15:26:36','私营',2,'南宁市零众度通讯','南宁市零众度通讯','南宁市零众度通讯','0','/156896437138041240621/2.jpg','2019-09-24 14:40:56','0'),(8,1036,'去哪儿','陈刚','研究、开发计算机软件、网络技术、网站技术、多媒体技术;系统集成;生产计算机软件;销售自产产品、计算机、软件及辅助设备;提供技术转让、技术培训、技术咨询、技术服务。(依法须经批准的项目,经相关部门批准后依批准的内容开展经营活动。)','911101087934029813','60000','2019-10-14 00:00:00','国有',1,'北京市海淀区苏州街29号院18号楼维亚大厦17楼1701-1707,1710-1720室','北京海淀区中关村东升科技园北领地B-2号楼','去哪儿网（Qunar.com）是中国领先的无线和在线旅游平台，其网站上线于2005年5月，公司总部位于北京。去哪儿网致力于建立一个为整个旅游业价值链服务的生态系统，并通过科技来改变人们的旅行方式。去哪儿网通过其自有技术平台有效匹配旅游业的供需，满足旅游服务供应商和中国旅行者的需求。对旅游服务供应商而言，去哪儿网通过移动客户端及在线平台为其提供技术基础设施；对旅行者而言，去哪儿网通过网站及移动客户端的全平台覆盖，随时随地为其提供国内外机票、酒店、度假、旅游团购、及旅行信息的深度搜索，帮助旅行者找到性价比较高的产品、较优质的信息和便捷的预订方式，聪明地安排旅行。','0',NULL,'2019-10-11 22:00:26','0'),(9,1038,'北京善义善美科技有限公司','李辉','计算机软硬件、网络技术、通信技术开发、技术转让、技术咨询、技术服务、技术培训;销售自行开发的软件产品、汽车;企业管理咨询;财务咨询（不得开展审计、验资、查账、评估、会计咨询、代理记账等需经专项审批的业务、不得出具审计报告、验资报告、查账报告、评估报告等文字材料）;从事旧机动车经纪业务;汽车租赁（不含九座以上客车）。（依法须经批准的项目,经相关部门批准后依批准的内容开展经营活动。）','91110105396039437D','50000','2014-09-24 15:39:52','独资',2,'北京市朝阳区创远路34号院1号楼5层501室','合肥瑶海区信地城市广场5幢5#526','人人车成立于2014年4月，以C2C 模式进入二手车市场，并推出二手车严选商城，现已发展成为集二手车交易、金融服务、滴滴运力生态、售后等为一体的综合型汽车交易服务平台，致力于为用户创造透明、高效、省心的汽车交易及服务体验，已发展成国内头部二手车电商平台。','0',NULL,'2019-10-15 15:47:28','0'),(10,1039,'北京三快在线科技有限公司','穆荣均','计算机软件技术、网络技术开发;技术转让、技术服务、技术咨询;计算机系统集成;企业营销策划;经济贸易咨询;销售自行开发的软件产品;批发计算机硬件及其配套设备;基础软件服务;应用软件服务;设计、制作、代理、发布广告。（依法须经批准的项目,经相关部门批准后依批准的内容开展经营活动。）','91110108562144110X','207626','2011-05-06 15:50:27','有限责任',2,'北京市海淀区北四环西路9号2106-030','石家庄桥西区中交财富中心','美团的使命是“帮大家吃得更好，生活更好”。作为中国领先的生活服务电子商务平台，公司拥有美团、大众点评、美团外卖、美团打车、摩拜单车等消费者熟知的App，服务涵盖餐饮、外卖、打车、共享单车、酒店旅游、电影、休闲娱乐等200多个品类，业务覆盖全国2800个县区市。2018年全年，美团的总交易金额达5156.4亿元人民币，同比增加44.3%。截至2018年12月31日止过去十二个月，美团年度交易用户总数达4.0亿，平台活跃商家总数达580万。','0',NULL,'2019-10-15 15:54:08','1'),(11,1040,'杭州米雅信息科技有限公司','杨德宏','：技术开发、技术服务、技术咨询、成果转让：计算机软硬件、计算机网络技术、多媒体产品、计算机系统集成；服务：经济信息咨询、第二类增值电信业务中的信息服务业务（仅限互联网信息服务）；设计、制作、代理、发布：国内广告；网上销售：计算机及配件，网络设备，数码设备。（依法须经批准的项目，经相关部门批准后方可开展经营活动）电信业务（依法须经批准的项目，经相关部门批准后方可开展经营活动）','913301080984177350','2625','2019-09-08 16:09:11','有限责任',2,'浙江省杭州市滨江区长河街道江虹路459号1号楼B座1101室','杭州市 滨江区 英飞特大厦 江虹路459号1号楼B座11-12F','作为中国领先的专注于零售领域聚合支付和购物者数据营销解决方案的运营服务商之一，米雅科技是一家以移动支付平台为工具,以多元化营销运营服务为根本,专注于为线下实体连锁商户提供门店运营创新的企业。\n        以成熟的聚合移动支付技术应用为基本依托和有效链接，米雅科技结合零售商线上线下会员信息和其它数字化信息（比如人脸识别与客流监控、GSI、地图导航、LBS信息等），为零售商户和品牌商提供具有开放性、可视化、智能化、自动化的数字营销平台级服务（shopper data base marketing platform数据驱动的购物者营销平台）。','0',NULL,'2019-10-15 16:13:13','1');
