INSERT INTO `ent_recruitment_info` VALUES (2,2,'跑业务','金融讲师','1、本科及以上学历，特别优秀者可放宽至专科学历； \r\n2、应届生市场营销、保险等相关专业优先，有销售管理、保险金融工作经验者优先； \r\n3、具有丰富的客户资源和客户关系优先； \r\n4、具备较强的市场分析、营销、开拓、团队管理能力和良好的人际沟通、协调能力，分析和解决问题的能力； \r\n5、有梦想，有较强的事业心和目标感，自律性强，具备一定的领导能力。\r\n国寿人秉持着“成人达己，成己为人”的公司使命，践行着“知难而进，迎难而上，奋发进取，勇争第一”的团队信念，因为我们坚信优秀吸引优秀，年轻理应奋斗，成功在这里启航！中国人寿大学生创业基地欢迎您！\r\n国寿人秉持着“成人达己，成己为人”的公司使命，践行着“知难而进，迎难而上，奋发进取，勇争第一”的团队信念，因为我们坚信优秀吸引优秀，年轻理应奋斗，成功在这里启航！中国人寿大学生创业基地欢迎您！',666,2,'公司','1'),(3,3,'磨咖啡','咖啡师','全日制在读学生；\r\n接受倒班工作（门店一般营运时间7:00am– 9：00pm）；\r\n每周能提供24小时以上工时；\r\n良好的沟通能力及团队合作能力； \r\n优秀的服务意识，能为顾客提供优质的服务；\r\n正直诚信，尊重他人，充满热情地做每件事；\r\n有餐饮或零售行业工作经验者优先考虑；\r\n在星巴克，你将获得：\r\n温暖而有归属感的团队氛围\r\n快速晋升机会 \r\n成为咖啡大师\r\n有一个机会成就更好的自己 \r\n完善的薪酬福利',888,3,'咖啡厅','0'),(5,4,' 建立和完善推荐系统的基础算法、框架和策略。\r\n2. 和业务部门、产品一起构建招募流程的效果优化、策略迭代、成单预估','推荐算法工程师 ','经验不限本科',3,4,'公司','0'),(6,4,'依据产品需求完成高质量的跨终端Web（PC+Mobile）/Node.js/Hybrid App的前端开发和维护；','高级前端/前端专家','3-5年本科',3,4,'公司','1'),(7,4,'在Booking.com，团队协作是我们推崇的工作方式，我们认为成功取决于团队成员之间的紧密合作。我们致力于推动开源技术协议栈的限制，应对不断出现的大规模挑战，从而满足Booking.com的卓越增长','IOS核心开发工程师','3-5年本科',3,4,'公司','1');
