DROP TABLE IF EXISTS `innovate_declare_award`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `innovate_declare_award` (
  `award_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `declare_id` bigint(20) DEFAULT NULL COMMENT '大创外键',
  `award_type` int(11) NOT NULL COMMENT '级别：1国际级，2国家级，3省部级，4市厅级，5县局级，6校级',
  `award_money_all` decimal(11,6) DEFAULT NULL COMMENT '所获奖金',
  `award_money_district` decimal(11,6) DEFAULT NULL COMMENT '区级拨款',
  `award_money_school` decimal(11,6) DEFAULT NULL COMMENT '校级拨款',
  `award_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '获奖时间',
  `is_prize` int(11) NOT NULL DEFAULT '0' COMMENT '是否获奖(0否 1是)',
  `is_del` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`award_id`),
  KEY `innovate_declare_award_innovate_declare_info_declare_id_fk` (`declare_id`),
  CONSTRAINT `innovate_declare_award_innovate_declare_info_declare_id_fk` FOREIGN KEY (`declare_id`) REFERENCES `innovate_declare_info` (`declare_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;
