DROP TABLE IF EXISTS `innovate_declare_info`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `innovate_declare_info` (
  `declare_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `institute_id` bigint(20) NOT NULL COMMENT '二级学院',
  `subject_id` int(11) DEFAULT NULL COMMENT '学科主键',
  `declare_num` varchar(50) DEFAULT NULL COMMENT '项目编号',
  `project_user_id` bigint(20) NOT NULL COMMENT '项目负责人',
  `declare_name` varchar(50) DEFAULT NULL COMMENT '申报名称',
  `declare_type` int(11) DEFAULT NULL COMMENT '申报类型：1-创新训练项目，2-创业训练项目，3-创业实践项目',
  `project_audit_apply_status` int(11) DEFAULT NULL COMMENT '申报标识',
  `group_id` bigint(20) DEFAULT NULL COMMENT '评审组外键',
  `is_update` int(11) DEFAULT '0' COMMENT '是否是要修改的项目',
  `apply_update` int(11) DEFAULT '0' COMMENT '是否申请修改',
  `audit_no_pass` int(11) DEFAULT '0' COMMENT '申报不通过',
  `declare_score_avg` decimal(10,6) DEFAULT NULL COMMENT '申报平均分',
  `declare_recommend_level` varchar(50) DEFAULT NULL COMMENT '推荐级别',
  `declare_order_no` int(11) DEFAULT NULL COMMENT '排序号',
  `declare_result` varchar(200) DEFAULT NULL COMMENT '二级学院筛选结果',
  `declare_describe` varchar(1000) DEFAULT NULL COMMENT '项目简介',
  `is_del` int(11) NOT NULL DEFAULT '0' COMMENT '删除标识',
  `declare_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`declare_id`),
  KEY `innovate_project_info_innovate_review_group_group_id_fk` (`group_id`),
  KEY `innovate_project_info_sys_user_user_id_fk` (`project_user_id`),
  KEY `institute_id` (`institute_id`),
  KEY `innovate_declare_info_innovate_sys_subject_subject_id_fk` (`subject_id`),
  CONSTRAINT `innovate_declare_info_ibfk_1` FOREIGN KEY (`group_id`) REFERENCES `innovate_review_group` (`group_id`),
  CONSTRAINT `innovate_declare_info_ibfk_2` FOREIGN KEY (`project_user_id`) REFERENCES `sys_user` (`user_id`),
  CONSTRAINT `innovate_declare_info_ibfk_3` FOREIGN KEY (`institute_id`) REFERENCES `innovate_sys_institute` (`institute_id`),
  CONSTRAINT `innovate_declare_info_innovate_sys_subject_subject_id_fk` FOREIGN KEY (`subject_id`) REFERENCES `innovate_sys_subject` (`subject_id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=521 DEFAULT CHARSET=utf8;
