--
-- Table structure for table `innovate_declare_retreat`
--

DROP TABLE IF EXISTS `innovate_declare_retreat`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `innovate_declare_retreat` (
  `retreat_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '回退id',
  `declare_id` bigint(20) NOT NULL COMMENT '比赛id',
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
