INSERT INTO `innovate_declare_review` VALUES (30,'project_audit_apply_status',23,6,NULL,60.00,'fsf',0),(31,'project_audit_apply_status',193,386,NULL,88.50,'该项目从旅游学、民族学、民俗学、宗教学、历史学、社会学、历史心理学等视角开展研究，策划方案将敢壮山布洛陀文化旅游景区划分为“稻作生态文化区”、“文化遗址保护区”、“壮之骄子雕塑园”、“壮族神秘文化园”等多个园区，展示壮族历史悠久、特色显著的稻作文化、歌圩文化、朝圣文化、神秘文化，成为人文始祖朝拜圣地，稻作文化展示园地，壮族文化研究基地。有一定研究意义。',0),(32,'project_audit_apply_status',193,621,NULL,92.50,'符合创新创业项目要求，创意较好，申报书内容完善。',0),(33,'project_audit_apply_status',193,245,NULL,75.00,'无',0),(34,'project_audit_apply_status',195,621,NULL,95.00,'符合创新创业项目要求，创意较好，申报书内容完善。',0),(35,'project_audit_apply_status',195,386,NULL,85.50,'该项目从广西作为旅游大省的现实出发，基于旅游展演的视角，对平果嘹歌的发展现状、在旅游中的展演情况进行研究，探讨其旅游展演价值及旅游对其保护和传承的影响，最终探究旅游发展和非遗保护及传承之间的关系，以点带面，为广西壮族民歌及舞蹈类非遗保护、传承及发展提供一定的理论指导和实践借鉴。',0),(36,'project_audit_apply_status',195,245,NULL,78.00,'无',0),(37,'project_audit_apply_status',198,245,NULL,75.00,'无',0),(38,'project_audit_apply_status',198,621,NULL,91.00,'符合创新创业项目要求，创意较好，申报书内容完善。',0),(39,'project_audit_apply_status',198,386,NULL,82.50,'该项目从旅游对传统节日的影响出发，以广西三江侗族多耶节为研究对象，探究少数民族传统节日在旅游影响下的发展现状、旅游开发价值以及传统节日文化的保护及传承等，希望该项目组能通过此研究为侗族传统节日文化的保护、传承及发展研究之路提供一些借鉴。',0),(40,'project_audit_apply_status',137,245,NULL,80.00,'无',0),(41,'project_audit_apply_status',137,386,NULL,78.50,'该项目能够结合梧州实际，前期调研充分，项目进度安排合理，能够完成该项目。',0),(42,'project_audit_apply_status',137,621,NULL,90.00,'符合创新创业项目要求，创意较好，申报书内容完善。',0),(43,'project_audit_apply_status',117,386,NULL,68.50,'项目组能力体系能完成该项目，但是项目组前期成果较少，同时没有总结前人的成果。转化为商业性较弱。',0),(44,'project_audit_apply_status',117,621,NULL,85.50,'符合创新创业项目要求，创意较好，申报书内容完善。',0),(45,'project_audit_apply_status',117,245,NULL,70.00,'无',0),(46,'project_audit_apply_status',392,386,NULL,72.50,'该项目主要研究明清时期，广西地区的外来移民给广西的经济社会变迁带来了哪些影响。通过研究，可以为广西地区现阶段经济社会的发展提供参考依据。有一定的参考价值。',0),(47,'project_audit_apply_status',392,621,NULL,83.50,'符合创新创业项目要求，创意较好，申报书内容完善。',0),(48,'project_audit_apply_status',392,245,NULL,70.00,'无',0),(49,'project_audit_apply_status',158,621,NULL,86.50,'符合创新创业项目要求，创意较好，申报书内容完善。',0),(50,'project_audit_apply_status',158,386,NULL,82.50,'该项目能够将最近最热门的互联网与自习室结合，及时更新空座位信息使得资源得到有效利用，以网络形式编排座位号有效避免了霸位所引发的校园冲突，精准纪录学习时间并及时反馈打卡纪录对学习者起到监督作用。该项目有一定的商业价值。',0),(51,'project_audit_apply_status',158,245,NULL,83.00,'无',0),(52,'project_audit_apply_status',386,245,NULL,78.00,'无',0),(53,'project_audit_apply_status',386,621,NULL,88.50,'符合创新创业项目要求，创意较好，申报书内容完善。',0),(54,'project_audit_apply_status',386,386,NULL,81.50,'私人定制是近几年来新的营销模式，而互联网是为其重要的载体，主要表现在线上网店和线下实体相结合的表现形式。该项目研究的对象主要是梧州学院的全体师生提供针对消费需求的个性化和服务，根据顾客需求定制个性化的礼品，提供量身定制的个性化产品服务。研究目的在于为同行企业提供互联网+私人订制营销模式的借鉴依据。有一定的推广价值。',0),(55,'project_audit_apply_status',237,621,NULL,90.00,'符合创新创业项目要求，创意较好，申报书内容完善。',0),(56,'project_audit_apply_status',237,386,NULL,72.50,'该项目由大学生自主创办的主营文化宣传的工作室，立足于创新创业，以传播地区历史、地区文化、校园文化为主打方向，以拍摄写真集、毕业照、创作青年学生喜爱的、贴近青年生活的正能量短视频为主要业务和工作方向，同时推出各类广告创意和服务，承接常规广告产品等的制作，通过售卖摄影产品、广告产品和提供服务赚取收入。同时为大学生提供在校摄影实践和学习广告知识技术的平台。有一定的推广意义。',0),(57,'project_audit_apply_status',237,245,NULL,80.00,'无',0),(58,'project_audit_apply_status',335,621,NULL,95.00,'符合创新创业项目要求，创意较好，申报书内容完善。',0),(59,'project_audit_apply_status',335,386,NULL,85.50,'团队通过在E茶空间的自主经营管理活动，以此来提高大学生的社会实践能力，同时旨在树立大学生创业意识和团结协作观念，来达到锻炼自身和提前感受创业的目的和效果。通过号召各班级或各团队的同学参与的形式开展自我动手、产品宣传、活动营销、店内管理、店员分工合作、产品的采购以及成本定价等一系列活动，提高在校大学生的自主经营管理意识，进而汇聚精英人才，共同为梧院师生提供服务。通过组织开展各类创业实践活动，来达到提供创业服务的效果。同时“E茶空间”是一种自负盈亏模式的创业训练，我们通过经营E茶空间为学生团队提供创业训练的平台和相关保障条件，提高大家的自主创业能力，丰富大学生活。该项目有较大的推广价值。',0),(60,'project_audit_apply_status',335,245,NULL,84.00,'无',0),(61,'project_audit_apply_status',242,245,NULL,78.00,'无',0),(62,'project_audit_apply_status',242,386,NULL,78.50,'梧州学院竹鼠研究所的创办方案，拟采用非营利混合性事业机构的运营模式，以竹鼠的科学育种研究、商品产业链培育、政策咨询和科研项目申报为主业，依托梧州学院和梧州高新技术产业开发区及其企业，以实现我国竹鼠商品市场的平价销售。有一定的现实意义。',0),(63,'project_audit_apply_status',242,621,NULL,82.00,'符合创新创业项目要求，创意较好，申报书内容完善。',0),(64,'project_audit_apply_status',212,386,NULL,77.50,'该项目响应国家、学校号召树立大学生文化自信，在岭南文化传承方式、传承内容受到极大挑战以及“文化自信”理念提出的信息化背景下，针对广大群众采用新颖独特的低价旅游方式对在校大学生进行桂系岭南文化宣传。有一定的研究意义。',0),(65,'project_audit_apply_status',212,245,NULL,78.00,'无',0),(66,'project_audit_apply_status',212,621,NULL,89.50,'符合创新创业项目要求，创意较好，申报书内容完善。',0),(67,'project_audit_apply_status',251,245,NULL,79.00,'无',0),(68,'project_audit_apply_status',251,621,NULL,87.50,'符合创新创业项目要求，创意较好，申报书内容完善。',0),(69,'project_audit_apply_status',251,386,NULL,76.50,'该项目针对现代信息爆炸的时代，我们对这些短视频进行筛选甄别，推出适合学生并且受学生欢迎的短视频资讯。视频创作上的创新，鼓励学生创作，引发学生的创新思维，我的的短视频以校园为主，宣传校园文化，传播正能量。有一定的推广价值。',0),(70,'project_audit_apply_status',213,621,NULL,90.50,'符合创新创业项目要求，创意较好，申报书内容完善。',0),(71,'project_audit_apply_status',213,386,NULL,86.50,'该项目立足于校园、结合国内外公益实践经验创设的公益创业项目。团队通过参与经营、管理“E茶空间”，提高自身的社会实践能力，同时旨在树立大学生感恩意识和爱心观念。我们通过经营“E茶空间”所获得的资金来作为爱心公益活动基金，来达到自身推广和回馈社会的目的和效果。 “大学梦，少年行”项目是一种公益与创业相结合的创新尝试，我们通过与梧州市区内小学合作，联合企业开展各种研学活动，让小学生走进大学校园，让他们感受大学校园的学习环境和人文氛围，亲身体验大学的生活，倾听大学生的理想，促使他们从小好好学习，树立远大的理想，引导他们养成良好的思想品德、树立正确的人生价值观。有一定的现实意义。',0),(72,'project_audit_apply_status',213,245,NULL,83.00,'无',0),(73,'project_audit_apply_status',351,621,NULL,90.00,'符合创新创业项目要求，创意较好，申报书内容完善。',0),(74,'project_audit_apply_status',351,386,NULL,77.50,'该项目旨在通过利用社交电商平台运作商品贸易业务，成立商品贸易工作室开展创业，实现盈利效益且可以为社会提供就业岗位。该项目是以分享经济为模式开展的线上商品贸易工作室，此项目所选用的平台是创立于2017年8月的社交电商平台—贝店。贝店采用自营+品牌直供的模式，与源头品牌直接合作。而作为店主的我们，无需囤货、发货，由贝店统一采购、统一发货、统一服务。通过此项目的锻炼，对于学生的工作能力有一定的提升。',0),(75,'project_audit_apply_status',351,245,NULL,79.00,'无',0),(76,'project_audit_apply_status',38,245,NULL,82.00,'无',0),(77,'project_audit_apply_status',38,621,NULL,90.00,'符合创新创业项目要求，创意较好，申报书内容完善。',0),(78,'project_audit_apply_status',38,386,NULL,78.50,'该项目服务人群目标是各高校在校生、应届毕业生及社会企业人力资源部门，致力于通过互联网+大数据+服务模式打造一个客观诚信的第三方招聘服务平台，通过大数据分析与定向培养，为企业提供优秀的发展伙伴，增强大学生实践技能促进就业，以此整合人力资源，为社会发展做出贡献。该项目有一定的现实意义。',0),(79,'project_audit_apply_status',297,621,NULL,94.00,'符合创新创业项目要求，创意较好，申报书内容完善。',0),(80,'project_audit_apply_status',297,386,NULL,68.50,'该项目立足于互联网+高度发展的高校，生活中方方面面的事情可以通过互联网的优化，来提高学习生活效率。这也是大学里外卖等懒人经济发展不错的原因。有一定现实意义。',0),(81,'project_audit_apply_status',297,245,NULL,82.00,'无',0),(82,'project_audit_apply_status',409,386,NULL,68.50,'该项目以学生需求出发，进行市场分析，但是项目操作性不高。总体来说，该项目有一定的现实意义。',0),(83,'project_audit_apply_status',409,245,NULL,78.00,'无',0),(84,'project_audit_apply_status',409,621,NULL,90.00,'符合创新创业项目要求，创意较好，申报书内容完善。',0),(85,'project_audit_apply_status',89,245,NULL,75.00,'无',0),(86,'project_audit_apply_status',89,621,NULL,85.00,'符合创新创业项目要求，创意较好，申报书内容完善。',0),(87,'project_audit_apply_status',89,386,NULL,74.50,'该项目为丝桐古琴文化创业训练项目，成立于2019年3月，集结了二十多位来自不同专业的古琴爱好者，秉承传承弘扬古琴文化的宗旨,致力于开授古琴公益课、建立古琴兴趣培训班、古琴及相关用品的实体和网上销售，主要面向广西省桂林、南宁、梧州市等地的在校学生、传统文化爱好者、退休老人等。此项目有一定的商业价值。',0),(88,'project_audit_apply_status',165,245,NULL,82.00,'无',0),(89,'project_audit_apply_status',165,386,NULL,78.50,'该项目主营业务是从事代写聚会策划、代写广告文案等七项业务，通过我们的服务为受助人解决时间不足、工作应接不暇的问题，让他们能更专注，更有效率的做其他工作。同时通过这些业务我们自身可以从中学习知识、吸取各种得到经验和教训，为以后的就业或创业的实践活动提供理论支持。有一定的现实意义。',0),(90,'project_audit_apply_status',165,621,NULL,85.00,'符合创新创业项目要求，创意较好，申报书内容完善。',0),(91,'project_audit_apply_status',365,621,NULL,84.00,'符合创新创业项目要求，创意较好，申报书内容完善。',0),(92,'project_audit_apply_status',365,245,NULL,75.00,'无',0),(93,'project_audit_apply_status',365,386,NULL,77.50,'该项目与振兴乡村战略息息相关，主要是打破由中间商到农户家里低价购买产品再高价卖出单一传统的营销模式，这样的销售模式经常会造成产品滞销，降低果农生产积极性与经济收益以及街道拥堵等一系列问题。本团队就根据现在电子商务发展良好的大环境下创新恭城柿子的销售模式，利用电子商务平台与农村淘宝合作，实现网上与线下门店共同运营的新销售模式。有一定市场推广价值。',0),(94,'project_audit_apply_status',272,386,NULL,75.50,'“旧‘拾’光--旧书回收共享”校园创业项目主要围绕目前大学生以高价购买教辅资料、教科书，经过使用之后当废品低价变卖这一普遍现象为核心，提出“节约环保、变废为宝”的理念，以2-4折的低价收购这些用后闲置的一次性教科书和教辅资料，以及一些流行消费读物，将闲置废旧书籍“变活”，循环再用，既避免学习资源浪费，也节约后期学者的学习成本支出。本项目以校园为市场，通过社交软件如“微信公众号”建立小程序或者网页进行旧书租赁、出售、共享等服务，同时鼓励DIY手工制作，将废旧书籍变废为宝。此外，不定期开展一些阅读、分享活动，提供以质优价廉的公益服务，以此带动“热爱阅读、自觉学习”潮流，让书香文化得以广为传承。有一定的现实意义。',0),(95,'project_audit_apply_status',272,621,NULL,88.00,'符合创新创业项目要求，创意较好，申报书内容完善。',0),(96,'project_audit_apply_status',272,245,NULL,80.00,'无',0),(97,'project_audit_apply_status',204,386,NULL,75.50,'家政行业是个朝阳行业。目前我国家政服务公司90%为中介形式，家政人员素质较低，专业水平不高，中介公司不能有效保证用户及员工双方的权益。导致市场混乱。互联网的快速发展，专业家政行业在线上的整合也是属于空白现象，加上国家政策的扶持，因此推出，“互联网+家政” 线上平台的资源整合。该项目从我们家政现状出发进行研究，有一定的推广价值。',0),(98,'project_audit_apply_status',204,245,NULL,80.00,'无',0),(99,'project_audit_apply_status',204,621,NULL,95.00,