地完成本项目的各项工作。第三，具有良好的项目环境。本项目组成员都有班干、团干或学生会任职经历，熟悉学校情况，具有很好的人际交往能力。基于以上原因，同意推荐本项目立项。\n','2019-04-01',0),(280,413,72,'该课题具有一定的创新性和较好的市场应用前景，且项目组已开展了一些前期准备工作，同意申报。','2019-04-01',0),(281,384,924,'同意申报','2019-04-01',0),(282,316,450,'本课题研究主要研究并改进多轴飞行器的自动返航算法、自主规避算法、失联应急算法以及研究无人机的环境监测技术，使无人机在失去信号的状态下能够安全返航，改善多轴飞行器的安全性与稳定性，这对于改善无人机的安全性与促进无人机的广泛应用有十分重要的意义；课题的研究内容并非本科知识的简单延续和加深，而是要求学生在学习完程序设计，算法分析等课程后，并掌握一定硬件知识才可以完成，因此，本课题是学生综合利用程序设计、算法分析，硬件设计等知识解决专业实际问题的极好锻炼机会，课题研究是本科阶段专业知识的一次升华，对学生具有适度的挑战性。课题既紧扣无人机技术这一研究热点，具有实际意义，又可以锻炼和提升学生创新能力。\n    综上，同意推荐本课题作为大学生创新训练计划项目立项。 ','2019-04-01',0),(283,280,843,'民族文化是维系民族生存和发展的精神纽带。壮族是中国少数民族中占比例最多的一个民族。壮族有历史悠久、丰富的本民族文化，其中的“那文化”是壮族文化中的一个典型代表。石明萍同学选择了《边疆地区少数民族文化调查研究——以壮族“那文化”为例》作为大创项目，该项目将以广西的壮族“那文化”为例，以“那文化”的起源、发展和传承作为研究对象，深入的研究和探索“那文化”的内容、形式和特点，以及其对壮族和壮族人民的重要作用与影响。该研究有助于增进人们对于边疆少数民族文化的理解，有助于对边疆少数民族文化的保护，有助于促进少数民族的文化发展和繁荣。该研究意义重大。该团队的成员都是广西地区土生土长的壮族人，都会壮语略通壮文，从小就接触本民族的文化，受到本民族语言和文化的良好熏陶。他们对本民族文化的发展、传承和保护具有巨大的热情。该团队成员结构合理，有文有理，以文为主。该团队完全胜任该项目的研究，可以按时结题。我很高兴担任他们的项目指导老师，特此推荐申报国家级项目。','2019-04-01',0),(284,393,819,'该项目具有较强的可行性，符合高校学生生活实际需求，团队成员能够在技术方面实现项目的开展。','2019-04-01',0),(285,159,300,'同意推荐本项目作为大学生创业项目立项，并将予以全力指导。','2019-04-01',0),(286,160,300,'同意推荐本项目作为大学生创业项目立项，并将予以全力指导。','2019-04-01',0),(287,171,300,'同意推荐本项目作为大学生创业项目立项，并将予以全力指导。','2019-04-01',0),(288,197,300,'同意推荐本项目作为大学生创业项目立项，并将予以全力指导，希望学校给于支持。','2019-04-01',0),(289,211,300,'同意推荐本项目作为大学生创业项目立项，并将予以全力指导，希望学校给于支持。','2019-04-01',0),(290,325,115,'同意申请','2019-04-01',0),(291,148,108,'该项目能直接用于UI课程资源建设，具有实际意义，拟推荐申报。','2019-04-01',0),(292,344,108,'该项目具有实际社会意义，拟推荐申报。','2019-04-01',0),(293,370,197,'审核通过','2019-04-01',0),(294,406,108,'该项目能为大数据与软件工程学院建立视觉识别系统，有实际价值，拟推荐申报。','2019-04-01',0),(295,418,57,'该项目深入调研了市场需求，联合了金辉汽车运输公司，项目技术可行性强，同意申报大创项目','2019-04-01',0),(296,386,815,'通过','2019-04-01',0),(297,414,229,'同意通过','2019-04-01',0),(298,378,921,'同意申报！','2019-04-01',0),(299,420,790,'该项目组的成员主要为产品设计专业学生，已具有初步的设计能力和专业制作知识，项目目的明确，具有一定的研究方法和可行性，同意进行项目申请。','2019-04-01',0),(300,365,723,'同意项目申报','2019-04-01',0),(301,368,723,'同意项目申报','2019-04-01',0),(302,419,197,'审核通过','2019-04-01',0),(303,289,843,'地方戏作为特定地域历史形成的文化意向，具有重要的历史文化价值和当代社会价值。广西有数量大、种类繁多的具有少数民族特色的地方戏剧。刘宇静同学选择了《广西地方戏剧调查研究》作为大创项目，该项目将以广西壮族自治区为例，以广西地方戏剧作为研究对象，深入研究和探索广西地区所有的地方戏剧的起源、特色以及传承、价值等；该研究对繁荣和保护广西地区民族戏剧文化等具有重要意义。该团队成员都来自拥有广西地方戏的地区，分布合理，他们来自百色地区、河池地区、钦州地区、玉林地区等等，更有一位同学是毛南族人，对他们自己特有的毛南戏了如指掌。他们对广西地方戏剧都有亲身体验。团队成员所学专业大多是文科，有较好的文学、艺术素养及实践能力。这些都有利于实地调研和项目开展。该团队完全胜任该项目的研究，可以按时结题。我很高兴担任他们的项目指导老师，特此推荐申报国家级项目。','2019-04-01',0),(304,161,543,'该团队申请的智慧写字机器人。基于STM32单片机、上位机软件控制平台、CoreXY作为机械结构的服务型智能写绘机器人。该项目目标和预期成果明确：具有设计操作简易、实用性强、高效节能、安全性高的特点。选题具有创新性，符合大学生创新创业项目的各项要求。同意推荐申请大学生创新创业项目。','2019-04-01',0),(305,411,94,'该项目在以前的基础上进行创新，有明确的应用场景，同意推荐申报。','2019-04-01',0),(306,412,94,'该项目有一定的创新，方案有一定的可行性，同意推荐。','2019-04-01',0),(307,409,325,'同意指导','2019-04-01',0),(308,410,276,'该项目具有极强的理论意义及现实意义，可行性高，且具有极强的创新性和创造性同意申报。','2019-04-01',0),(309,355,543,'该团队申请的Given植保无人机项目，紧跟科技前沿步伐。选题立意标新。以STM32单片机作为飞控核心，搭载10KG药箱、4个电动离心喷头、GPS模块、摄像头的植保无人机。可自动定点定高喷射，实现无人操控，以代替传统的施农药法，解决农药对施药者有害、施料过多和不均引起的环境污染问题。该项目具有广阔的市场应用价值，且项目符合大学生创新创业项目的各项要求。同意推荐申请大学生创新创业项目。','2019-04-01',0),(310,422,263,'通过','2019-04-01',0),(311,423,543,'该团队申请的家庭照顾型机器人针对当今社会社会留守儿童和空巢老人的问题提出的一款设备。该项目设计了以STM32为核心、硅胶支撑身体模型、舵机作为身体关节、语音的接收和发送模块、以及液晶显示屏构成的一款家庭照顾型机器人。选题具有创新性，符合大学生创新创业项目的各项要求。同意推荐申请大学生创新创业项目。','2019-04-01',0),(312,379,907,'该项目成员已具备相关专业知识贮备，且具有一定实践经验，已具备创新创业基础，同意项目申报。','2019-04-01',0),(313,400,281,'通过','2019-04-01',0),(314,361,281,'通过','2019-04-01',0),(315,389,281,'通过','2019-04-01',0),(316,430,457,'莫慧冰等同学所申报的项目与大学生的学习氛围密切相关，具有较强的应用性，课题申报书也体现了该项目团队的深入思考，符合大创项目的申报要求，现对该申报书予以通过。','2019-04-01',0),(317,426,922,'同意','2019-04-01',0),(318,356,431,'拟同意开展。','2019-04-01',0),(319,358,431,'拟同意开展。','2019-04-01',0),(320,282,175,'通过','2019-04-01',0),(321,363,175,'通过','2019-04-01',0),(322,424,175,'通过','2019-04-01',0),(323,421,943,'在生活节奏越来越快的现代社会，“斗转信移”项目符合人们对从前 “书信慢”时光的向往，能让用户体验时光流逝带来的温暖和感动，具有一定的市场需求。项目组的成员皆为对外汉语专业大三的学生，对该项目兴趣浓厚，有较强的文案策划和学习能力，有能力实施该项目。项目研究内容充实，拟解决的关键问题比较明确，具有项目研究和实施的良好基础条件，实施方案合理，具有操作性和可