  `staff_tel` varchar(50) DEFAULT NULL COMMENT '参与者联系电话',
  `staff_qq` varchar(50) DEFAULT NULL COMMENT '参与者qq',
  `staff_email` varchar(50) DEFAULT NULL COMMENT '参与者邮箱',
  `is_del` int(11) NOT NULL COMMENT '是否删除',
  PRIMARY KEY (`staff_id`),
  KEY `institute_id` (`institute_id`),
  KEY `grade_id` (`grade_id`),
  CONSTRAINT `innovate_declare_staff_info_ibfk_1` FOREIGN KEY (`institute_id`) REFERENCES `innovate_sys_institute` (`institute_id`),
  CONSTRAINT `innovate_declare_staff_info_ibfk_2` FOREIGN KEY (`grade_id`) REFERENCES `innovate_sys_grade` (`grade_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1643 DEFAULT CHARSET=utf8;
