INSERT INTO `innovate_finish_info` VALUES (11,702,'文化传流工作室',1,1,NULL,0,0,1,NULL,0,'2019-11-04 06:40:51','随着时代的高速发展，以动画卡通、动漫影视、动漫衍生品、多媒体产品、网络游戏等为代表的动漫产业，被称为21世纪的“朝阳产业”。是中国最具发展潜力的新兴产业之一，也是中国政府列为重点扶持的文化产业，拥有着广阔的市场前景。 通过搭建微信平台、设计简单上手的微信小游戏、成立一个小型商城，展示系列衍生品，如一套餐具、系列红包、春联、窗花、贺卡、灯笼、钥匙扣、印花T恤、字牌、抱枕，用户可以线上订购。加入AR技术，打开拍照功能扫描插画可以形成趣味动画，并依托于互联网新媒体将灯笼文化以更加生动有趣的方式推广向大众。用更新颖、更易让人接受的方式让更多人了解传统的灯笼文化，从而推广我们中华民族传统文化。'),(18,1047,'梧州骑楼城文化传承与保护的对策研究',1,4,23,0,0,0,NULL,0,'2019-11-05 13:01:09','十九大报告提出“文化产业发展战略”，加强文物保护利用和文化遗产保护传承异常迫切。梧州是岭南文化和珠江文化的发祥地，而骑楼城是梧州历史文化的缩影。梧州骑楼城中西荟萃、古朴典雅、文化深厚，是国内现存规模最大、数量最多的骑楼建筑，是名副其实的“中国骑楼博物城”。然而，随着社会的转型发展，人们文化价值观念的改变，梧州骑楼城历史人文景观环境衰落、商业经受挑战、文化式微导致梧州骑楼城文化保护出现一系列问题。本项目提出从改善整体风貌、加大资金投入、完善管理制度、鼓励社会参与、加强文化创意传播等方面，传承与保护好梧州骑楼城，具有非常重要的意义。'),(23,1104,'氟尼酸-1，2-二（4-吡啶基）乙烯共晶的理化性质研究',1,1,NULL,0,0,0,NULL,0,'2019-11-06 14:25:42','药物共晶是目前药物研究的热门领域，究其原因是由于其能改善药物的物理化学性质，并能改善药物的溶解度、溶出速率和生物利用度。更重要的一点是共品通常具有优良的稳定性，可以克服药物成盐后稳定性差的问题。\n本研究采用的是溶液结晶法，通过室温缓慢溶剂挥发法结晶法，得到一种全新的氟尼酸-1，2-二（4-吡啶基）乙烯共晶，进行了溶解度的研究，最终提高了氟尼酸药物的溶解度。\n'),(24,141,'基于OPENMV机器视觉的工件表面质量检测系统研究',1,4,20,0,0,0,NULL,0,'2019-11-07 06:53:16','本项目采用基于OPENMV微处理器为主控制器，利用CCD摄像机采集信息，基于机器视觉的检测系统使通过对工件表面缺陷产生原因和外在特征的分析，基于机器视觉技术，利用CCD摄像头实时采集工件的表面图像；同时，通过OPENMV，采用快速图像处理及模式识别算法对图像进行实时处理和分析，从而检测工件表面缺陷。'),(25,1108,'“美丽乡村”视域下民族地区农村养老模式创新探索---以广西武鸣县为例',1,2,NULL,0,0,1,NULL,0,'2019-11-07 08:14:05','党的十九大报告中提出，构建养老、孝老、敬老政策体系和社会环境要适应时代，要求创新思路，要注重老年人物质文化需求、全面提升老年人生活质量，这为新时代中国养老事业指明了方向。广西作为民族自治地区，民族成分复杂，文化多元，同时政治经济社会发展较落后，在养老服务发展进程中凸显了很多问题。本次研究以广西壮族自治区武鸣县为主体，进行具体的研究、分析，初步调查了民族地区养老体系建设过程中的问题，创新性的开展不同的调查活动，总结经验，有针对性的提出解决方案。'),(26,241,'家庭用天然安全系统的模拟研究',1,1,NULL,0,0,0,NULL,0,'2019-11-07 11:03:23','中国是一个使用天然气的大国，现在国内很多家庭在使用着天然气，其造成的安全事故每年都时有发生。本研究主要针对家庭设计一种天然气安全系统，起到天然气自动检测，泄漏报警，自动关闭和换气等功能，其结构、安装、使用较简便，能符合国内大多数家庭的需求。本项目的主要研究内容有：（1）制作家庭天然气安全模拟系统，包括天然气检测和报警器，天然气关闭和换气装置两大部分。（2）设置家庭使用环境，对家庭天然气安全模拟系统进行测试和改进。'),(27,241,'家庭用天然气安全系统的模拟研究',1,4,21,0,0,0,NULL,0,'2019-11-07 11:25:11','中国是一个使用天然气的大国，现在国内很多家庭在使用着天然气，其造成的安全事故每年都时有发生。本研究主要针对家庭设计一种天然气安全系统，起到天然气自动检测，泄漏报警，自动关闭和换气等功能，其结构、安装、使用较简便，能符合国内大多数家庭的需求。本项目的主要研究内容有：（1）制作家庭天然气安全模拟系统，包括天然气检测和报警器，天然气关闭和换气装置两大部分。（2）设置家庭使用环境，对家庭天然气安全模拟系统进行测试和改进。'),(28,153,'极智少儿机器人教育机构',2,4,21,0,0,0,NULL,0,'2019-11-07 12:30:56','极智少儿机器人教育机构以提升3-8岁的青少年儿童动手能力、创新思维和实践能力为主的专业性培训机构，通过精心研发的益智搭建、科技制作机器人组装编程等系列课程以及参加机器人国内外赛事等。让孩子玩与学有效融合，在搭建、实验中学会科学的思考，使孩子潜移默化地接受科学素养教育。'),(29,219,'基于USB CNC控制的小型五轴雕铣机',1,4,20,0,0,0,NULL,0,'2019-11-08 13:24:38','本项目是设计一哥基于USB CNC的小型五轴雕铣机，是以USB CNC作为控制核心，通过对XYZ三个常规的直线坐标轴和AC两个旋转轴进行控制，达到五轴加工的效果。整个机器使用的是铸铁机架，确保机器能够拥有良好的机械性能；动力方面采用伺服驱动搭配配套的伺服电机，以保证运行过程中不会出现丢步、失步等状况；采用大功率水冷电主轴，确保达到预期的加工效果。行程保护方面，安装限位器和原点开关；在T形台上，预留有水槽安装位置，在加工大粉尘、需要冷却的工件时，可以及时安装水槽，达到除尘、刀头冷却的目的。控制板设置有多个输出接口，方便外接设备进行优化。采用双转台摇篮模式，使用谐波减速器进行传动，保证运行精度。'),(30,314,'幼苗计划',1,4,23,0,0,0,NULL,0,'2019-11-09 03:24:57','孩子是家庭的希望，民族的未来。1-3岁的孩子谁来带？现在是不少职场父母头疼的问题，也越来越成为全社会的一个难题。妈妈的产假休不了那么久，幼儿园又不接收3岁以下的婴幼儿。除了祖辈隔代照看、请家政阿姨帮忙或者交给私立托管机构，几乎难寻其他正规的托幼方式。但现有的几种方式，又不尽如人意。尤其在全面二孩和延迟退休政策实施后，1-3岁婴幼儿的看护问题愈加突出。针对托育这一社会热点话题进行调研探讨，了解我国幼儿托育的现状及出现的一系列问题。以管理学，经济学等作为理论基础，对不同地区托育产业进行综述分析，通过详细的实地调研、进行数据整理分析，运用大数据等信息技术手段得出最后具体的、可操作性强的解决方法，如“3+N”教学模式，即“日托+早教+互联网+其他兴趣类课程”，以期促进托育产业更好的发展，让幼儿拥有更加美好的童年，让家长对未来的托育充满信心和信任，使孩子们的人生观、价值观、世界观能够健康发展。\n\n'),(31,1116,'跨境电商B2C模式对外销售',2,4,21,0,0,0,NULL,0,'2019-11-09 05:25:00','本项旨在通过利用跨境电子商务平台运作外贸业务，对接地方产业，成立外贸工作室开展创业，实现盈利效益。网店是一个具有在线购物功能的网站，首先必须具备一个网站的基本基础设施：网站空间，可以使是虚拟主机，也可以是独立主机或VPS主机域名数据库，对于静态网站，无需具备数据库，但是网店必须要用数据来存放商品、客户、订单等信息网店系统，是一套软件程序，运行在网站服务器上作为电子商务的一种形式，是一种能够让人们在浏览的同时进行购买，并且通过各种在线支付手段进行支付完成交易全过程的网站。现今网上购物成为了大多数年轻人的消费方式，是一个发展前景很好的项目。'),(32,1130,'幼儿音乐启蒙的对策研究',1,2,NULL,0,0,1,NULL,0,'2019-11-09 06:20:49','2018年11月7日，《中共中央国务院关于学前教育深化改革规范发展的若干意见》发布，针对学前教育的深化改革和规范发展方面提出了具体意见。这反映了国家对学前教育的重视，而幼儿音乐启蒙教育是学前教育中不可替代的重要组成部分。《意见》中指出了目前幼儿音乐启蒙教育教学的方式和方法过于单一，导致幼儿在日常音乐启蒙教育过程中缺乏自主体验的问题。本项目主要特点如下：\n（1）引入多种教学方式，结合奥尔夫、达尔克罗兹、柯达伊三大音乐教育体系，使课堂教学游戏化，激发幼儿内心对艺术的追求，提高幼儿的音乐素养，帮助幼儿形成良好的个性和健全的人格；\n（2）幼儿教育与家庭教育相结合，为幼儿创建良好的音乐教育环境；\n（3）把幼儿作为音乐教学的主体，优化音乐教学模式，正确处理幼儿音乐教育同专业音乐教育之间的关系。'),(33,1060,'不惧——“八桂反恐”多元化宣传战略',1,3,NULL,0,0,1,NULL,0,'2019-11-10 03:29:21','基于互联网技术下的新媒体具有先天的技术优势与作为媒体的信息服务功能，是网络经济与传媒产业实现对接的最佳选择。\n我们团队通过对我国反恐工作进行学习与研究，结合八桂地区特殊的地理位置，并以《中华人民共和国反恐怖主义法》为依据，旨在将“八桂反恐”通过多元化形式进行宣传与推广，弥补八桂地区反恐宣传方式的缺陷与不足。\n我们运用Photoshop、Adobe Illustrator、HTML5进行场景设计以及角色的设定。以CINEMA 4D、After Effect、3Ds Max为主要建模工具，进行摄像机动画制作、骨骼绑定，制作出一套共14个表情包、反恐MG动画。同时通过H5网络平台将前两个风格基础上设计一款答题小游戏微信答题程序，将反恐教育宣传面灵活化。\n我们立志通过新媒体平台多元化传播宣传，对国家安全起积极作用，维护人民安全，提高人民反恐意识。'),(34,1136,'古丝绸之路起点合浦在一带一路战略下的新机遇及旅游商业价值的调查和研究',1,4,23,0,0,0,NULL,0,'2019-11-10 09:04:27','海上丝绸之路形成于2000多年前的秦汉时期，一直是中国与外界开展经济文化交流的重要通道，西汉时期，广西合浦即作为海上丝绸之路始发港之一参与到中国与东西方的贸易往来中去，积极推动了古代广西经济文化的发展。\n历史给广西合浦留下了丰富的物质及文化遗产，其旅游商业价值也越来越明显。而当代广西作为中国与东盟合作的重要门户，积极参与到21世纪海上丝绸之路建设中去，旅游产业发展是重要的方面，这对广西的经济发展与一带一路建设有着重要意义。\n据此，我队选择研究合浦的历史文化遗产及一带一路建设为其带来的旅游商业价值，对广西其他城市与北部湾在一带一路下总体未来的发展有着启发性作用。\n'),(35,357,'正星生涯教育培训中心',2,4,21,0,0,0,NULL,0,'2019-11-11 11:20:37','随着时代的发展，各企业对个性化人才的需求日益增长，用人缺口将进一步扩大，人才流动更趋频繁。而当下青年缺乏对于自己职业生涯的规划，学习、工作目标性不强，造成求职的技能与就业能力不强。十九大报告指出就业是最大的民生，高质就业能满足国民对美好生活的向往，而参加培训能使青年人认清自己的优劣势，扬长避短。因此，对于大学生来说，更是一个创业的机会。本项目从职业生涯规划入手，力求建立一个拥有综合性培训人才的机构，我们的培训服务对象立足梧州学院的学生，辐射周边的社会人员。通过规划学员的职业生涯，改变传统的教育模式，创新培训教学方式，从更大程度上满足各界人士的需求。'),(36,853,'海洋资源信息可视化短片的制作',1,3,NULL,0,0,1,NULL,0,'2019-11-11 14:04:17','一直以来，海洋在人类的生活中一直扮演着重要的角色，从郑和下西洋时期到如今对海洋的探索已逐渐扩大，海上丝绸之路自秦汉时期开通以来，一直是沟通东西方经济文化交流的重要桥梁，目前，海洋对我国政治、经济、安全等方面具有重大的意义。但是，大多数人还缺乏比较强烈的海洋意识和活跃的海洋进取精神，我们的项目就是做一个以信息可视化形式呈现出来的海洋资源。我们把海洋资源的信息做成短视频动画展现出来，联系我们的生活，展示海洋在我国的重要地位，通过短视频动画的形式展示给大家，让大家更了解海洋对我们的重要性，响应习近平总书记海洋强国的政策。'),(37,1105,'西江流域农民弃耕情况调查与化解机制研究',1,4,23,0,0,0,NULL,0,'2019-11-11 15:29:49','西江流域包括梧州、贵港、玉林、柳州、来宾和贺州六市，行政区域面积79915平方公里,占广西总面33.76%，所跨面积广阔，从“十二五”规划开始，就被打造成南方重要开发轴带，对广西农业发展起着重要作用。然而近年来，西江流域地区土地利用功能区划分杂乱，大部分耕地被闲置，甚至无人管理。劳动力投入到其他产业，空置农田，导致农业生产经济效益不高，并极大的浪费了土地资源，直接影响西江流域经济非均衡发展。本次调研从区域弃耕问题着手，探索转变该流域农业弃耕问题，提高土地利用率。'),(38,1108,'“美丽乡村”视域下民族地区农村养老模式创新探索---以广西武鸣县为例',1,4,23,0,0,0,NULL,0,'2019-11-11 15:40:26','党的十九大报告中提出，构建养老、孝老、敬老政策体系和社会环境要适应时代，要求创新思路，要注重老年人物质文化需求、全面提升老年人生活质量，这为新时代中国养老事业指明了方向。广西作为民族自治地区，民族成分复杂，文化多元，同时政治经济社会发展较落后，在养老服务发展进程中凸显了很多问题。本次研究以广西壮族自治区武鸣县为主体，进行具体的研究、分析，初步调查了民族地区养老体系建设过程中的问题，创新性的开展不同的调查活动，总结经验，有针对性的提出解决方案。'),(39,702,'文化传流工作室',1,1,NULL,0,0,1,NULL,0,'2019-11-12 04:56:05','随着时代的高速发展，以动画卡通、动漫影视、动漫衍生品、多媒体产品、网络游戏等为代表的动漫产业，被称为21世纪的“朝阳产业”。是中国最具发展潜力的新兴产业之一，也是中国政府列为重点扶持的文化产业，拥有着广阔的市场前景。 通过搭建微信平台、设计简单上手的微信小游戏、成立一个小型商城，展示系列衍生品，如一套餐具、系列红包、春联、窗花、贺卡、灯笼、钥匙扣、印花T恤、字牌、抱枕，用户可以线上订购。加入AR技术，打开拍照功能扫描插画可以形成趣味动画，并依托于互联网新媒体将灯笼文化以更加生动有趣的方式推广向大众。用更新颖、更易让人接受的方式让更多人了解传统的灯笼文化，从而推广我们中华民族传统文化。'),(40,1146,'交互式虚拟单反相机教学系统的设计与实现',1,4,21,0,0,0,NULL,0,'2019-11-12 06:04:51','本项目利用Unity3D的三维虚拟仿真开发技术，以交互式虚拟单反相机教学系统为例，对市面上单反相机类三维仿真教学辅助软件的不足进行改善，将理论知识与仿真实验两部分内容结合起来，设计和实现一个较为完善的三维仿真教学辅助软件。\n我们团队以佳能5D3单反相机为例，使用Unity 3D插件NGUI结合C#脚本语言以及Unity 3D的渲染纹理技术实现单方相机的功能。该软件的实现，弥补了市场上的三维仿真教学辅助软件不足，提高了学生对理论知识的理解以及操作实验的熟练度。\n'),(41,1151,'寻迹广西—古建筑三维动画宣传短片',1,3,NULL,0,0,1,NULL,0,'2019-11-12 06:25:30','本次项目的主旨是以全新的视角来向人们展示广西古建筑，以独特的艺术美将广西的14个古建筑呈现在观众眼前。因而剧本脚本以古建筑三维动画展示和古建筑文字介绍为主。《寻迹广西》三维动画短片首先在片头引出“寻迹广西”的主题，然后依次展示广西每个地级市古建筑的三维动画，同时对该古建筑进行相应的文字介绍，如梧州骑楼城始建于1897年，是梧州近现代百年商贸繁华的历史见证；桂林日月塔始建于唐代，是现今世界上最大的阴阳太极建筑群；柳州程阳风雨桥始建于1912年，是侗寨风雨桥的代表作；钦州天涯亭始建于北宋庆历年间，历经900多年而闻名中外。这些广西古建筑动画依次展示完后，在片尾进行总结。从而达到宣传广西历史文化古迹，传播中华文化的目的。'),(42,440,'基于NB-IOT的空气质量监控和污染源定位系统',1,1,NULL,0,0,0,NULL,0,'2019-11-12 06:25:58','习近平总书记在党的十九大报告中指出，“必须树立和践行绿水青山就是金山银山的理念”，并明确要求“加大生态系统保护力度”。至此，为了响应习近平总书记对环境保护和治理的号召，我们拟研发了基于NB-IOT的空气质量监控和污染源定位系统，该系统由下位机、Web端、设备监控端、移动客户端和数据服务器构成。在工厂和城市地区附近安装多个传感器，采集的环境参数有风速、风向、PM2.5、PM10、温度、湿度、光照强度、GPS信息。下位机采集数据发送到电信物联网开发者平台， Web端实现了数据的显示、设备监控和污染源定位，帮助环保管理人员寻找到排放污染物超标或者偷排的工厂。移动客户端对未来的环境指数进行预测和显示，如有异常将以短信方式提醒。'),(43,615,'基于物联网的果园智能管理系统设计与实现',1,3,NULL,0,0,1,NULL,0,'2019-11-12 06:56:55','本智能果园管理系统以stm32单片机开发、pc机作为上位机,利用WiFi技术实现设备间的无线通信。通过温湿度传感器、光照传感器、土壤湿度传感器以及摄像头模块对果园环境进行实时监测并将所获取的数据上传，方便技术人员对果树的生长情况进行判断合理地对果园进行管理。通过远程控制并与摄像头相结合操作可移动喷洒机器在铁轨上运行进行施肥、施药处理，无需人员费时费力进行操作从而减少人工费的开支以降低成本。将供水设备连接到每棵果树上通过土壤湿度传感器进而控制电磁水阀的开关进行自动灌溉。本智能果园管理系统主要节省了人力，往往一个果园只需要一个人员进行管理或一个人员管理多个果园大大降低了管理成本。'),(44,533,'智能写绘机器人',1,3,NULL,0,0,1,NULL,0,'2019-11-12 07:11:13','随着人类现代科技化的发展，人类会出现：没有时间写字、画图和提笔忘字的社会现象。在需要手写绘画的场合中，可采用STM32为主控平台、上位机为控制平台、CoreXY作为机械结构的服务型智能写绘机器人改善。\n该机器人可通过STM32上位机将语音输入、文字、图画转换为坐标式G代码，再用串口通信发送到下位机STM32，使TB6560驱动器和步进电机模块等电机模块驱动，完成写作和绘画功能。帮助需要在手写和绘画场合的人类快速准确完成手写的工作，特别是语音输入可更高效地完成写绘的任务。\n本项目的目标和预期成果为：设计操作简易、实用性强、高效节能、安全性高的智能写绘机器人，解决人们遇到写字、绘图的困难，在机器人教学的课堂上安全试用。'),(45,1113,'基于“一带一路”战略视角下的数字动画表现研究与设计',1,1,NULL,0,0,1,NULL,0,'2019-11-12 07:23:23','习近平主席在十九大报告中提出，要坚定文化自信，推动社会主义文化繁荣兴盛。应习近平主席创新文化的要求，响应国家号召，以党为核心，结合新媒体技术，根据我国的“一带一路”发展战略，让中华优秀传统文化流向世界。用新媒体技术，加入中国剪纸、皮影等元素，在技术手段的支持下，将中国文化与各国地域结合，以数字动画的表现手法讲述“一带一路”中国与各国家文化交流的历史故事。最终以艺术短片的方式系统地呈现出新亚欧大陆各国的文化特色，反应出了对外宣传和和弘扬中华上下五千年的优秀传统文化的重要性，本项目希望通过移动端平台这个当今年轻人最为熟悉的方式来推广和创新中国特色文化。让更多的人了解“一带一路”的发展前景。'),(46,440,'基于NB-IOT的空气质量监控和污染源定位系统',1,3,NULL,0,0,1,NULL,0,'2019-11-12 07:32:33','习近平总书记在党的十九大报告中指出，“必须树立和践行绿水青山就是金山银山的理念”，并明确要求“加大生态系统保护力度”。至此，为了响应习近平总书记对环境保护和治理的号召，我们拟研发了基于NB-IOT的空气质量监控和污染源定位系统，该系统由下位机、Web端、设备监控端、移动客户端和数据服务器构成。在工厂和城市地区附近安装多个传感器，采集的环境参数有风速、风向、PM2.5、PM10、温度、湿度、光照强度、GPS信息。下位机采集数据发送到电信物联网开发者平台， Web端实现了数据的显示、设备监控和污染源定位，帮助环保管理人员寻找到排放污染物超标或者偷排的工厂。移动客户端对未来的环境指数进行预测和显示，如有异常将以短信方式提醒。'),(47,347,'智能导盲杖',1,3,NULL,0,0,1,NULL,0,'2019-11-12 07:45:17','本款导盲杖是基于Arduino开发板的开发，分为智能检测和GPS定位两个独立模块。智能检测模块主要由超声波测距模块、光电测距模块、水位检测模块和遥感模块组成，智能检测模块操作对象为盲人群体，当导盲杖检测到四周有障碍物时发出警报提示使用者注意避让；GPS定位模块可对使用者的位置进行实时定位。模块采用TCP/IP协议与OneNET平台连接，通过AT指令利用GPRS网络将定位数据传送到OneNET平台并以地图的形式将位置展现出来。\n此导盲杖可以方便使用者在无他人帮助的情况下自动感知周围环境并且能够根据导盲杖反馈的提示安全地行走，其家人朋友可以在PC端或手机APP端的OneNET平台地图上看到使用者的实时位置及行走轨迹。'),(48,405,'鱼书书——二手书店在互联网营销下的创新运用',2,4,21,0,0,0,NULL,0,'2019-11-12 07:56:14','随着互联网和移动网络的快速发展，微信公众号成为人们信息交流和知识共享的主要平台；使用微信公众号传播阅读文化符合当前的时代潮流。因此，“鱼书书”微信公众号应运而生。通过利用移动平台进行“以书换书”、“二手书交易”以及读书心得交流等活动，不仅能让图书消费者节约旧书存放的空间，同时还可以随时随地“以旧物换新知识”。这种循环流动的万书平台，有利于传播书本文化、增加阅读的多样性，也有助于降低消费者的阅读成本，避免资源的浪费。'),(49,1113,'基于“一带一路”战略视角下的数字动画表现研究与设计',1,4,21,0,0,0,NULL,0,'2019-11-12 08:39:27','习近平主席在十九大报告中提出，要坚定文化自信，推动社会主义文化繁荣兴盛。应习近平主席创新文化的要求，响应国家号召，以党为核心，结合新媒体技术，根据我国的“一带一路”发展战略，让中华优秀传统文化流向世界。运用新媒体艺术形式，结合中国剪纸、皮影等元素和扁平化风格的融合，设计出人物角色、场景，利用相关软件制作出扁平化风格的MG动画短片，短片大致时长在3分钟以上。利用移动平台传播，展现“一带一路”发展历程。最终以艺术短片的方式系统地呈现出新亚欧大陆各国的文化特色，反应出了对外宣传和和弘扬中华上下五千年的优秀传统文化的重要性，本项目希望通过移动端平台这个当今年轻人最为熟悉的方式来推广和创新中国特色文化，让更多的人了解“一带一路”的发展前景。\n'),(50,859,'VR农业教学辅助系统',1,3,NULL,0,0,1,NULL,0,'2019-11-12 08:50:10','中国自古以农立国，本项目主要是针对农业教学存在的教学质量问题，创立一个VR农业教学辅助系统，利用虚拟仿真技术还原实验场景，模拟仿真的操作，例如种植中的挖土、播种、浇水，枝剪等操作，让用户通过佩戴vr设备就可进入仿真的实验场地，如茶园、菜地等，进行实践与学习，激发学生的学习兴趣和积极性，提升教学质量，同时也解决传统农业教学中受时令限制、农产品生长状况限制和实践管理难度高导致的消耗时间长、教学质量不佳、练习损耗高的问题。'),(51,274,'藤县特色陶瓷产品O2O模式的探索与实践',2,4,23,0,0,0,NULL,0,'2019-11-12 09:03:07','在电子商务迅猛发展的大环境下，传统陶瓷制品企业寻求发展新的营销模式。利用电子商务的便利性，我们项目致力于创新陶瓷制品销售渠道，进行线上线下联合销售，以此打破人们对陶瓷制品只能在实体店销售的固有看法。团队与企业合作，线上搭建网络平台进行销售，线下协作运营体验店。'),(52,1106,'全自动洗衣晾衣一体机',1,4,20,0,0,0,NULL,0,'2019-11-12 09:24:43','目前家用的洗衣机大多都是如出一辙的“先洗衣再晾衣或烘衣”。为提高人们的生活质量，家电产品的升级改造和创新就成了关注点。为此设计一款“先挂衣再洗衣后晾衣”的一体化全自动洗衣机。该机结构分上下两层，上层是U形的输送带和进、出衣口，在进衣口把脏衣物挂好，缓慢输送到下层的洗衣室进行清洗，清洗干净后自动把衣物从出衣口带到晾衣杆进行晾晒。它的清洗方式采用波动式，衣物在清洗过程中被洗衣板反复拍打与擦洗。整个过程尤如流水线，脏衣物从进衣口进洗衣室清洗，而干净衣物就从出衣口出且带到晾衣杆上。其优点为操作简单，耗电量低，用水量少，净化率较高，衣物不易变形。'),(53,702,'文化传流工作室',1,3,NULL,0,0,1,NULL,0,'2019-11-12 09:31:18','随着时代的高速发展，以动画卡通、动漫影视、动漫衍生品、多媒体产品、网络游戏等为代表的动漫产业，被称为21世纪的“朝阳产业”。是中国最具发展潜力的新兴产业之一，也是中国政府列为重点扶持的文化产业，拥有着广阔的市场前景。此次关注的重点是“互联网 + 网络游戏”， 通过搭建微信平台、设计简单上手的微信小游戏、成立一个小型商城，展示系列衍生品，如一套餐具、系列红包、春联、窗花、贺卡、灯笼、钥匙扣、印花T恤、字牌、抱枕，用户可以线上订购。加入AR技术，打开拍照功能扫描插画可以形成趣味动画，并依托于互联网新媒体将灯笼文化以更加生动有趣的方式推广向大众；并且使用三维动画的形式展示灯笼文化。用更新颖、更易让人接受的方式让更多人了解传统的灯笼文化。'),(54,1100,'DIY手模制作',2,3,NULL,0,0,1,NULL,0,'2019-11-12 10:13:13','在这个充满个性的时代，个性就是时尚，顶尖时尚独一无二，独一无二的创意首推DIY自做。人们对手工体验越来越感兴趣，而DIY手模制作会给人们一种新奇的体验感，其创新点就在于自己的双手，创意手模+手势、绘画、苗族特色小手环相结合，本项目DIY手模制作产品属于摆饰物品，根据客户需求灵活进行创新，就会诠释新的艺术产品。同时，DIY手模制作近年来是一个新热点，且面向社会各类群体，具有广阔的消费市场和巨大的消费潜力，亲身制作出来的艺术产品会极具珍藏版纪念意义。'),(55,618,'用电检测系统的设计与实现',1,3,NULL,0,0,1,NULL,0,'2019-11-12 11:31:43','本作品针对家庭用电安全，研究开发一种智能、高效的用电监测系统，将监测系统部署在用电电器与供电线路之间，采用当前流行的传感器动态采集技术、网络数据传输技术、STM32微控制器技术对用电电流、电压、温度等各参数进行实时的监测，使家庭电器具有全自动的上传监测信息、报警、断开电源的功能，Web端的数据可视化分析为用户提供实际用电参数的依据，用户可以通过Internet对家庭用电设备进行远程的监控，很大程度上避免用电事故的发生。'),(56,749,'“画凌烟”中国武将系列新媒体动画制作 ',1,3,NULL,0,0,1,NULL,0,'2019-11-12 11:35:24','随着新媒体宣传平台的兴起，以及新时代大环境下国家对传统文化元素传播的重视，本项目以多名中国武将的生平描述为整体创作思路，民俗“门神武将”和“壁画武将”等形象为发散风格，创作系列动画，展现古代武将们英勇无畏、保家卫国、视死如归的爱国之情；另一方面，通过抖音、哔哩哔哩、腾讯、微视等主流新媒体平台进行发布与传播，彰显中华民族的软实力、加强当代国人的凝聚力，并实现文创增值。'),(57,1159,'D·K化妆工作室',2,2,NULL,0,0,0,NULL,0,'2019-11-12 11:44:53','爱美是人的天性，天生丽质固然是好，可是在先天不足的情况下也能拥有天生丽质的美，那就更是美妙了。据文献记载，古代女子以在脸上涂抹胭脂水粉为美，这是中国现代化妆的前身。随着时代的推移和事物的发展，直至今日，化妆已是人们生活中，特别是女性朋友们改变形象，拥有靓丽面容的不可或缺的关键之物。并且在中国这个化妆消费大国的大背景下的化妆市场更是充满了诸多未知的市场还未发现。或许在原有的市场份额分配中，寻求更好的突破点也是不无可能，尽管化妆市场竞争日益激烈。如今，对于爱美女士来说化妆爱美的消费对象越来越年轻化，更多的是在校的90后大学生，但多大为女性居多，他们或许为获得姣好形象以获得异性青睐，有的是为工作面试中为自己的形象加分，更或许是学校活动要求等等，随着时代的发展，化妆市场必将越来越年轻化，因此意味着，消费者的知识素养不断地提高，消费者对化妆技术的要求必将不断的提高。  '),(58,1098,'老龄人口精神精神文化生活的社区支持系统--广西梧州市的实证研究',1,1,NULL,0,0,0,NULL,0,'2019-11-12 12:51:12','本项目通过问卷调查和实地访谈的方式收集信息，依据马斯洛需求层次理论和活动理论进行设计，通过对所收集到的数据进行整理发现，老龄人口对文化设施、文化活动、老年教育、资金筹集、精神文化人才和组织等方面存在着不同程度的需求；而针对这些方面的需求，我国社区存在着文化设施和场地供求存在着矛盾、老龄人口参与精神文化建设的积极性不高、文化活动组织开展存在矛盾、筹资渠道单一，老年精神文化建设资金缺乏、精神文化建设人才缺乏等方面的问题。\n针对我国社区精神文化建设过程中存在的问题，就解决这些问题提出相关的建议：加快文化设施的建设，为老龄人口精神文化提供物质保障；加强宣传，提高老龄人口社区精神文化建设的参与意识；充实文化活动，为老年精神文化生活提供基础内容；建立多元化筹资渠道，为老年精神文化建设提供资金保障；加强人才队伍建设，为改善老年精神文化提供组织保障。\n本项目组将以广西壮族自治区梧州市作为调查、研究和项目实'),(59,1137,'校外美术培训研究——以少儿美术培训为例',2,1,NULL,0,0,0,NULL,0,'2019-11-12 13:13:04','少儿美术培训目前在我国尚处于蓝海阶段，从师资水平及教学内容来看各类培训机构水平参差不齐。以个人开办的培训班遍地开花，以临摹为主的传统教学模式，将孩子们笔下的世界变得千篇一律，孩子的思想从此被禁锢。如何让孩子用绘画的方式与这个缤纷的世界进行交流，让孩子天马行空的想象通过画笔表达出来，除了提高他们的绘画能力还能提高他们的逻辑思维能力、塑造良好品格等，便是我们要研究的方向。'),(60,1158,'高架草莓采摘收集机',1,4,20,0,0,0,NULL,0,'2019-11-12 13:14:47','本项目的研究方向是高架草莓采摘，设计出的机器主要的功能包括采摘、收集和移动。随着人们生活水平的提高，各种需求也随之提高。草莓向来是人们喜爱的水果之一，所以其需求量也是非常庞大。因而一种集合采摘与收集草莓功能的机器就有着好的应用，并且会有良好的市场。所以该项目的研究具有重要意义。'),(61,88,'桂皮分割机',1,4,20,0,0,0,NULL,0,'2019-11-12 13:17:49','桂皮分割机是本项目团队自己研究发明的。与现在企业使用的传统锯条式切割相比更加的安全，高效，使用更简单。分割机是由电箱、切割箱、对心机构、回收机构四部分组成，操作人员只需要将桂皮放入导筒，对心机构将使桂皮保持垂直下到十字刀的位置，再利用下一根桂皮把上一根桂皮推出导筒，实现连续工作。对心机构使得桂皮在进去和切割的时候不会倾斜；使用四把刀片组成十字型把桂皮一开四达到了企业对产品的要求；每个刀片的位置还设计有一个防尘套，把刀片切割桂皮产生的粉尘利用刀具的离心力从防尘套下方的口离开切割箱，减少了切割时的扬尘。回收机构起到产品和桂粉分离，进一步回收桂粉产生价值。'),(62,1133,'当代广西壮族文学中的地域风俗',1,4,23,0,0,0,NULL,0,'2019-11-12 13:24:36','当今，研究地域文化小说已经成为一个热潮。1949年后的中国文坛，广西当代的壮族小说呈现边缘崛起的态势，成为中国当代文坛上一个重要的文学新潮。因此，深入研究当代广西壮族小说作品具有重要意义。在陆地、黄佩华、东西等当代壮族作家的小说创作中，不难发现在壮族作家的小说创作中充满了具有独特壮民族风俗的小说因素。例如壮族的山歌文化、巫文化、饮食文化以及婚嫁习俗等等壮族民俗文化在当代壮族小说中随处可见。其中，在壮族作家的作品中，山歌文化独具一格，成为当代壮族小说的明信片。'),(63,675,'全景相机vr仿真教学软件',1,3,NULL,0,0,1,NULL,0,'2019-11-12 13:30:07','由于普通学校教学资源匮乏，摄影设备不足，教师的现场示范无法满足众多学生同时观察的需求。因此，教学效果一般。如何让学生快速了解全景相机的构造，理解全景摄影技术中的难点，从而提升教学质量，是目前亟需解决的问题。\n全景相机vr仿真教学软件通过交互式、沉浸式的教学形式应用到高校教学过程中，学生可以使用该系统反复练习，教学效率更好，同时避免了摄影过程中的安全隐患，提升了教学质量。\n'),(64,858,'中国岭南文化研究工作室',1,3,NULL,0,0,1,NULL,0,'2019-11-12 13:44:39','近年来，文化艺术产业在我国得到重视并有很大的发展空间，我们工作室以推崇对岭南文化为目的，对岭南地区文化进行挖掘与研究，传承岭南文化的精髓，创新式的以微电影等形式进行传播。让人民群众感受和体验到岭南文化的独特之处，并对岭南文化产生一种全新的认知。本项目主要在平面设计，短视频两个主要方面发展。平面设计是基础业务，主要承接校园内各社团和校外一些广告宣传单的设计。'),(65,1157,'升降横移式楼梯清扫机的开发与设计',1,4,20,0,0,0,NULL,0,'2019-11-12 13:57:29','该机器结构简单，成本低，在居民楼、办公楼以及学校的教学楼、宿舍楼等建筑均可以使用，市场前景非常广阔，市面上扫地机器人的技术已经非常成熟，但只限于在平面清扫，市场上还没有以上建筑的楼梯清扫机器，基于以上建筑环境具有容易积累垃圾且垃圾种类繁多的特点，本项目是开发一款升降横移式楼梯清扫机，以减轻清洁工人的劳动负担，提高清洁效率，更好改善人们的生活环境。该清扫机主要实现两个功能：爬楼功能与清扫功能，根据国家楼梯设计规范，楼梯的尺寸各有不同，我们给予机器爬楼梯的极限偏差，清扫要求机器能够在楼梯上实现最大面积范围的清扫，机器能够实现转向功能，采用超声波传感器，使机器能够自适应楼梯环境，实现机器的全自动化。\n'),(66,1161,'边疆民族地区社区文化治理研究',1,1,NULL,0,0,0,NULL,0,'2019-11-12 14:28:09','社区作为整个社会的基本单元，已成为社会治理的理论和实践关注焦点。深入研究边疆民族地区社区文化的发展，有助于增进广大人民群众对于边疆民族社区文化的理解，促进各民族文化共同发展，繁荣。作为典型的边疆民族地区，广西壮族自治区民族成份复杂，文化样态丰富；而因其社会经济发展水平较为落后，使其在社区在文化的建设发展中遇到许多问题。本项目将以广西壮族自治区为例，以边疆民族地区这一特殊区域社区文化建设作为研究对象，深入研究和探索该类区域社区文化建设的特点、现状及问题和繁荣社区文化的政策路径。\n'),(67,1098,'老龄人口精神文化生活的社区支持系统--广西梧州市的实证研究',1,4,23,0,0,0,NULL,0,'2019-11-12 14:30:31','本项目通过实地访谈的方式收集信息，依据马斯洛需求层次理论和活动理论进行设计，通过对所收集到的数据进行整理发现，老龄人口对文化设施、文化活动、老年教育、资金筹集、精神文化人才和组织等方面存在着不同程度的需求；而针对这些方面的需求，我国社区存在着文化设施和场地供求存在着矛盾、老龄人口参与精神文化建设的积极性不高、文化活动组织开展存在矛盾、筹资渠道单一，老年精神文化建设资金缺乏、精神文化建设人才缺乏等方面的问题。\n针对我国社区精神文化建设过程中存在的问题，就解决这些问题提出相关的建议：加快文化设施的建设，为老龄人口精神文化提供物质保障；加强宣传，提高老龄人口社区精神文化建设的参与意识；充实文化活动，为老年精神文化生活提供基础内容；建立多元化筹资渠道，为老年精神文化建设提供资金保障；加强人才队伍建设，为改善老年精神文化提供组织保障。\n本项目组将以广西壮族自治区梧州市作为调查、研究和项目实'),(68,1161,'边疆民族地区社区文化治理研究',1,4,23,0,0,0,NULL,0,'2019-11-12 14:43:32','社区作为整个社会的基本单元，已成为社会治理的理论和实践关注焦点。深入研究边疆民族地区社区文化的发展，有助于增进广大人民群众对于边疆民族社区文化的理解，促进各民族文化共同发展，繁荣。作为典型的边疆民族地区，广西壮族自治区民族成份复杂，文化样态丰富；而因其社会经济发展水平较为落后，使其在社区在文化的建设发展中遇到许多问题。本项目将以广西壮族自治区为例，以边疆民族地区这一特殊区域社区文化建设作为研究对象，深入研究和探索该类区域社区文化建设的特点、现状及问题和繁荣社区文化的政策路径。'),(69,214,'华课在线--在线原创教学资源平台',1,3,NULL,0,0,1,NULL,0,'2019-11-12 14:48:57','目前在国内，移动互联网的快速发展，使得教育平台迅速兴起。但是多元化教学模式的教育平台数量太少，没有普及。\n我们是一个具有线上线下多元化教育的平台，我们平台开展真人微课教程，线上线下虚拟仿真教学，视频微课教学、h5互动教学等多种教学模式。我们的平台有大数据做支撑，可以根据用户的浏览记录、观看视频的时间等系列信息给用户推送相关教学资源，平台同时记录用户的学习情况给出相关提醒，当然，我们平台也会根据用户的选课情况给出相应的学习方案作为参考。我们推出移动端学习平台，移动端和PC端只需要一个二维码的连接，避免了用户下载app的麻烦。我们平台提供素材库，习题库等资源。\n'),(70,216,'旅迹工作室',1,3,NULL,0,0,1,NULL,0,'2019-11-12 14:50:57','旅迹工作室是基于古建筑旅游的研究和开发的项目。旅迹工作室为客户提供全方位的服务：一方可以满足用户在古建筑旅游方面的需要，可以制定完美的旅游攻略，为用户普及有关古建筑的知识和注意事项，还有很多珍贵的古建筑已经不能够参观或拍照，但游客可以通过虚拟复原的古建筑来体验，让游客更深刻地感受到古建筑深厚的文化底蕴；对于一些年久失修和其他一些规模小或未开发旅游的古迹，旅迹工作室会通过三维模拟仿真技术，创造出VR体验和景观漫游动画，实现其价值；同时也会推出一系列文创产品，对古建筑进行宣传；另一方面旅迹工作室收集的古建筑信息为古建筑的研究提供参考，进而更好地推动对中华民族优秀传统古建筑的宣传、保护和传承。'),(71,42,'人工宝石加工环境污染的防治措施与政策思考——以梧州为例',1,4,23,0,0,0,NULL,0,'2019-11-12 15:14:05','梧州被称为“人工宝石之都”，人工宝石加工虽然为梧州商贸做出了巨大贡献，但也带来了一些社会问题。人工宝石的加工需要特殊的设备机器和特殊的工艺流程，加工过程中会产生诸如噪声、振动、污水、废渣等环境污染。目前，人工宝石加工聚集在市区内居民生活区的现象比较严重，为此梧州市人民政府多次行动，出台相关措施，加大力度整治扰民、破坏环境的加工项目。本课题的研究，旨在分析梧州人工宝石加工环境污染现状，以及整治过程中面临的主要问题，探讨当地政府如何采取有效的防治措施和政策，解决这个关系到梧州广大人民群众切身利益的环境问题，为人民群众营造一个绿水青山的“美丽梧州”。'),(72,1101,'美丽乡村视角下广西河池A县农村垃圾有效治理探索',1,4,23,0,0,0,NULL,0,'2019-11-12 15:16:43','党的十九大报告要求社会主义新农村就是“生态宜居，治理有效”，对农村生态保护与垃圾处理都提出很高的要求。本项目就在此背景下提出立项，通过美丽乡村视角去调研广西河池农村垃圾有效治理的情况，及时发现制止农村垃圾治理的瓶颈，有针对性的提出化解对策，为广西民族地区持续繁荣发展和环境进一步美化提供理论参考。同时为西部其他民族地区的相类似问题化解提供参照模式。'),(73,1161,'边疆民族地区社区文化治理研究',1,1,NULL,0,0,0,NULL,0,'2019-11-12 15:19:21','社区作为整个社会的基本单元，已成为社会治理的理论和实践关注焦点。深入研究边疆民族地区社区文化的发展，有助于增进广大人民群众对于边疆民族社区文化的理解，促进各民族文化共同发展，繁荣。作为典型的边疆民族地区，广西壮族自治区民族成份复杂，文化样态丰富；而因其社会经济发展水平较为落后，使其在社区在文化的建设发展中遇到许多问题。本项目将以广西壮族自治区为例，以边疆民族地区这一特殊区域社区文化建设作为研究对象，深入研究和探索该类区域社区文化建设的特点、现状及问题和繁荣社区文化的政策路径。\n'),(74,44,'智能共享停车场',1,1,NULL,0,0,0,NULL,0,'2019-11-12 16:43:18','本项目主要是通过移动端平台及物联网相关技术，让用户可以在移动端上查找停车场的具体位置，查看停车场是否有剩余停车位并按个人需求预订停车时间段，然后根据地图给出的路线去停车场。当用户到达停车场时大门的自动识别车牌装置会通过系统来查看该车是否已经在平台预定车位，来决定是否放行。\n本项目通过移动互联网和物联网技术，使城市中有限的停车位实现资源利用最大化，节约人们寻找车位的时间，是解决“智能交通”中最后一公里的关键环节。\n'),(75,1046,'测试11',1,5,22,0,0,1,63.200000,0,'2019-11-13 01:08:10','111111'),(76,668,'微学网--微课在线教育服务平台',1,3,NULL,0,0,1,NULL,0,'2019-11-13 01:25:14','随着流媒体技术的发展，学习变得越来越大众化、便捷化，微课突破了传统的教学模式，它短小精悍，学者可利用微课查缺补漏，强化巩固知识。UI设是近年来的产物，作为新兴技术，原创的ui设计更为重要，而原创性更是衡量设计师的重要标准，在没有手绘基础、缺少自我创作能力的基础下，如何去绘制好一个图标或者插画等设计作品，我们团队推出了UI原创设计在线微课教育服务平台，通过视频为主要载体，在短时间内完整、清晰、生动的讲解教学内容，不管是学生党、职场达人，有UI设计基础或者入门小白，针对不同年龄、不同基础的人，我们将推出相对应的课程，让更多的人学好UI，成为优秀的UI设计师。我们的微课教育平台除了可在PC端运行，我们还推出移动端APP，让人们随时随地都能使用手机进行学习，同时包含了多交互学习，例如二维码，人们直接扫描即可进入学，减少了APP所占用的内容，给人们带来更多的方便。'),(77,687,'蔚澜——科教海洋游戏的研究与开发',1,3,NULL,0,0,1,NULL,0,'2019-11-13 01:41:09','随着网络游戏的不断发展，大多数青少年甚至成年人越来越对游戏产生了浓厚的兴趣，游戏不仅在玩法上吸引人，更是在模拟现实方面越来越真实。\n基于游戏中模拟现实能力这一点，以及在国家推进“海洋强国”建设目标的背景下，我们团队着手研发基于虚幻4引擎的科教海洋游戏的研究与开发，目前已研发出一款该类游戏，玩法是玩家需在深海中解决各种难题，护送开采资源的机器到达指定位置，并清理海洋垃圾，游戏过程中可以了解关于海洋资源的一些知识，认识到保护海洋的重要性。这种科教类的游戏由于寓教于乐的特点，备受家长及青少年的关注。'),(78,758,'创文化——彩调研究传播资讯室',1,3,NULL,0,0,1,NULL,0,'2019-11-13 01:54:44','本项目本着“传承地方传统文化，创新传播方式”的宗旨，以桂林彩调文化研究为基础，从彩调音乐、舞蹈、妆容、服饰、民俗文化等方面研究出发，并结合当下互联网运用趋势，运用“线上+线下”的新型传播模式打造新型桂林彩调研究及传播平台。此项目意在把彩调文化研究与互联网传播相结合，创新桂林彩调文化传播新形式，让更多人了解桂林彩调的发展历史、生存状态、内容形式、舞蹈艺术、音乐特色、地方文化色彩等，并吸引更多的人们加入到传承桂林彩调的行列中，助力于桂林彩调文化传承中。'),(79,1168,'视界——校园VR资讯工作室',1,4,21,0,0,0,NULL,0,'2019-11-13 02:32:25','视界——校园VR资讯工作室创新训练项目正是针对这一现象，拟通过手机为依托，通过微信公众号来精准推送广告同时在拥有一定的经济效益之后再拟开发一个微信小程序并研发一个自助打印机来打印宣传单的同时发放优惠券，使其更加环保，且目标性更强，更重要的一点是让目标消费者主动接收宣传单而不是被动接受。\n在项目中，以微信公众号为载体拟开发一个微信小程序。微信公众可通过推文等形式向目标消费者推送商家广告信息，商家也可通过小程序远程上传宣传单版面内容到“传单自助打印机”上，同时提供消费优惠券供已打印传单者免费领取。打印机将传单内容自动进行分类，显示在其显示屏上，消费者可通过微信小程序观看传单内容并通过扫二维码打印该传单进行更多的了解。这不仅解放了商家更方便了消费者。'),(80,1142,'“木藝”工作室',2,4,20,0,0,0,NULL,0,'2019-11-13 02:51:29','“木藝”工作室秉承“追求自然，回归本真”精神，以弘扬中国传统木制文化为工作室宗旨，在木工艺品的设计生产过程中不断融入中国传统文化的同时，结合现代文化的特点，设计制作富有艺术性、生活性、以及时代象征性的特色木工艺品，以此符合现代广大消费者的需求。“木藝”工作室人员组成全部来自工业设计专业大学生集体，因此在保证专业性的同时又兼具大学生活跃的设计思维，使得设计的产品不会显得古板，在此基础上又融入传统文化的元素，以活跃的设计思维、不断提升工艺产品的品质，从而向市场推出各类木制工艺产品，打造设计—生产—包装-销售一条龙服务，为工作室创造利润。同时也能以此促进中国传统木制文化的宣传与发展。'),(81,344,'儿童安全座椅双层分级吸能装置研发',1,4,20,0,0,0,NULL,0,'2019-11-13 03:23:22','       现市面上含吸能装置的汽车儿童座椅只有“好孩子”品牌，其吸能结构装置采用单层吸能，也缺少触发装置，导致儿童安全座椅面对不同碰撞速度不能发挥最佳的吸能效果；而其吸能装置采用蜂窝结构面外冲击方式，初始峰值载荷较高，而初始峰值载荷直接影响到儿童乘员的安全。从能量耗散角度来看其结构并不是最好的，还存在安全性能问题。\n       本项目基于上述问题设计了能有效的将碰撞时安全带收到的能量释放的双层分级吸能装置。实现对首层吸能蜂窝在未发生碰撞时的初始保，解决单层吸能装置难以应付不同冲击速度要求的问题，提高儿童乘车安全性。\n'),(82,1170,'关于西江流域龙舟文化的研究',1,1,NULL,0,0,0,NULL,0,'2019-11-13 04:53:50','本项目是以中国龙舟文化为本，聚焦于岭南龙舟文化，寻其源、溯其本，追踪西江流域一带龙舟文化的兴衰历史，深入探索龙舟文化的起源和现实发展前景。我们将通过史料查询、专家咨询以及实地调查研究等方式，逐步了解和研究龙舟文化的发展历程，研究能够做到有理可依、有据可查、实事求是。通过研究，我们将形成较为完整和系统的西江流域一带龙舟文化起源和发展的历史脉络，并通过活动及产品设计，结合创新创业，影响更多的人去关注、了解这一传统文化，让其迸发更大的生命力和影响力，促进文化育人，激发人们的文化自信，为建成文化强国贡献力量。'),(83,1134,'青彩教育文化工作室',2,4,21,0,0,0,NULL,0,'2019-11-13 04:54:28','青彩教育文化工作室是专门为中小学课堂学习而展开设计制作教学视频课件的工作室，工作室针对课本内容、教学要求、知识点要素，运用3D制图、动漫、VR、视频、音乐制作精美、通俗易懂的媒体教学课件。工作室制作的作品内容，将改变之前采用图文的PPT形式，用视频将知识内容演绎，让中小学生能够更快、更好、更深的记住知识。我们工作室专注中小学教学视频的制作，其他业务也进行学校宣传片、校园微电影、教育宣传片的制作，打造一个有校园特色的媒体工作室。'),(84,253,'六堡茶揉捻机装备研发',1,4,20,0,0,0,NULL,0,'2019-11-13 05:01:04','该项目的研发内容是针对六堡茶茶叶揉捻成型成条的一个机器，六堡茶经过反复地翻炒达到一定的效果后，需要进行揉捻成条，挤压出茶叶内部的茶汁，使得茶叶紧绷成条成型，这个过程需要一定的力道揉捻挤压。该机器运用曲柄结构、齿轮机构、螺纹机构等结构结合传统的手工揉捻成型成条的原理，设计出旋转运动的揉盘，揉盘内壁的环形棱骨结构能够使得通过加压的六堡茶茶叶挤压成型成条，提高六堡茶的成型成条质量，同时也提高生产效率。'),(85,618,'用电检测系统的设计与实现',1,1,NULL,0,0,0,NULL,0,'2019-11-13 05:21:33','本作品针对家庭用电安全，研究开发一种智能、高效的用电监测系统，将监测系统部署在用电电器与供电线路之间，采用当前流行的传感器动态采集技术、网络数据传输技术、STM32微控制器技术对用电电流、电压、温度等各参数进行实时的监测，使家庭电器具有全自动的上传监测信息、报警、断开电源的功能，Web端的数据可视化分析为用户提供实际用电参数的依据，用户可以通过Internet对家庭用电设备进行远程的监控，很大程度上避免用电事故的发生。 '),(86,1171,'立体自行车停车库',1,4,20,0,0,0,NULL,0,'2019-11-13 06:32:46','本作品主要由升降装置、夹持装置、定位装置、横移装置等组成。升降装置主要由丝杆滑台和停车板组成，实现自行车的上升下降的功能。夹持装置由机械手夹具和丝杆滑台组成，主要实现对自行车的夹取功能。定位装置由单片机和传感器组成，主要实现自行车的停放定位功能。\n本作品的升降装置具有启动迅速，运行平稳、顺畅的特点，可保证自行车在升降过程中平稳不颠簸。夹持装置具有装夹准确、牢靠的特点，保证自行车推送过程的安全可靠。定位装置具有定位快速、准确的特点，可以节省寻车板的定位时间，提高工作效率。因此，本作品具有存取过程操作简便、快捷；存取速度平稳迅速，能达到节省存取时间，提高存取效率的目的。'),(87,1172,'小型自动跟踪式太阳能电池板系统',1,4,21,0,0,0,NULL,0,'2019-11-13 07:08:58','常规的太阳能电池板是固定不动的，这就造成了阳光无法长时间直射到电池板上，光照不够就会造成发电量不够，尤其是在冬天的时候，因阳光斜射北半球，阳光需要穿透更厚的大气层才能到达地面，这时阳光就更弱了。本设计产品主要针对一些小型太阳能电池板的应用场所，如太阳能路灯、太阳能信号灯、户外运动太阳能电源灯。设计产品在简便、灵活、易操作的前提下，降低制作成本和难度，利用光电传感器感应太阳的位置，并控制电机使电池板自动完成跟踪后能正对阳光直射方向，提高发电效率。'),(88,1100,'DIY手模制作',2,4,21,0,0,0,NULL,0,'2019-11-13 07:18:58','在这个充满个性的时代，个性就是时尚，顶尖时尚独一无二，独一无二的创意首推DIY自做。人们对手工体验越来越感兴趣，而DIY手模制作会给人们一种新奇的体验感，其创新点就在于自己的双手，创意手模+手势、绘画、苗族特色小手环相结合，本项目DIY手模制作产品属于摆饰物品，根据客户需求灵活进行创新，就会诠释新的艺术产品。同时，DIY手模制作近年来是一个新热点，且面向社会各类群体，具有广阔的消费市场和巨大的消费潜力，亲身制作出来的艺术产品会极具珍藏版纪念意义。'),(89,226,' 自动桑叶采摘机的设计与实现 ',1,4,20,0,0,0,NULL,0,'2019-11-13 07:26:33','本项目的研究内容是设计一款自动的桑叶采摘机，该设备主要由采摘装置和收集装置组成，采摘装置主要实现对不同高度的桑叶实施采摘，收集装置将散落下来的桑叶进行集中收集。目前桑叶的采摘仍然普遍采用人工采摘，桑农的劳动强度大，效率不是很高，而桑叶采摘机可以实现简单、快速、高效的采摘，解决了采摘劳动强度大的问题，解放了桑农的双手，具有广泛的市场前景和推广应用价值。'),(90,226,'泡沫铝填充管加工及实验研究',1,4,20,0,0,0,NULL,0,'2019-11-13 07:30:57','项目拟在指导老师的指导下，完成泡沫铝填充管的加工和制作，开展提高泡沫铝能量吸收的相关研究，通过直接填充方式将闭孔泡沫铝及铝管相结合。实验研究泡沫铝、铝管及泡沫铝填充管在低速撞击下的特征曲线。研究泡沫铝填充管在不同冲击能量及不同填充密度下变形模式，同时对泡沫银填充前后吸能特性进行对比。'),(91,166,'现代零售终端智能展台系统研发',1,4,21,0,0,0,NULL,0,'2019-11-13 07:44:22','现代零售终端智能展台系统是一个线上与线下实体结合的智能化零售系统。智能化是所有行业领域的一个发展方向和趋势。顺应新时代零售发展趋势，升级改造传统应用，利用新技术打造人、货、场智能商铺购物新场景。并且能够过数字化展示商品的同时、捕捉消费者行为大数据。能够利用显示屏展示多媒体技术，改变传统的静态展示方式，能够宣传品牌，塑造品牌形象，增加用户体验。通过智能终端，能够收集大量的数据，数据流化使得营销行动目标明确、可追踪、可衡量、可优化，从而造就了以数据为核心的营销闭环，即消费——数据——营销——效果——消费。'),(92,1173,'音乐学本科生的社会“公益”行动教学法',1,2,NULL,0,0,1,NULL,0,'2019-11-13 07:45:38','音乐学本科生的社会“公益”行动教学法是以音乐学专业所学的专业技能回报社会的一项行动教学法。项目不仅在于提醒当今时代的大学生关注公益事业，用在校所学知识去回馈社会，同时在社会公益行动过程中提高学生的技能、技巧及教学实践能力；最后还可加速学生“教师化”进程的转变。'),(93,143,'“互联网+”视频直播线上帮扶教学课堂项目',2,3,NULL,0,0,1,NULL,0,'2019-11-13 08:05:49','近年来，儿童权益越来越受到社会的广泛关注，为了提高儿童整体素质，让儿童获得技能提升，为此本团队提出互联网+帮扶课堂项目想法，并以“5+1+N”新模式为载体。\n“5”是指周一至周五的四点半放学之后，困境儿童聚集在儿童之家，配备两地相同的教学设备（电脑、摄像头、音响），大学生志愿者在固定网络教学点，运用视频直播或录制视频的新形式实现互联网+教学，选出班级课代表维持课堂秩序，时长为30分钟。\n“1”是指每月一次的教学任务检查，大学生志愿者服务团队下到乡镇进行面对面考核，与儿童进行互动交流，检查作业进度，根据学习任务的完成情况升级学习资源包。\n“N”是指在教学活动的过程中，开展多种形式的活动。\n'),(94,144,'互联网平台下乡村学习资源包的开发与升级',2,3,NULL,0,0,1,NULL,0,'2019-11-13 08:09:07','“互联网+学习资源包”是充分利用信息化的精准服务和智能环境，以覆盖每个帮扶点或活动场所的网络现状为参考，一方面向受助儿童提供信息化教学实践活动，提供定期定量定质的教学资源，另一方面链接赞助平台，如社会爱心人士、企业，通过线上分享，即时反馈等方式，加强双向了解与认识，增强可信度与真实性，着眼于解决受助地区的师资条件、课程开设单一等问题，推动规范统一的教育云服务，保证学习资源的充分利用与升级改造。'),(95,138,'宣传地方特色传统节日的动画短片制作',1,3,NULL,0,0,1,NULL,0,'2019-11-13 08:42:53','中国传统节日，形式多样、内容丰富，是中华民族悠久历史文化的重要组成部分。传统节日的形成，是一个民族或国家的历史文化长期积淀凝聚的过程。传统节日已是人尽皆知，但是地方特色传统文化却没有得到很好地推广，比如白族的三月街、苗族的花山节。那些艳丽的服饰、柔美的舞姿、新奇的节日活动鲜为人知。本项目主要是将地方特色传统节日的特色制作成动画短片，为其搭建一个舞台展示地方特色传统节日本身的魅力，让人们看到各个地方的特色传统节日的风俗，感受充满中华文化的节日乐趣，弘扬中华民族的优秀传统文化。'),(96,553,'明清时期广西移民与经济社会变迁研究',1,3,NULL,0,0,1,NULL,0,'2019-11-13 09:01:30','有史以来，广西就一直被人称为蛮夷之地，边疆地区。自秦汉以来，广西就陆续有移民迁入，随着中央政权统治的深入，内迁人口源源不断，特别是在明清两代，内迁人口达到一个高峰，且遍布广西各地，使广西地区民族杂居的局面不断扩大。且移民多来自发达地区，给广西带来了一定的发展机会，促进了当时的社会经济、文化等方面的发展，本项目主要研究明清时期，广西地区的外来移民给广西的经济社会变迁带来了哪些影响。通过研究，可以为广西地区现阶段经济社会的发展提供参考依据'),(97,1175,'双波纹薄壁管轴向冲击下的耐撞性实验研究',1,4,20,0,0,0,NULL,0,'2019-11-13 09:06:23','碰撞安全的耐撞性问题是汽车轻量化、高速化、大规模发展所需要解决的重要问题及研究热点，薄壁结构因其低质量、高能量吸收效率、较长的冲击行程和易于加工的诸多优点，已被广泛应用于结构耐撞性设计当中。然而，现有研究主要针对同一形状的不同尺寸进行研究，而横截面形状的拓扑关系及其演化也会对结构的能量吸收产生重要的影响。、\n本项目针对现有的波纹管主要是在轴向引入波纹，项目将正弦曲线引入到波纹管的横截面设计中，提出一种新型的正弦曲线横截面波纹管，通过振幅、基本公称直径和波纹数量来控制其横截面演化，对其耐撞性开展系统的研究。\n'),(98,174,'一字乾坤——汉字文化的心传承',1,3,NULL,0,0,1,NULL,0,'2019-11-13 09:12:03','本作品通过以CINEMA 4D为主的三维软件，结合现代意识流的创作手法，以“一”字由简到繁，由广及深，将“一生二，二生三，三生万物”理念诠释出来，川流不息，万物归一。将本作品投入到教育行业当中,既适应了当前转型信息化时代的趋势,也使文化教育不再单一化,使教育具有自己的品味、追求和理想，不再是为了教育文化而将学习者当做是教育的容器。使学习者体验到汉字在创作和使用过程中携带的丰富历史文化内涵。'),(99,1166,'基于数字图像技术的客观题分值统计系统',1,4,21,0,0,0,NULL,0,'2019-11-13 09:16:06','DSP技术最大的特点是结构较灵活，有较强的通用性，适于模块化设计，从而能提高算法效率。而基于CMOS图像传感器的图像采集系统，减少了光学图像采集部分的外围电路，缩小系统体积，节约成本。本项目采用基于高速DSP处理器+CMOS图像采集的选择题统分系统，能快速的算出试卷选择题的分数，节约时间和减少一些人为的错误。'),(100,1149,'精准帮扶课业辅导工作室',1,4,23,0,0,0,NULL,0,'2019-11-13 11:18:05','精准帮扶课业辅导工作室是以梧州学院学生为主体，秉承梧州学院11年来社区爱心助学班的宗旨，致力于打造专业化、品牌化、规模化的运行新机制，本项目打造的辅导品牌是“学易达”（简称XYD)。精准帮扶课业辅导工作室是通过互联网+的模式，利用各种方式进行服务和推广，同时建立现场精准课业辅导和线上咨询服务相结合的运行管理系统，设定热线电话、网络、社区为一体的优质服务客户端，这样就能很好地解决许多家长因为忙于工作缺少时间照顾指导孩子的实际困难，体现了精准帮扶的意图，进而提升学生整体素质，包括正确的三观、较为系统的知识结构和扎实的生活技能。'),(101,1102,'老记忆',1,4,23,0,0,0,NULL,0,'2019-11-13 11:21:25','时代发展迅速，一些老记忆老文化老建筑拆迁渐渐被人民所遗忘。本团队根据这个去追寻上世纪初的老文化老记忆通过互联网+文化新常态，将上世纪老一辈人的记忆进行系统的规划，通过微信公众号推文，以及老照片，还留存在老建筑进行精心的设计联想视频，创作老记忆的纪念品（比如手机外壳、短袖、陶瓷、、纪念册等)使得更多有梦想的青年能够参与到这个文化盛事以及创意生活等艺术形式的创作中来，放飞青春的文艺梦想。\n\n\n \n'),(102,308,'基于51单片机家居安防系统',1,1,NULL,0,0,1,NULL,0,'2019-11-13 11:55:01','本项目是基于51单片机智能家居安防系统。该安防系统主要包括感应卡门禁系统，门磁模块，烟雾感应器模块，有毒气体感应模块，采用无线模块（nrf2401）实现门禁系统和门磁与单片机之间数据互通。通过传感器采集烟雾浓度、温度和煤气浓度对室内烟雾温度和煤气的监测，除此之外，通过WIFI模块实现单片机与手机进行通信，主人可以通过手机接收到警报信息以及将消除警报的指令传给单片机，单片机实行相应指令将警报解除。该项目操作简单方便，适合居家使用。'),(103,308,'基于51单片机家居安防系统	',1,4,21,0,0,0,NULL,0,'2019-11-13 11:59:13','本项目是基于51单片机智能家居安防系统。该安防系统主要包括感应卡门禁系统，门磁模块，烟雾感应器模块，有毒气体感应模块，采用无线模块（nrf2401）实现门禁系统和门磁与单片机之间数据互通。通过传感器采集烟雾浓度、温度和煤气浓度对室内烟雾温度和煤气的监测，除此之外，通过WIFI模块实现单片机与手机进行通信，主人可以通过手机接收到警报信息以及将消除警报的指令传给单片机，单片机实行相应指令将警报解除。该项目操作简单方便，适合居家使用。'),(104,344,'儿童安全座椅双层分级吸能装置研发',1,1,NULL,0,0,1,NULL,0,'2019-11-13 12:05:25','       现市面上含吸能装置的汽车儿童座椅只有“好孩子”品牌，其吸能结构装置采用单层吸能，也缺少触发装置，导致儿童安全座椅面对不同碰撞速度不能发挥最佳的吸能效果；而其吸能装置采用蜂窝结构面外冲击方式，初始峰值载荷较高，而初始峰值载荷直接影响到儿童乘员的安全。从能量耗散角度来看其结构并不是最好的，还存在安全性能问题。\n       本项目基于上述问题设计了能有效的将碰撞时安全带收到的能量释放的双层分级吸能装置。实现对首层吸能蜂窝在未发生碰撞时的初始保，解决单层吸能装置难以应付不同冲击速度要求的问题，提高儿童乘车安全性。\n'),(105,571,'基于图像处理的车型识别系统研究',1,3,NULL,0,0,1,NULL,0,'2019-11-13 12:54:03','随着我国车辆保有量逐年稳步的增长，越来越多的车主利用套牌车辆逃避交各种税费，养路费，套牌车辆发生交通事故，肇事逃逸后难以追捕，给城市交通安全以及管理部门的工作带来了严峻的挑战。\n当前车辆识别主要依赖于车牌识别技术。近年来出现越来越多的将嫌疑车辆变为套牌车甚至无牌车的刑事案件。如能对该类车辆进行车辆识别与车辆排查筛选，将对协助破获相关刑事案件起到十分积极的作用，也将更有效地震慑违法犯罪。因此，基于非车牌特征的车脸识别技术将是本项目工作的一个特色与创新之处。该技术够从相关的交通视频或卡口图像中提取特征，并对车辆特征进行分析和处理，挖掘相关知识。智能化实行节省了大量的人力、物力的同时也为城市交通安全以及管理部门管理打击犯罪分子提供了巨大有力条件。\n'),(106,1130,'幼儿音乐启蒙的对策研究',1,2,NULL,0,0,1,NULL,0,'2019-11-13 13:07:16','2018年11月7日，《中共中央国务院关于学前教育深化改革规范发展的若干意见》发布，针对学前教育的深化改革和规范发展方面提出了具体意见。这反映了国家对学前教育的重视，而幼儿音乐启蒙教育是学前教育中不可替代的重要组成部分。《意见》中指出了目前幼儿音乐启蒙教育教学的方式和方法过于单一，导致幼儿在日常音乐启蒙教育过程中缺乏自主体验的问题。本项目主要特点如下：\n（1）引入多种教学方式，结合奥尔夫、达尔克罗兹、柯达伊三大音乐教育体系，使课堂教学游戏化，激发幼儿内心对艺术的追求，提高幼儿的音乐素养，帮助幼儿形成良好的个性和健全的人格；\n（2）幼儿教育与家庭教育相结合，为幼儿创建良好的音乐教育环境；\n（3）把幼儿作为音乐教学的主体，优化音乐教学模式，正确处理幼儿音乐教育同专业音乐教育之间的关系。'),(107,947,'虚拟示波器',1,3,NULL,0,0,1,NULL,0,'2019-11-13 13:17:19','随着科学科学研究不断深入，传统的示波器扩展性差、耗能高以及体积过大不易携带、调试界面过于复杂等问题在工程应用中日益突出。针对这些问题设计了基于STM32为核心，以labview软件开发平台开发的一款主控界面的多功能虚拟示波器。\n本项目的目标和预期成果为：通过模拟通道电路的设计，A/D转换电路的实现，采集数据的储存，上位机的设计以及编写，实现下位机与上位机的通信。最终可以实现波形显示，波形储存、回放，并能对波形进行简单的计算，显示被测波形的最大值、最小值、峰峰值、频率幅值等参数，还可以根据需求随时更改软件的功能和界面。该设计小巧轻便、价格便宜，功能俱全，在工程测试领域具有很强的实用性，且市场价值广阔。'),(108,58,'家居辅助机器人',1,3,NULL,0,0,1,NULL,0,'2019-11-13 13:18:58','该机器人是以STM32单片机为核心的家居辅助机器人。本设备可以为宠物投食；也可以为室内盆栽或者室外的各类植物进行浇水以及施肥；当室内存在火灾可能时，它将警报信息发送至手机端，可以预防火灾等灾害的发生，是一款自动多功能辅助机器人，可以实现长时间无人化自动管理。'),(109,948,'USB虚拟函数信号发生',1,3,NULL,0,0,1,NULL,0,'2019-11-13 13:20:59','随着电子技术的发展和产业的日益成熟，各种电子仪器设备都得到快速发展，由于国外信号发生器核心技术对我国实施技术垄断和封锁，我国现在的信号发生器多使用模拟器件为核心，波形不够平滑。因此设计一个基于STM32的函数信号发生器，通过芯片AD9854相关电路，上电编程输出正余弦波，矩形波（方波），MAX038输出三角波与锯齿波，上位机与STM32核心板通过串口连接，控制AD9854信号源输出的函数信号发生器。键盘输入频率和幅度值，实现高频率的波形输出和幅度占空比可调的基本功能。本项目设计目标和预期成果为：设计一个实现上位机控制系统的输出，频率幅度可调的高频率、高精度、转换速率快的USB虚拟函数信号发生器。'),(110,444,'维也纳',1,2,NULL,0,0,1,NULL,0,'2019-11-13 13:29:16','本产品名称是“围也纳”，意为围裙也可以用来收纳，以环保为主线设计的一款家庭日常用品。\n我们的特色是加入民族传统手工艺——刺绣。刺绣，是中国传统手工艺之一，流传时间已久，刺绣的种类很多，如:蜀绣，湘绣，满族刺绣，苏绣，粤绣等等。\n作为非物质文化遗产，传承人群应该要不断壮大，但是现在市场上见到的很多是机绣，不管是民族特色还是刺绣技巧在很大程度上都是在流失。时代的快速发展让很多民族特有的手工艺术都在一定程度上被机器代替。因此“围也纳”的创设与产品的设计还有另一个目标，希望热衷于刺绣的长辈或者现在的年轻人，都有机会加入到了刺绣的传承中来。'),(111,948,'USB虚拟函数信号发生器',1,3,NULL,0,0,1,NULL,0,'2019-11-13 13:54:07','随着电子技术的发展和产业的日益成熟，各种电子仪器设备都得到快速发展，由于国外信号发生器核心技术对我国实施技术垄断和封锁，我国现在的信号发生器多使用模拟器件为核心，波形不够平滑。因此设计一个基于STM32的函数信号发生器，通过芯片AD9854相关电路，上电编程输出正余弦波，矩形波（方波），MAX038输出三角波与锯齿波，上位机与STM32核心板通过串口连接，控制AD9854信号源输出的函数信号发生器。键盘输入频率和幅度值，实现高频率的波形输出和幅度占空比可调的基本功能。本项目设计目标和预期成果为：设计一个实现上位机控制系统的输出，频率幅度可调的高频率、高精度、转换速率快的USB虚拟函数信号发生器。'),(112,1131,'作坊式压榨食用花生油制作及安全检测',1,3,NULL,0,0,1,NULL,0,'2019-11-13 14:21:08','       本项目是对作坊式压榨食用花生油制作及检测的研究，安全放心花生油制作，是为了满足人们对优质、放心的原生态食品的追求的社会需求，针对目前作坊式压榨食用花生油生产鱼龙混杂、以次充好，且存在的黄曲霉素超标的现状，研制“安全、放心”的食品，极具现实意义。在广泛调研相关花生油压榨工艺方法的基础上，设计花生油压榨工艺流程，精心挑选新鲜安全放心优质的花生原料，剔除霉变花生，选用先进高效安全的设备，运用所学的林产化工工艺学及仪器分析、化工原理等专业知识，通过实验，改良设备及传统压榨工艺，对产品进行检验检测，保证花生油的安全、品质及香气，创立出安全、营养、优质花生油品牌。'),(113,1148,'民族歌曲流行化演唱的实践研究',1,3,NULL,0,0,1,NULL,0,'2019-11-13 14:40:44','       民族歌曲流行化演唱形式的出现和趋势，是国内文化艺术事业新形势下青睐的新兴事物和新的尝试，为民族歌曲的传承和发展找到了方法和途径，为民族歌曲注入了新的元素（流行音乐），丰富了民族歌曲的内容及创作形式，从而推动民族音乐的创新发展；本项目通过实践研究，对民族歌曲的调式调性、曲式结构、节奏节拍、伴奏形式以及歌唱语言等方面，进行流行化演唱的改编，对其进行更深层次的实践与研究，为流行音乐的创作注入了新鲜的血液，丰富了流行音乐的内容，也为流行音乐的创作指明了新的方向，而且通过与民族歌曲的结合，扩大流行音乐的受众范围，使流行音乐更具内涵和民族性。有了思想性和可挖掘性，在继承民间音乐精粹，发扬中国传统音乐的基础上流行化演唱改编是促进中国声乐艺术创作、演唱共同进步的一条康庄大道，促进文化艺术事业的大发展大繁荣。\n\n'),(114,1177,'久石文化传媒工作室',2,1,NULL,0,0,0,NULL,0,'2019-11-13 15:01:28','久石文化传媒工作室主营大型舞台设计与设备租赁、演出策划及承办、晚会礼仪模特等艺人包装、婚庆服务、影视拍摄及后期，涉及舞美设计、宣传海报、视频剪辑、各种软件学习等多个领域的一体化传媒服务。一体化，就是把策划执行设计，舞台灯光音响和礼仪模特，音乐舞蹈等资源结合设立自己的培训机构和人才输出渠道。'),(115,1130,'幼儿音乐启蒙的对策研究',1,2,NULL,0,0,1,NULL,0,'2019-11-13 15:46:26','2018年11月7日，《中共中央国务院关于学前教育深化改革规范发展的若干意见》发布，针对学前教育的深化改革和规范发展方面提出了具体意见。这反映了国家对学前教育的重视，而幼儿音乐启蒙教育是学前教育中不可替代的重要组成部分。《意见》中指出了目前幼儿音乐启蒙教育教学的方式和方法过于单一，导致幼儿在日常音乐启蒙教育过程中缺乏自主体验的问题。本项目主要特点如下：\n（1）引入多种教学方式，结合奥尔夫、达尔克罗兹、柯达伊三大音乐教育体系，使课堂教学游戏化，激发幼儿内心对艺术的追求，提高幼儿的音乐素养，帮助幼儿形成良好的个性和健全的人格；\n（2）幼儿教育与家庭教育相结合，为幼儿创建良好的音乐教育环境；\n（3）把幼儿作为音乐教学的主体，优化音乐教学模式，正确处理幼儿音乐教育同专业音乐教育之间的关系。'),(116,44,'智能共享停车场',1,1,NULL,0,0,0,NULL,0,'2019-11-13 15:55:12','本项目主要是通过移动端平台及物联网相关技术，让用户可以在移动端上查找停车场的具体位置，查看停车场是否有剩余停车位并按个人需求预订停车时间段，然后根据地图给出的路线去停车场。当用户到达停车场时大门的自动识别车牌装置会通过系统来查看该车是否已经在平台预定车位，来决定是否放行。\n本项目通过移动互联网和物联网技术，使城市中有限的停车位实现资源利用最大化，节约人们寻找车位的时间，是解决“智能交通”中最后一公里的关键环节。\n'),(117,444,'维也纳',1,1,NULL,0,0,1,NULL,0,'2019-11-13 15:59:56','本产品名称是“围也纳”，意为围裙也可以用来收纳，以环保为主线设计的一款家庭日常用品。\n我们的特色是加入民族传统手工艺——刺绣。刺绣，是中国传统手工艺之一，流传时间已久，刺绣的种类很多，如:蜀绣，湘绣，满族刺绣，苏绣，粤绣等等。\n作为非物质文化遗产，传承人群应该要不断壮大，但是现在市场上见到的很多是机绣，不管是民族特色还是刺绣技巧在很大程度上都是在流失。时代的快速发展让很多民族特有的手工艺术都在一定程度上被机器代替。因此“围也纳”的创设与产品的设计还有另一个目标，希望热衷于刺绣的长辈或者现在的年轻人，都有机会加入到了刺绣的传承中来。'),(118,444,'维也纳',1,1,NULL,0,0,1,NULL,0,'2019-11-13 15:59:56','本产品名称是“围也纳”，意为围裙也可以用来收纳，以环保为主线设计的一款家庭日常用品。\n我们的特色是加入民族传统手工艺——刺绣。刺绣，是中国传统手工艺之一，流传时间已久，刺绣的种类很多，如:蜀绣，湘绣，满族刺绣，苏绣，粤绣等等。\n作为非物质文化遗产，传承人群应该要不断壮大，但是现在市场上见到的很多是机绣，不管是民族特色还是刺绣技巧在很大程度上都是在流失。时代的快速发展让很多民族特有的手工艺术都在一定程度上被机器代替。因此“围也纳”的创设与产品的设计还有另一个目标，希望热衷于刺绣的长辈或者现在的年轻人，都有机会加入到了刺绣的传承中来。'),(119,444,'维也纳',1,1,NULL,0,0,1,NULL,0,'2019-11-13 16:08:36','本产品名称是“围也纳”，意为围裙也可以用来收纳，以环保为主线设计的一款家庭日常用品。\n我们的特色是加入民族传统手工艺——刺绣。刺绣，是中国传统手工艺之一，流传时间已久，刺绣的种类很多，如:蜀绣，湘绣，满族刺绣，苏绣，粤绣等等。\n作为非物质文化遗产，传承人群应该要不断壮大，但是现在市场上见到的很多是机绣，不管是民族特色还是刺绣技巧在很大程度上都是在流失。时代的快速发展让很多民族特有的手工艺术都在一定程度上被机器代替。因此“围也纳”的创设与产品的设计还有另一个目标，希望热衷于刺绣的长辈或者现在的年轻人，都有机会加入到了刺绣的传承中来。'),(120,1132,'六堡茶速溶茶茶包',1,3,NULL,0,0,1,NULL,0,'2019-11-14 09:29:15','六堡茶是梧州市政府高度重视与重点扶持的农业产业之一，研制增强茶叶消费商品种类，是扩大茶叶产业化发展的重要渠道。为适应当下人们快节奏的生活需求，研制速溶六堡茶的生产方法，对增加六堡茶消费群体，发展梧州市六堡茶产业有着非常重要的意义。本项目通过对六堡茶茶包中茶的内含物与茶汁滋味口感营养影响的各种因素等进行分析，设计实验，改良工艺流程，速溶六堡茶茶包，保持六堡茶原有的香气、口感、滋味，并考虑商品的成本，外观、卖相，研制成六堡茶速溶茶包。'),(121,1143,'时尚食品炸葛片的研制方法',1,3,NULL,0,0,1,NULL,0,'2019-11-14 09:33:49','葛根又名粉葛、葛麻藤等，为豆科植物葛藤属植物，含有丰富的淀粉、异黄酮类物质，又有钙、硒、铁、铜、磷、钾等十多种人体所必需的微量元素，具有断谷不饥、解表退热、生津止渴、开胃下食、疗痔防癌等功效，其性味甘、辛、凉，对外感发热头痛、项背强痛，麻疹不透，热痢，泄泻等病症疗效明显。现代医学认为，葛根含异葛根素、大豆黄酮苷和三萜类葛皂醇等成分，能有效防治心脑血管硬化，血小板黏附和血栓形成。\n加工过程\n1.原料选择：菜市场选择无损坏的新鲜葛根20斤。\n2.去皮及清洗：葛根在不破坏其纤维结构的前提下刨去外皮，并用清水清洗干净。\n3.切片将去皮后的葛根用蔬菜切片机切成一定规格的片状物，缩短干燥、炸制的时间，切片厚度、长、宽均为1厘米。将切片后的葛根浸泡在清水中10-15分钟，切片过程要尽量在短时间内完成，以控制切片过程中的酶促褐变的发生，导致葛根变黑。\n2.4晾晒\n把切片后的葛根铺在平整干净的地面上晾晒，可'),(122,1130,'幼儿音乐启蒙的对策研究',1,1,NULL,0,0,0,NULL,0,'2019-11-14 13:38:02','2018年11月7日，《中共中央国务院关于学前教育深化改革规范发展的若干意见》发布，针对学前教育的深化改革和规范发展方面提出了具体意见。这反映了国家对学前教育的重视，而幼儿音乐启蒙教育是学前教育中不可替代的重要组成部分。《意见》中指出了目前幼儿音乐启蒙教育教学的方式和方法过于单一，导致幼儿在日常音乐启蒙教育过程中缺乏自主体验的问题。本项目主要特点如下：\n（1）引入多种教学方式，结合奥尔夫、达尔克罗兹、柯达伊三大音乐教育体系，使课堂教学游戏化，激发幼儿内心对艺术的追求，提高幼儿的音乐素养，帮助幼儿形成良好的个性和健全的人格；\n（2）幼儿教育与家庭教育相结合，为幼儿创建良好的音乐教育环境；\n（3）把幼儿作为音乐教学的主体，优化音乐教学模式，正确处理幼儿音乐教育同专业音乐教育之间的关系。'),(123,44,'智能共享停车场',1,4,20,0,0,0,NULL,0,'2019-11-14 15:58:22','本项目主要是通过移动端平台及物联网相关技术，让用户可以在移动端上查找停车场的具体位置，查看停车场是否有剩余停车位并按个人需求预订停车时间段，然后根据地图给出的路线去停车场。当用户到达停车场时大门的自动识别车牌装置会通过系统来查看该车是否已经在平台预定车位，来决定是否放行。 本项目通过移动互联网和物联网技术，使城市中有限的停车位实现资源利用最大化，节约人们寻找车位的时间，是解决“智能交通”中最后一公里的关键环节。 '),(124,1173,'音乐学本科生的社会“公益”行动教学法',1,4,23,0,0,0,NULL,0,'2019-11-15 06:36:35','音乐学本科生的社会“公益”行动教学法是以音乐学专业所学的专业技能回报社会的一项行动教学法。项目不仅在于提醒当今时代的大学生关注公益事业，用在校所学知识去回馈社会，同时在社会公益行动过程中提高学生的技能、技巧及教学实践能力；最后还可加速学生“教师化”进程的转变。'),(125,1118,'梧院人家六堡茶叶店',1,4,23,0,0,0,NULL,0,'2019-11-18 02:06:08','梧院人家六堡茶叶店是以销售梧州六堡茶为依托，旨在推广梧州源远流长的六堡茶文化。本项目将商业和公益相结合，商业上采用线上线下相结合的销售模式，线下以梧州学院E茶空间为创业工作室，面向全校师生进行茶叶销售，线上利用网店以及微信等互联网手段面向全国各地进行网络销售，在销售茶产品的同时，通过信件、外包装等方式发展与传播梧州六堡茶文化。梧州学院E茶空间作为学生自主经营和管理的大学生创业公益平台，我们在销售茶叶的同时，不忘公益使命，我们希望通过公益将梧州六堡茶文化传播到社会的每一个角落，吸引社会上越来越多的人参与到六堡茶文化传播的事业上来。'),(126,1046,'112',1,5,22,0,0,1,54.100000,0,'2019-11-18 04:58:00','12123123');
