INSERT INTO `innovate_finish_signing_opinion` VALUES (7,25,1107,'项目完成较好，同意结题。','2019-11-07',0),(8,24,130,'符合结题要求，同意结题。','2019-11-07',0),(9,27,43,'该学生大创项目以AT89S52单片机为核心控制元件，设计一款家庭用燃气安全系统。该家用燃气安全系统由按键模块、显示模块、温度检测模块、然气浓度检测模块、火灾烟雾浓度检测模块、声光报警模块等构成，可实现多种功能：1.显示功能，可实时监控家庭中室内燃气的浓度、烟雾的浓度和温度的具体数值；2.声光报警功能，当家庭中室内燃气泄漏或者发生火灾起火，能实现声光报警，起到及时预警作用；3.通风换气功能，当家庭发生燃气泄漏时，排气扇电机转动，对室内的燃气进行排出，实现通风换气功能；4.关闭燃气阀门功能，当家庭燃气泄漏或起火时，控制燃气管道电磁阀门关闭，避免了燃气起火或加重火势的作用。总的来说，该系统的优点在于硬件电路简单，软件功能完善，性价比较高，具有一定的实用价值，达到了项目预期的研究目标。\n该大创项目小组的学生从申报项目、查阅资料，到分工合作设计制作作品、测试改进完善作品整个过程中都体现出科学研究的态度和精神，工作较认真严谨，合作较细致明确，实践较充分，达到了大创项目的锻炼价值。\n该项目还存在进一步的提升改良空间，比如对系统检测灵敏度的控制和调节，对误报警的预防和处置等，有待今后继续完善。','2019-11-07',0),(10,31,330,'同意结题。','2019-11-09',0),(11,28,106,'同意该项目结题申请。','2019-11-10',0),(12,34,699,'同意结题','2019-11-11',0),(13,37,1145,'符合结题要求，同意通过。','2019-11-11',0),(14,38,1107,'项目完成较好，同意结题。','2019-11-11',0),(15,30,321,'同意结题','2019-11-12',0),(16,35,321,'同意结题','2019-11-12',0),(17,43,318,'作品实现了预定的功能，具备一定的创新性，达到了预定要求，可以申请结题。','2019-11-12',0),(18,46,318,'作品实现了针对空气中PM2.5和PM10等污染物的检测功能，能结合风速和风向等传感器实现数据的分析功能，有较好的创新性，达到了预定要求，可以申请结题。','2019-11-12',0),(19,47,326,'作品实现了导盲杖的避障、水洼检测等功能，具备一定的创新性，达到了预定要求，可以申请结题。','2019-11-12',0),(20,48,1154,'同意','2019-11-12',0),(21,50,109,'该项目以六堡茶种植教学为例，应用新兴的VR技术，以创新的形式设计开发《六堡茶种植技术虚拟仿真教学辅助系统》软件。运用了现代教育教学理论与虚拟仿真技术相融合开发农业相关教学产品具有重要参考意义。在团队合作协调上，项目团队成员，积极乐观，互帮互助，组成结构合理，具有良好得钻研精神，项目思路清晰，计划合理，同意结题。','2019-11-12',0),(22,40,109,'该项目立依托Unity3D软件进行C#脚本的开发，技术成熟，极大地提高了团队成员建模和开发脚本的能力。该软件的实现，弥补了市场上的三维仿真教学辅助软件不足，提高了学生对理论知识的理解以及操作实验的熟练度。\n同意结题！','2019-11-12',0),(23,51,302,'情况属实，同意该项目申报结题。','2019-11-12',0),(24,54,1156,'审核无意见，同意该项目结题。','2019-11-12',0),(25,56,106,'项目通过','2019-11-12',0),(26,32,716,'该项目属于创新训练项目，项目成员是学前教育专业学生，且学习成绩优异。在项目实施过程中，该同学能利用自己的专业知识，分析目前幼儿音乐启蒙的存在的问题，并提出相应的对策，通过实践教学，设计出适合幼儿身心发展的教学内容。同时，把该项目带到地方相关部门的公益培训当中，吸引了更多幼儿参与到项目训练当中，做到理论与实践相结合。最后，该项目以公益演出的形式呈现训练成果。\n同意推荐结题。','2019-11-12',0),(27,62,1162,'同意结题','2019-11-12',0),(28,62,1162,'同意结题','2019-11-12',0),(29,72,624,'同意','2019-11-12',0),(30,64,175,'同意，通过！','2019-11-13',0),(31,69,175,'同意，通过！','2019-11-13',0),(32,44,543,'智能写绘机器人基于STM32主控设计，结合步进电机和驱动模块构建而成，能实现上位机文本输入或简单语音输入指令完成文字书写和简单图像绘画，除了手机交互功能外其他功能基本实现，满足设计要求，同意结题。','2019-11-13',0),(33,80,1147,'同意通过审批','2019-11-13',0),(34,71,48,'课题组成员经过详细的实证调查与数据分析，比较圆满的完成了课题结项所需的理论成果，同意结题。','2019-11-13',0),(35,83,48,'青彩文化工作室是一个有创意有温度的项目，经过一年的筹备、落实、活动组织、项目实施等，现已较为圆满的完成全部内容，同意结项。','2019-11-13',0),(36,55,326,'本项目在实时过程中对用电监测的应用做了较充分的调研，下位机基本实现了对用电参数的检测，上位机实现了电器用电信息的显示与处理。整体而言，项目实现了预定的要求，可以申请结题。','2019-11-13',0),(37,86,128,'材料齐全，同意申请结题。','2019-11-13',0),(38,49,172,'该项目属于梧州学院区级大学生创新训练项目。从该项目的结题申报书来看，本项目应习近平主席创新文化的要求，响应国家号召，以党为核心，根据我国的“一带一路”发展战略。将中国文化与各国地域结合，以数字动画的表现手法讲述“一带一路”中国与各国家文化交流的历史故事。希望通过移动端平台让更多的人了解“一带一路”的发展前景。\n  该项目在专业性、应用性和创新性上都有一定的涉及，所取得的研究结果与项目研究方向基本一致。拟同意结题。\n','2019-11-13',0),(39,88,1156,'审核无意见，同意该项目进入结题程序。','2019-11-13',0),(40,93,1174,'通过','2019-11-13',0),(41,94,1174,'通过','2019-11-13',0),(42,68,300,'通过。','2019-11-13',0),(43,67,300,'通过。','2019-11-13',0),(44,99,1165,'该项目研究的内容具有一定的创新应用价值，同意申报。','2019-11-13',0),(45,57,713,'《D.K化妆工作室》团队成员性格开朗，活泼大方，做事有责任感，专业素养优秀，有爱心，耐心，细心，能团结一致遇到困难不退缩，勇进，具备着良好的心理素质，能够抵挡创业路上所有的困难，挫折。本项目初期因经验不足，无法估摸市场的动态，不能及时满足客户的要求，回头客少。成员为了解决困境，自掏腰包去学习化妆技术，主动上门服务顾客，并从身边寻找客源，经过努力项目中期以达到预期目标。在创业实践活动中，成员的化妆技术、工作责任感、沟通交流能力及账目管理能力都得到了很大的提高。项目后期成员黄雨已开设一间化妆门店，经营效果良好。项目以达到预期目标，同意结题。\n   \n','2019-11-13',0),(46,92,713,'《音乐学本科生的社会“公益”行动教学法》旨在通过音乐学专业学生将所学的专业技能回报社会的公益行动教学法。项目成员用在校所学知识回馈社会，在社会“公益”行动过程中提高了学生的技能、技巧及教学实践能力，加速学生“教师化”进程的转变；其次，通过学生参与公益行动教学法的活动培养了当今大学生的公益责任感，也给受益人群带去一份关爱，激发了音乐学本科生的公益情怀，塑造了学生高尚的道德情操。最后音乐学本科生“公益”行动教学法也为青少年提供了人人平等的音乐教育机会。项目基本按照预期目标完成，团队成员能互相影响，精诚协作，教学效果良好，项目小学员在参加梧州市的活动和比赛中也取得了不错的成绩：五名小学员参加了“2019年第十三届广西少年儿童艺术比赛”，其中一人获银奖：两名小学员参加了“第十九届中国东盟青少年艺术盛典梧州选拔赛”；四名小学员参加“2019年梧州市少儿春节联欢晚会海选”,并成功晋级复赛。项目已达预期目标，同意结题。','2019-11-13',0),(47,33,108,'拟同意。','2019-11-13',0),(48,33,108,'拟同意。','2019-11-13',0),(49,41,108,'拟同意。','2019-11-13',0),(50,76,108,'拟同意。','2019-11-13',0),(51,76,108,'拟同意。','2019-11-13',0),(52,78,752,'收到了预定的训练效果，同意结题。','2019-11-13',0),(53,95,116,'同意结题','2019-11-13',0),(54,70,116,'同意结题','2019-11-13',0),(55,36,115,'该项目达到立项目标，符合结题标准，批准结题。','2019-11-13',0),(56,63,230,'满足结题条件，同意结题。','2019-11-13',0),(57,87,43,'该大创项目设计产品主要针对一些小型太阳能电池板的应用场所，如太阳能路灯、太阳能信号灯、户外运动太阳能电源灯等。其以光敏电阻传感器系统作为信号检测，以单片机为核心控制驱动电路带动电机运行，调节太阳能电池板的高度角和方位角，从而实现了太阳位置自动跟踪的功能，保证太阳能电池板所在的平面与太阳光线垂直，提高了太阳能的发电效率。设计产品在简便、灵活、易控制的前提下，降低了制作成本和制作难度，简化了工作流程，基本达到了预期的研究目标。\n该大创项目小组的学生从申报项目、查阅资料，到分工合作设计制作作品、测试改进完善作品整个过程中都体现出科学研究的态度和精神，工作较认真严谨，合作较细致明确，实践较充分，达到了大创项目的锻炼价值。\n该设计作品还存在进一步的提升改良空间，如电路板没有防水保护措施，对于一个应用于户外的电子产品来说，防水是必须具备的能力，否则无法正常工作。传感器部分采用的是光敏电阻，光敏电阻的线性度较差，且在强光照射下温度会升高，温度的变化会对光敏电阻的检测效果产生影响。','2019-11-13',0),(58,77,115,'该项目已完成立项目标工作，达到结题标准。同意结题。','2019-11-13',0),(59,81,103,'同意结题','2019-11-13',0),(60,84,103,'同意结题','2019-11-13',0),(61,90,103,'同意结题','2019-11-13',0),(62,97,103,'同意结题','2019-11-13',0),(63,53,82,'同意申请结题','2019-11-13',0),(64,18,71,'由于学生前期没有接到发表论文的通知，所以在提交结题材料时没有这方面的材料。其他方面的已经达到了结题要求。请学院考虑是否结题？','2019-11-13',0),(65,103,124,'同意结题','2019-11-13',0),(66,98,109,'同意该项目的结题申请','2019-11-13',0),(67,91,109,'同意该项目的结题申请','2019-11-13',0),(68,100,1150,'精准帮扶课业辅导工作室，以梧州学院坚守了11年的社区爱心助学班为依托，在互联网+的背景下，不断创新方式方法，努力打造“学易达”公益创业品牌，基础扎实，效果良好。作为在校生，基本完成了项目目标，同意申请结题。','2019-11-13',0),(69,108,771,'同意','2019-11-13',0),(70,107,455,'同意','2019-11-13',0),(71,109,455,'同意','2019-11-13',0),(72,29,1103,'同意结题','2019-11-13',0),(73,105,54,'通过','2019-11-13',0),(74,111,455,'通过','2019-11-13',0),(75,106,716,'该项目是创新训练项目，项目负责人是学前教育专业学生。在项目实施过程中，能运用自己所学的专业知识，提出幼儿音乐启蒙的现状存在的问题，通过实践研究，提出相应的解决策略。同时，该项目负责人与地方群众艺术馆合作，开设公益培训班，吸引了不少幼儿参与。最终，以公益演出的形式展现项目研究成果。同意推荐结题。','2019-11-13',0),(76,113,503,'材料满足结题要求，同意审批','2019-11-13',0),(77,115,716,'该项目是创新训练项目，项目负责人是学前教育专业学生。在项目实施过程中，该同学能运用所学专业知识，发现幼儿音乐启蒙的现状存在的问题，并通过实践研究，提出相应的解决策略。同时，项目负责人与地方群众艺术馆合作，把项目带进公益培训班，吸引了众多幼儿参与。最终，以公益演出的形式展现项目研究成果。同意推荐结题。','2019-11-13',0),(78,101,234,'同意结题。','2019-11-14',0),(79,112,1141,'该项目获批后、项目组经过到食品药品监督局、食品药品检验所、花生油作坊、作坊式花生油机械应用、市场及消费者等多方调研，撰写产品实验方案及购买花生、精选花生，到油坊榨取花生油按照安全花生油对设备、原料的要求的制作过程的研究，产品主要安全指标黄曲霉素测定，并分析检测报告，都能按计划进行，项目主持人毕业后，16级学生接力延续。完成了从食品产品检测要求花生油安全制作的