INSERT INTO `innovate_match_info` VALUES (38,1,62,'基于区块链的可信数字资产存证工具的设计与实现','we can ',3,1,'随着 DT时代的到来，不管是企业还是个人都将会面临数据主权维护的问题。尤其是互联网金融、电子签约、电子商务、电子政务、网络医疗、知识产权保护等行业对电子数据资产取证和保全需求极其强烈。本系统根据现有企业和个人对电子数据保全的需求，借助区块链技术原理将电子数据存储在区块链上，并结合加密算法、数字签名、数字证书等技术手段，保证用户数据的真实性、完整性和有效性。','获国家级，有一定的投资。','无',NULL,6,10,0,0,0,81.500000,0,'2019-09-28 00:24:41'),(39,1,58,'室内导航系统','同路人',5,1,'室内导航是利用UWB1000技术在室内布设大量廉价的基站（参考节点坐标），各基站与各基站、基站与标签之间（三边定位）通过无线通信形成自组织网络系统，当标签移动（待定点）进入终端布置区域就会与终端自组网，组网后利用无线通信的方式快速将终端参考节点坐标自身的位置信息发送给主基站，主基站接收到终端的信息后通过OLED屏显示标签坐标值。标签再次通过串口把数据信息发送给STM32单片机，单片机处理得到的数据信息用TFT液晶屏显示并导航。','无','无',NULL,6,11,0,0,0,87.250000,0,'2019-09-28 00:24:41'),(40,1,52,'《万变不离其轴》三维动画短片的制作','树莓',5,1,'如今新媒体具有旺盛的生命力, 于近几年我国媒体的发展迅速，新媒体的发展日新月异，由于各类细分性媒体这种细分思维的影响，各种形式的创意嫁接层出不穷。同以往纸质媒介不同，新媒体具有表达性强、吸引力大、受众面广、传播速度快等优点，更能被人们所熟知。而此次团队制作的三维动画，则采取了较为新颖的三维生长动画来表现，相对一般的二维平面动画更有艺术感染力。因此，本项目期待通过以三维生长动画的形式传播和弘扬正能量。动画意在说明万变不离其宗，中国能有如今的成就，离不开中国共产党这个轴心的正确领导。','无','无',NULL,5,10,0,0,0,68.750000,0,'2019-09-28 00:24:41'),(43,1,65,'实时监控生命体征报警装置的研究','一行行 行行行队',5,1,'随着空巢老人的增多，独居老人在家里或者外出时易出现紧急情况且不能及时报警自救。本项目拟研究一种实时生命体征监控装置，此装置运用传感器对人体重要生理参数（血压、心跳、体温、脉搏等）进行采集。生命监测装置由GSM模块等组成，通过采集的数据和以往正常的数据进行对比分析，如果发生异常，视情况分等级进行通知，当心跳稍微超出的时候通过语音提示给本人，当情况危机的时候发信息给指定的亲人同时通过语音电话报警，自动向预设电话报警。\n','无','无',NULL,5,11,0,0,0,79.750000,0,'2019-09-28 00:24:41'),(44,1,67,'基于单片机的苍蝇捕捉器的设计','会飞的青蛙',5,1,'       在农村，苍蝇随处可见，不管放多少粘蝇贴也不能将苍蝇杀灭。而且苍蝇带有很多细菌，这是很多家庭的烦恼。为了解决这些问题我们研究了一款苍蝇捕捉器。\n      我们这款苍蝇捕捉器，为了使用方便采用充电电池供电，电路用ATMEGA16单片机作为控制核心，通过产生一定浓度的气味信号，引诱苍蝇进捕捉器，在捕捉器里面装上电网，当苍蝇飞入容器后，单片机控制高压输出模块产生高压电击苍蝇，使苍蝇被击毙，从而达到自动捕捉苍蝇的目的。','无','无',NULL,5,11,0,0,0,77.000000,0,'2019-09-28 00:24:41'),(46,1,100,'无线充电小车','向日葵',5,1,'无线充电安全性高、受天气影响小、节省道路空间，因此和充电桩相比更适宜运用于电动汽车，无线充电将对电动汽车推广起到重要促进作用。\n此项目采用无线充电技术给小车充电，充电效率达到80%以上且节能，续航时间长，能实现定时充电及自启动的功能；采用减速电机加四驱的结构，动力十足，可以爬陡坡，也可根据预想速度更换合适的电机。\n无线充电环节采用电磁感应定律原理；定时充电环节采用STM32F103RCT6芯片，此芯片可以以低功耗运行；自启动环节采用S8550三极管搭建电路；电源管理芯片采用TPS63020以实现稳定电压输出。\n本项目获得了2018年大学生电子设计大赛全区一等奖，得到了大赛评审专家一致好评。\n','无','无',NULL,5,11,0,0,0,88.250000,0,'2019-09-28 00:24:41'),(47,1,118,'绿植的种植与销售','绿植的种植与销售',5,1,'项目主要以种植室内绿植与销售为主。通过种植与销售不同的绿植，满足现代人健康生活，健康工作的生活理念。让每一盆绿植带着其使命，去到主人的身边。或用于观赏，或用于食用，或用于药用。为了做到创新，并使其具有竞争力，我们在种植的同时，会标注不同的植物的花语及其具体的适用方面，方便顾客根据其相关需要进行购买，让每一株绿植都能充分发挥它的作用。同时向顾客提供最基础的培育知识，或向更有经验的客户学习相关的知识，争取做到共同成长。\n\n','国家鼓励创新创业支持6000','无',NULL,5,11,0,0,0,80.500000,0,'2019-09-28 00:24:41'),(49,1,126,'儿童智能教学电子琴系统设计','天籁琴音',5,1,'本项目是以AT89S52单片机为核心控制元件，设计一个儿童智能教学电子琴系统，主要是以单片机为主控核心，加入16个按键和扬声器，内设置耳机接口，不影响到他人；配备液晶显示屏可显示时间、温度和湿度并伴有休息提醒，严格控制孩子的学习时间，能更好地劳逸结合；本设计还添加USB接口可与手机APP相连，并且具有跟弹功能，可引导初学者快速学习掌握弹奏曲目。当儿童智能教学电子琴系统闲置时，可作为护眼学习台灯来使用。总的来说，它的优点在于硬件电路易简化，软件功能完善，性价比较高，具有一定的实用性及人性化特点。','8000','无',NULL,5,11,0,0,0,81.750000,0,'2019-09-28 00:24:41'),(52,1,150,'国土土地房屋征收数据可视化系统的研究与制作 ','梦飞起航',5,1,'国土土地房屋征收数据可视化系统的研究与制作是一款展示国土土地征收数据情况并实现数据的可视化的一款系统，用户可以直接在该系统看到相关区域的每个地方土地征收情况，方便相关人员对国土土地征收情况进行相关的统计和规划。','无','获得“GTE虚拟沙盘可视化编辑系统”的专利权',NULL,5,10,0,0,0,77.333333,0,'2019-09-28 00:24:41'),(53,1,153,'极智少儿机器人教育机构','飞智团队',5,1,'极智少儿机器人教育机构以提升3-18岁的青少年儿童动手能力、创新思维和实践能力为主的专业性培训机构，通过精心研发的益智搭建、科技制作机器人组装编程等系列课程以及参加机器人国内外赛事等。培训以教育学专家主授课进行。通过搭建各类模型以及教具的使用等来培养孩子认真耐心的性格、团队意识，丰富了孩子们的知识层面，促进智力和IQ的提高。通过组装机器人和参加比赛，来学习各学科的知识，锻炼孩子的逻辑思维、创新、分析以及解决问题能力等。给孩子一个学习改变的机会，让孩子成为“未来精英”。','无','无',NULL,5,10,0,0,0,71.000000,0,'2019-09-28 00:24:41'),(54,1,159,'寻迹—广西古建筑三维动画宣传短片','承宣团队',5,1,'在当今网络风暴以及互联网的时代下，互联网作为主体充满了更多的挑战和机遇，网络成为了最快的传播途径。而其中动画短片的形式更是具有吸引力。本项目是基于三维技术的关于广西各地势古建筑的研究并且能在其基础上从一个全新的角度和视角来展现广西古建筑，以独特的艺术美来诠释广西古建筑，对广西历史文化古迹进行宣传，推进广西各地旅游业的快速发展，让观众从全新的视角欣赏广西古建筑，进而让观众更好地了解广西，展示广西各地古建筑千年历史悠久的底蕴与风貌的目的。','无','无',NULL,5,10,0,0,0,68.500000,0,'2019-09-28 00:24:41'),(55,1,146,'增强现实AR技术的中小学唐诗教育软件的研究与制作','育龄',5,1,'AR技术的出现于传统教育来讲是一次革新，当下AR在教育方面的引用案例有很多，却少有AR与唐诗结合的案例研究，究其所以是需要制作的场景十分繁杂。但本软件所使用到的Cinema 4D结合3ds Max建模软件技术大大减轻了制作的场景的复杂性。软件中选取经典唐诗里面相对短小精悍、琅琅上口的三首唐诗为例，展现出AR唐诗的可行性和趣味性和可发展性。唐诗AR软件使用AR技术与唐诗结合，很好地实现了虚拟与现实的无缝结合，通过移动终端让孩子们在快乐中学习唐诗，一定程度上促进了增强现实技术在中小学教育领域的应用。','无','无',NULL,5,10,0,0,0,83.250000,0,'2019-09-28 00:24:41'),(57,1,181,'LBS+AR社交精灵','精灵团队',5,1,'dfgdfgdfgdf','无','无',NULL,2,NULL,0,0,1,NULL,0,'2019-09-28 00:24:41'),(59,1,113,'智能互联网家具','赛斯科技工作室',4,1,'互联网智能家庭管理是将家庭普通生活用品和日常家具设计为通过APP实现对生活\n\n用品以及家具的控制以及信息收集。在家再也不用担心找不到物品的问题。外出也\n\n不必担心家中电器未关闭问题，只需要一个手机的APP就能远程开关电器，解决您\n\n的日常烦恼。以生活用品举例，比如将水杯内水量的测量、水温的测量、水量的显\n\n示、饮水提醒、水温过烫提醒等功能集成在水杯套上，将这些智能生活用品的信息\n\n传输至手机，通过手机APP可以看到这些生活用品的信息，以家具家电为例，可以\n\n在地下停车库，控制家里空调、点灯的开关，让用户在回家就可以享受温暖的家。\n\n互联网智能家庭管理可在生活中应用于日常清洁、烹饪、休息等生活情境的智能化\n\n家庭管家。','无','无',NULL,5,11,0,0,0,80.750000,0,'2019-09-28 00:24:41'),(69,1,44,'智能共享停车场','预停',3,1,'随着时代的发展与进步，人们更加追求智能化、快捷化的生活方式。当前车辆增多不仅增加了交通的压力，也给停车场的运营带来了巨大挑战，普通的停车场已经满足不了现代人智能化、快捷化的生活理念。\n为了解决当前日益突出的停车难、停车场工作效率低等问题，我们团队提出通过运用互联网和物联网等相关技术来研究和设计停车场的智能化管理。我们团队希望通过运用移动互联网和物联网等技术，一方面提供给司机用户快速寻找停车位的功能，另一方面能够通过我们的平台把停车位公开化，在一定程度上实现城市中有限的停车位资源利用最大化。','暂无','暂无',NULL,5,10,0,0,0,75.000000,0,'2019-09-28 00:24:41'),(70,1,135,'基于广西制造业利用外资问题的研究','击跃团队',1,1,'在我国，制造业一直以来都是使用外资的重要产业，广西是我国西南地区面向世界各国的南大门，具有其自身的独特优势，在改革开放和走出去战略引导下，广西制造业紧跟国家的政策，引进外资进行发展生产，外资的引入为广西的经济注入了新鲜的生命力，带来了高端生产技术和完整成熟的管理经验，为广西产业结构的优化升级注入了巨大的活力，起着至关重要的作用。然而其实际情况不容乐观，制造业的发展也受到了影响。在世界经济全球化的复杂环境下，广西制造业发展出现新的挑战与机遇，该项目针对如何应对快速增长的经济需求，做好带头的作用进行了研究。','无','无',NULL,5,10,0,0,0,55.333333,0,'2019-09-28 00:24:41'),(75,1,183,'交互式视频的制作与应用','辰鹰',3,1,'本项目旨在研究交互式视频的制作，以汉民族传统服饰作为研究对象，呈现给观众华夏服饰之美。为了满足观众可以根据自己的喜爱选择性地浏览内容，因此，每种款式的汉服都设定了一个小故事，通过mugeda在线交互制作工具，让每个故事分别由不同的按钮控制，当观众点击视频中的按钮就触发相应的剧情，若用户不点击按钮，故事的剧情也是完整的。交互式视频打破传统的单线视频制作，以交互+视频的方式，让观众真正和视频互动起来，更显趣味。','无','无',NULL,5,10,0,0,0,65.750000,0,'2019-09-28 00:24:41'),(77,1,201,'深海惊魂','玄易工作室',5,1,'近年来，在移动游戏的崛起和推动下，近三年全球游戏市场规模继续保持两位数增长。数据显示，2016 年全球游戏市场规模达到 6474 亿元，同增13.2%。2016 年中国游戏市场实际销售收入已至 1655 亿元，同增 17.6%，增速略有放缓，但仍高于全球平均增长率。\n因此，我们团队成立了《深海惊魂》这个项目。《深海惊魂》这个游戏能让玩家体验在深海之中探索，同时还要保护自己不受到变异生物的攻击，保护采矿机挖矿直到任务完成。\n本项目响应国家推进“海洋强国”建设的目标，不仅能让玩家感到游玩的乐趣，还能在游戏之中科普海洋之中都有哪些待开采的矿物，同时也通过丑陋的怪物来呼吁大家保护海洋环境。','无','无',NULL,5,10,0,0,0,80.000000,0,'2019-09-28 00:24:41'),(79,1,212,'多元侗情民族文化新媒体推广平台的实现','坐标系工作室',5,1,'现代传媒技术的发达和传媒使用的便利为文化传播提供了更加广阔的发展空间。新媒体环境下,互联网承担起发扬和传承侗族优秀民族传统文化的历史重任。当下民族传统文化正在逐渐被挖掘和展示，但是侗族的优秀民族文化却少有人去发掘、关注和宣传。本团队使用现代新传媒技术如：微视频， 动画，公众号，周边产品等等新媒体手段去呈现侗族优秀传统文化侗族服饰和侗族建筑。让人们能够通过新媒体传媒的方式去了解和关注侗族的传统优秀文化。','无','无',NULL,5,10,0,0,0,73.000000,0,'2019-09-28 00:24:41'),(80,1,155,'传承之路——新时代民族文化传承服务平台','民族文化传承小组',5,1,'本项目是通过收集我国各个民族的特色文化，结合中国特色新时代社会主义发展的趋势，在其基础上打造出民族文化商业品牌。线上通过网络传媒进行文化传播推广服务，线下开展文创产品、传习基地、创意民俗小镇、民族文化主题公园等工作。让更多的人了解并熟知我国的民族文化底蕴，让其得到良好的传承的同时，也能够带动民族文化产业发展，形成一个良好的文化传承趋势。','无','无',NULL,5,10,0,0,0,69.500000,0,'2019-09-28 00:24:41'),(81,1,167,'维度空间：摄像机立体教学的开拓','八维',3,1,'随着科技和互联网的发展，信息化正在深刻影响生活的方方面，包括教育。根据基础教育的不同环节，基础教育领域的教育信息化市场有以下细分市场：信息化程度较高，产品主要是或大或小的教育管理系统的教育管理；主要体现在互动式教学工具使用上的课堂教学；主要涉及电子学习内容和学习平台建设的课下学习。在这样的趋势下，我们团队发现在市场上，摄像机使用的频率会损耗相机，布灯、布置场景的开销也很巨大。通过分析，我们发现使用现在流行的虚拟现实技术、增强现实技术可以去解决这些问题。','无','无',NULL,5,10,0,0,0,73.250000,0,'2019-09-28 00:24:41'),(82,1,49,'梧州市学知家教服务有限公司','CHY',4,1,'该项目（梧州市学知家教服务公司）旨在为大学生与需要家教服务的学生、家长间建立的一个信息交互平台 ，实现资源互置。项目分为两大模块，一个模块面向梧州学院在校大学生，在为他们提供社会经验平台，另一方面面向中小学生及其家长，家长通过与教员线上沟通，线下试讲，打破传统，省时省力。既解决大学生渴望家教却没有资源问题，又解决家长找家教时浪费的时间及经济，实现经济效益最大化。同时也保证教员的人身安全，维护学生与家长的利益，将“以人为本，共求发展”作为公司的发展理念。借助大学生家教服务系统，打破传统并有机结合，结合线上线下，开创家教服务新纪元。','班服国度公司赞助5000元\n长城宝石厂赞助10000元','无',NULL,3,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(83,1,126,'一“箱”情愿跟你走','“箱”伴永远',5,1,'本项目是以STM32F103ZET6单片机为核心控制元件，设计一款可爬楼式智能跟随行李箱。系统以单片机为主控核心，主要由自动跟随模块、爬楼模块、电源模块、防盗模块、语音提醒模块组成，具有可自动跟随、爬楼、充电、自动报警、搭载儿童、语音提醒等人性化功能。本设计性能出众，适用性强，性价比高，使出行更加便捷，解决了目前行李箱笨重不便携带、易丢失、上楼梯不方便等问题，能够让人们放开双手轻松自由地出行，可以在各种场合使用并推广。','无','无',NULL,5,11,0,0,0,83.500000,0,'2019-09-28 00:24:41'),(86,1,132,'家装3D DIY系统的设计与实现','意家亲团队',5,1,'随着互联网技术的不断进步和发展，互联网家装开始在国内兴起。本项目大胆打破传统家装市场产业复杂冗余效率低的模式，结合Unity 3D 的操作系统、Visual Studio 的c#语言编写、Photoshop等设计软件为界面设计工具，实现对于模型库的使用添加、家装3D DIY系统界面的UI设计、DIY交互功能的使用，以及实现了使用Unity 3D引擎让各个数据的接口对接，最终完成智能化个性化家装系统。本项目一方面能让装修消费者足不出户就能完成家装的设计，在线上与设计师对装修方案进行沟通，另一方面给设计师搭建了更好的发展平台，为家装行业的发展带来更大的空间。家装3D DIY系统秉承着更快速、透明，让消费者更加省心、省时、省力，并且不需要实际装修中漫长的等待，只要简单地选择各种装修材料并布置就可以看到装修效果。','无','无',NULL,5,10,0,0,0,74.500000,0,'2019-09-28 00:24:41'),(89,2,180,'基于单帧运动模糊图像计算车辆运动速度','微团队',5,1,'车辆是我们交通出行的的重要工具，虽然为我们生活带来了较大的便利，但同时因超速问题会引发交通事故，在交通事故中，车辆速度是划分事故车辆责任的重要方面。通常运用监控视频检验车辆运动速度就是其中一种方法，但是至少需要2帧图像。本项目只需要1帧运动模糊图像，利用运动模糊图像产生机理，根据运动模糊长度和相机曝光时间，计算车辆速度。当发生交通事故时，只要测量模糊长度和相机曝光时间，就可以知道事故车辆的速度，这种方法更准确的划分事故车辆的责任，也大大提高了交通事故的处理速度。\n','暂无','暂无',NULL,5,11,0,0,0,84.750000,0,'2019-09-28 00:24:41'),(92,1,206,'梧州岭南文化研究—普及双钱龟苓文化动画制作','龟苓',2,1,'本项目是一个自媒体系列视频产品，通过AE、PR、PS为主的软件，以二维动画的形式展示了广西梧州岭南文化，其中我们制作了双钱龟苓膏为主题的子系列mg动画，全篇述说了龟苓膏的所含成分及药效，通过实地考察后将双钱龟苓膏的制作工序用动画展现出来。本项目将通过本地的风俗习惯、地方特色等方面对梧州进行描写和分析，使各地人们都能了解其文化底蕴并深刻体会到梧州传统文化博大精深，足以使人引以为豪，从而将优秀的梧州岭南文化传承并发扬光大。','无','无',NULL,5,10,0,0,0,65.500000,0,'2019-09-28 00:24:41'),(96,1,232,'联机VR摄影棚','绿舟团队',5,1,'传统的摄影实验教学中存在着实际场地不足，人多器材少，教学摄影棚数量无法满足教学需求等问题，造成实验教学效率低。同时设备损耗大，教学成本高，而VR虚拟摄影棚的出现可改变这种状况。VR虚拟摄影棚是基于SteamVR平台利用Unity开发技术开发的系统应用，它将相机拍摄的图像与VR技术实时地进行结合，在教学过程中可以根据教学内容的不同随机控制摄影棚的背景、灯光; 可以随意移动场景内人物的位置，对于取景和构图的训练大大节约了时间和成本，提高了学习效率，更好地发展并完善了摄影技术的教学。\n联机VR摄影棚可以实现多人异地实时同步操作也可以单人进行操作。允许用户拓展模型库以及自定义菜单。能够选择多种模特并任意调节他们的位置、提供多种道具的使用、可任意调节灯光颜色和亮度、可更换地板、场景可任意搭配等、可真实模拟相机的功能和效果、可保存和浏览照片。极大降低了摄影学习成本。\n','无','无',NULL,5,10,0,0,0,75.333333,0,'2019-09-28 00:24:41'),(100,1,163,'智尚—人工智能的先导者','智尚',5,1,'随着社会与科学技术的飞速发展，人工智能逐渐成为人们关注的焦点。智尚以“人工智能”为主题，通过自媒体动画运营形式，结合世界节日分别为不同的节日分期推送一系列人工智能在起居生活、安全防范、情感等多方面服务于人类社会的突破性创意视频及文章，借助各大媒体平台进行宣传。主动响应国务院发出的《新一代人工智能发展规划》的号召，致力于打造一个自主创新的人工智能自媒体品牌。','特色一：团队顺应时势发展，主动收集人工智能相关事件，推进和开拓畅想思路。\n特色二：团队成员均来自数字媒体技术专业学生，都具备有使用三维软件制作文化视频产品的能力和良好的团队协作能力。\n特色三：项目以人工智能结合世界节日的形式展现，通过对不同的节日推送不同的智能机器人动画，同时展开互动窗口，增强公众与团队的互动交流，发展前景更大。 \n创新点：运用自媒体依照相关节日推送相关主题智能化机器人的方式，通过趣味微视频形式向广大群众介绍一个新奇的智能化新世界，在情感、解惑、时讯等主题自媒体争相放彩时以机器人为主题突破口，开拓了新发展方向，在增添群众茶余饭后新趣味的同时达到宣传推广中国在智能化方面的伟大进步目的。从而引领及鼓励人们勇于突破和创新，同时益智及开发人们创新创造的能力。','（1）2019年1月：确定主题和总体走向。提出以“人工智能”为主题创建自媒体的想法，并召集组建团队；\n（2）2019年2月：进行市场调研和总体走向。进行市场分析和收集工作，构思项目运营方式，确定主题及路线走向，并整理成文案；\n（3）2019年1-2月，智尚工作室初步完成了“儿童节”与人工智能相结合的孩童情感调节型机器人视频的制作和主题机器人形象设计；\n（4）2019年2-3月，智尚工作室初步完成了“妇女节”与人工智能相结合的女性健康陪伴型机器人视频的制作和主题机器人形象设计；\n（5）2019年3-4月，智尚工作室初步完成了“全国消防日”与人工智能相结合的森林巡防机器人视频的制作和主题机器人形象设计。',NULL,5,10,0,0,0,73.750000,0,'2019-09-28 00:24:41'),(101,1,166,'现代零售终端智能展台系统研发','智云工作室',5,1,'现代零售终端智能展台系统是一个线上与线下实体结合的智能化零售系统。智能化是所有行业领域的一个发展方向和趋势。顺应新时代零售发展趋势，升级改造传统应用，利用新技术打造人、货、场智能商铺购物新场景。并且能够过数字化展示商品的同时、捕捉消费者行为大数据。能够利用显示屏展示多媒体技术，改变传统的静态展示方式，能够宣传品牌，塑造品牌形象，增加用户体验。通过智能终端，能够收集大量的数据，数据流化使得营销行动目标明确、可追踪、可衡量、可优化，从而造就了以数据为核心的营销闭环，即消费——数据——营销——效果——消费。','与梧州烟草局合作，开发烟草展示平台，获得投资十万','暂无',NULL,5,10,0,0,0,81.500000,0,'2019-09-28 00:24:41'),(103,1,241,'家庭用天然气安全系统的模拟研究','安全到家',3,1,'中国是一个使用天然气的大国，现在国内很多家庭在使用着天然气，其造成的安全事故每年都时有发生。本研究主要针对家庭设计一种天然气安全系统，起到天然气自动检测，泄漏报警，自动关闭和换气等功能，其结构、安装、使用较简便，能符合国内大多数家庭的需求。本项目的主要研究内容有：（1）制作家庭天然气安全模拟系统，包括天然气检测和报警器，天然气关闭和换气装置两大部分。（2）设置家庭使用环境，对家庭天然气安全模拟系统进行测试和改进。','无','无',NULL,5,11,0,0,0,79.000000,0,'2019-09-28 00:24:41'),(104,1,173,'虚实万象——沉浸式微课教学工作室','虚实万象',5,1,'本项目针对教学中存在的知识点不明确、教学难点多以及实践操作少等问题，从而创立一个基于影视制作的微课教学设计及应用的平台。通过搭建三维场景构造虚拟设备，以增强技术进行设备教学，以虚拟仿真进行镜头演练，针对影视制作各方面的问题，用微课解决影视方面技术点，与高校合作，在教学上充分调动学生的主动性，让学习者全身心投入到学习中，真正达到良好的教学效果。','无','无',NULL,5,10,0,0,0,81.000000,0,'2019-09-28 00:24:41'),(106,1,199,'增强现实技术在教学资源建设中的应用','Victor',3,1,'新兴的增强现实技术，在教育行业受到了广泛地重视，其在教学资源建设中的应用有着极其重要的作用，本项目主要研究增强现实技术的原理、应用技术及其在教育领域的应用情况，并以《影视制作与合成》课程增强现实教学资源的应用与评价，论证增强现实技术在教学资源建设中的潜力，弥补教学资源现状的缺陷。运用跟踪注册、人机交互、显示等技术来实现增强技术，以3Ds Max和 Rhino为主要的建模工具，使用基础建模、二维图形建模、多边形建模和NURBS建模等方法制作摄影摄像器材，实现教学系统的三维模型制作等等。','无','无',NULL,5,10,0,0,0,75.500000,0,'2019-09-28 00:24:41'),(107,1,68,'基于Matlab的宝石图像融合技术的研究','一克拉',1,1,'本项目基于图像融合技术进行宝石图像融合的研究。人工宝石具有其强反射特性，在利用图像对宝石进行结构研究和检测应用时，出现图像中成像后的宝石结构不完整或者难以辨析等问题。因此，本项目拟基于Matlab软件平台，采集不同的光照角度和亮度下的宝石成像图，通过图像融合技术两张或者多张宝石图像进行融合形成一张比较完整清晰的宝石图像。融合算法拟采用小波变换法，先对宝石图片进行预处理（去噪、几何校正等），然后进行图像配准与像素层融合，提取宝石的特征和特征分类，最后进行特征层的融合、特征识别和决策层的融合，最终显示出一张较完整清晰的宝石图片。本项目的研究成果可以为人工宝石的设计及检测提供参考，有利于梧州人工宝石产业的提升和发展。','无','无',NULL,5,11,0,0,0,80.250000,0,'2019-09-28 00:24:41'),(109,1,127,'可佩带非侵入式血糖监测手环','无名小队',3,1,'可佩带非侵入式血糖监测手环通过血糖检测探头探测人体手臂皮肤上的组织液液中的葡萄糖份子，获取人体血糖浓度的波动情况。可佩带非侵入式血糖监测手环的血糖探头上设置有柔性探针，柔性探针可插入到皮肤的组织液中，柔性探针的直径小于0.4毫米，几乎不被人体所排斥。手环通过NFC功能动态获取探头上的数据，达到监测血糖的目的。','2018年度国家级大学生创新创业项目','无',NULL,5,10,0,0,0,64.000000,0,'2019-09-28 00:24:41'),(111,1,216,'基于古建筑旅游的研究和开发','旅迹工作室',3,1,'基于古建筑旅游的研究和开发是旅迹工作室推出的第一个项目。该项目一方面可以满足用户在古建筑旅游方面的需要，不仅使人们放松身心，能让游客感受到古建筑深厚的文化底蕴；另一方面为古建筑的研究提供参考，进而更好地推动对中华民族优秀传统古建筑的宣传、保护和传承。','暂无','暂无',NULL,5,10,0,0,0,72.000000,0,'2019-09-28 00:24:41'),(113,1,164,'龙图腾','AR交互软件工作室',3,1,'AR技术就是增强现实就是现实与虚拟相互结合，而图腾就是崇拜的对像，也就是一个民族用一个事物来让自己去效仿或追限的行为。龙，是中国人想象中的完美生物，它有所有动物的优点，海陆空全能，呼风唤雨,腾云驾雾。龙图腾的象征意义就是指人们追求龙的境界，就要不断取长补短，完善自己，梦想终有一天能叱咤风云。 少有AR与中国传统图腾龙作为的案例研究，究其所以是需要制作的场景十分繁杂。但本软件所使用到的Cinema 4D结合3ds Max建模软件技术大大减轻了制作的场景的复杂性。软件中选取经典中国传统图腾龙去加以AR增强现实技术再一次生动形象地展现出龙的栩栩如生与图腾的信仰，让人们再一次感受到图腾的力量与壮丽美。','暂无','无',NULL,5,10,0,0,0,72.000000,0,'2019-09-28 00:24:41'),(115,1,254,'精智——基于云端大数据精准扶贫MG系列动画短片制作','精智团队',5,1,'当改革踏上新的征程，当发展确立新的目标，推动互联网、大数据、人工智能和实体经济深度融合是当前重要发展战略之一。云端大数据具有更强大的支撑力、洞察发现力和流程优化能力，基于大数据的数据可视化信息，扶贫工作能够更加精准。\n结合二维动画学，基于云端大数据精准扶贫MG动画通过收集分析现代各个领域的应用以及成就，以动画的形式生动形象地进行全方位、预测性地展示和分析国家科技领域在扶贫方面的成果。通过数据的分析，再通过大数据的方式展现，一方面能增强观众的视觉效应，再者能为大众提供一个交流互惠的平台，打开脑洞，发散思维，能够对人工智能扶贫有更深入的想发。基于国家科技研究成果的海量数据，通过模拟分析可以具有非常广泛的应用前景。\n','无','无',NULL,5,10,0,0,0,73.250000,0,'2019-09-28 00:24:41'),(116,1,251,'VR视频教学资源制作与应用 ','哈哈队',5,1,'虚拟现实在各行各业中得到广泛应用，在教育领域虚拟现实(VR)对教育的潜在益处已是不言而喻，一些学校已经在尝试使用VR视频教学，VR作为教育教学的一种新的手段，必然有它的价值所在。VR+教育的优势在于不仅能够满足教育知识点呈现方式的升级、高难度教学目标的生动呈现，也能满足教学实践操作和自适应探究学习的需求。这使得VR+教育从各个方面都给传统教育带来颠覆式创新力量。本项目，立足梧州学院，尝试制作VR视频教学资源，主要通过全景视频拍摄，全景视频拼接剪辑及后期处理，VR编辑器等技术，在现实中各种接口设备使用以辅助现代化多媒体教学，取其特有的沉浸式和交互性，打造全新的VR视频教学资源，从而提高教学效率。','6000','无',NULL,5,10,0,0,0,71.500000,0,'2019-09-28 00:24:41'),(117,1,137,'精准扶贫政策MG动画——户户通平台      ','MG动画开发工作室',3,1,'现今，精准扶贫政策宣传工作，党和政府都高度重视，如何将脱贫致富的理念、政策的深入基层的贫困户中，其中政策的宣传工作有着极其重要的作用，本项目主要研究以宣传扶贫政策为主题，通过制作 MG 动画系列短片为主，解读手册、连环画等为辅，详细介绍扶贫的大政方针，提高群众政策知晓率，每家每户贫困群众都能进一步了解精准扶贫的新思路、新政策。\n由于局限性，还有很多农村的贫困户文化水平不高，他们理解不了政策的长篇大论，面对这样的现状，我们的团队致力打造一个平台，将所有的扶贫政策、国家新闻都通过动画、连环画等形式，形象的展现给贫困户。以物联网为传播纽带、MG动画作为传播载体，我们将系列的政策动画不断通过网络平台发布，提高群众对扶贫政策的知晓率，营造人人知晓政策、人人参与扶贫攻坚的浓厚氛围。','暂无','无',NULL,5,10,0,0,0,74.500000,0,'2019-09-28 00:24:41'),(124,1,256,'微信端自助导诊系统','三人行',5,1,'随着互联网的迅速发展，通过网络导诊疾病的方式受到了广泛的关注。因此，当身体出现不适时，大多数人会通过互联网进行诊断然后到医院预约会诊。若医院规模大、科室多、单元布局复杂等。这往往会使患者花费过多的时间在寻找各种科室的路上，导致不能及时的治疗，甚至错过宝贵的救治时间。因此，设计开发一款集室内导航、路线绘制、自助导诊等功能于一体的跨平台多媒体互动导航的便民系统刻不容缓。本项目就以龙岩市龙岩人民医院为例，利用DCIM编辑器、EclipsePHP Studio编译器、3dsMax、百度AI开放平台的语音合成等技术，设计开发了一款医院自助导航、导诊系统，实现了3D/2D导航、语音播报、自助导诊等功能。','(1）本系统遵循用户体验至上的界面设计原则，且界面一目了然、干净清晰，操作简单快捷。在界面上，用户可以灵活地使用本系统上设置的功能，而不需要过多的讲解。\n（2）导航时可进行3D/2D的自由切换，与传统的2D相比给用户一种立体视觉增强了用户的体验。在3D视图模式下，单指滑动屏幕，可720度旋转查看地图，两指滑动可拖动平移地图，两指捏合可缩放地图。\n（3）具有指南针功能，能根据场景的方位从而旋转。同时具备复位功能，可以有效的防止用户迷路或走错方向。\n（4）在导诊页面用户可以点击身体不适的部位，系统会列出该部位的症状，用户选择与自己相同的症状之后，系统列出可能的疾病并且建议所要就诊的科室。\n（5）搜索导航时可以进行路线的绘制，并实时进行语音播报提示用户行走路线和转向，在行走到上下楼梯时会自动播放MG动画，MG动画色彩丰富有趣易吸引用户的注意力，使其在上下楼梯时要注意的安全隐患。','（1）已经完成需求分析，实地考察，收集数据资料，确定了系统的主体功能及技术路线；\n（2）完成场景模型的创建，并调节颜色及强度，为模型添加根节点并封装导出。\n（3）添加人体结构交互功能，并录入自助导诊数据，完成了自助室内导航功能的设定并制定出最佳路线。\n（4）注册并添加语音播报功能，制作动画视频并实现播放设置。\n（5）完成系统界面专家介绍、科室介绍及医院介绍的数据设计。',NULL,5,11,0,0,0,90.500000,0,'2019-09-28 00:24:41'),(126,1,262,' 筑梦——冰雪国度——中国标志建筑模板网站 ','筑梦',3,1,'随着时代的发展，现今我们已进入一个网络时代。网络时代给我们带来了很多好处，例如：它可以让我们足不出户就能知道国家大事，它也可以让我们在家躺着也能吃到香喷喷的饭菜，它还可以让我们把想学的东西在网上轻轻松松就能学到。为此，我们特意做了一个关于在网上学习建筑动画产品教程的项目：冰雪国度——中国标志建筑模板，希望可以方便那些对建筑方面感兴趣的人去学习。','无','无',NULL,5,11,0,0,0,79.750000,0,'2019-09-28 00:24:41'),(127,1,265,'基于虚拟仿真技术在农业教学中的应用','萃绿',5,1,'本项目《基于虚拟仿真技术在农业教学中的应用》主要是针对降低农业教学上实践活动中存在的经济与时间成本问题，以及提升教学质量，从而秉着“创高质高量农业教学，促国家农业大发展”这一信念，利用虚拟仿真技术还原实验场景，模拟仿真的操作，创立一个基于虚拟仿真技术在农业教学中的应用，解决传统农业教学中受时令限制、农产品生长状况限制和实践管理难度高导致的消耗时间长、教学质量不佳、练习损耗高的问题，同时可以兼顾教学效果和学习效率。更可以通过软件的使用过程中，知识点采用文字图片或视频展示，将教学与练习有机结合在一起，提高知识的整合度。','无','无',NULL,5,11,0,0,0,84.500000,0,'2019-09-28 00:24:41'),(174,1,194,'传统文化游戏宣传公司——灯笼的传说','七彩梦团队',5,1,'企业致力于打造一个以“灯笼”为主的传播传统文化的游戏平台。依托于互联网新媒体将灯笼文化以更加生动有趣的方式推广向大众。用更新颖、更易让人接受的方式让更多人了解传统的灯笼文化。前期主要是以在微信小程序发布益智类小游戏和公众号，之后将游戏逐步扩大，创立app等。其特色是具有中国传统文化元素的游戏，其主体围绕“灯笼”展开，具有中国风特色的游戏可以使人耳目一新，同时也能更好地了解中国传统文化。对现如今缺乏了解中华传统文化的青少年有一定的帮助，更能理解中国文化底蕴。','无','如今项目已经初步拟定了游戏的整体风格，已拥有整套风格的插画以及关于灯笼的传说的动画宣传片。并且创立了一个app，可以通过app打开拍照功能实现AR效果。',NULL,5,10,0,0,0,64.666667,0,'2019-09-28 00:24:41'),(177,1,266,'基于STM32的智能家居','红鲤鱼与绿鲤鱼',5,1,'本项目利用手机通过WiFi访问STM32单片机，通过传感器实现环境监控、照明、窗户、窗帘的智能控制，并将监控结果在手机上显示出来。控制中心由STM32微控制器、无线收发模块、传感器等组成。STM32通过和WiFi无线通信网络收发信号对家居生活中的各种电器进行控制和检测。控制中心将家庭中的各种电器连成网络，对用电设备的工作状态进行最大限度的节省能源。并且通过传感器对家居环境中的温度、湿度、有毒气体含量进行检测，保证居住的舒适与安全。用户可通过手机了解家庭情况。','大创启动资金加个人资金共计6000','未注册专利',NULL,2,NULL,0,0,1,NULL,0,'2019-09-28 00:24:41'),(178,1,248,'农村生态枇杷创业项目','土特产队',4,1,'    为了响应国家“大众创新，万众创业”，我们团队秉持着社会消费的主流趋势，更多的满足人们对生态农产品的需要。我们借助家乡枇杷产地优势，综合栽培各种反季节枇杷，做各种枇杷的独特吃法，满足全国其他省份消费者的需要。\n湖北鄂州梁子湾枇杷，果实近圆形，果皮剥离，色橙红，果肉橙红色，可食率73.24%以上，可溶性固形物12—15%，味浓甜、多汁、肉质软而细嫩。枇杷属绿色乔木、果黄色可食,叶、核入药有镇咳、清肺之功效。花期9—11月，果实成熟期5—6月。\n本项目的实施,有利于增加地方的经济，对增加农民收入、改善生态环境具有深远的社会效益和生态效益。','由于树苗已经有，所以树苗不用采购，因此主要费用在运输打广告及工人工资方面，所以综合费用大概3000-5000左右','无',NULL,0,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(184,1,279,'VR快捷编辑器','扶幽',5,1,'本项目利用Unity 3D结合Microsoft Visual Studio开发设计了一款无需编写代码、界面简单易懂、快速上手的VR快捷编辑器。该编辑器拥有利用Adobe Photoshop精心设计出的美观大方的编辑界面，使其在操作上一目了然；其最大的优点在于全程无需使用者自己编写代码，而是通过编辑器上几步简单的可视化操作，便能在游戏场景中快速的自动生成，大大提高了使用者的工作效率，即使非程序人员也能进行VR游戏的编辑，从此告别代码的困扰。','无','无',NULL,5,11,0,0,0,83.250000,0,'2019-09-28 00:24:41'),(186,1,282,'梧州地区传统村落建筑保护研究','梧院三雄',3,1,' 本课题以梧州地区列入广西首批传统村落名录的11个村落为研究对象，为调研选点和现场素材采集等方面提供指引，具有及时性。拟通过调研，较为系统地分析和揭示此地区传统村落及其建筑形态演变的动因、影响因素和个性特色，并结合当地实际情况，尝试探寻如何保护该地区传统村落建筑文化的途径。在一定程度上弥补对该地区传统村落研究不足的现状。也为相关研究提供借鉴；在一定程度上丰富和完善广西境内传统村落建筑文化与历史。','校级大学生创新创业项目','/',NULL,0,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(189,1,284,'拾慧—交互式传统手工艺品宣传网站平台','拾慧',5,1,'在追求与时俱进的今天，具有一定交互控制功能的多媒体产品正以其新奇独特的娱乐性，已经不可抗拒地在我们身边流行起来，她像风一样渗透到我们生活的方方面面，带来巨大的市场前景。拾慧是结合AR技术展示中华传统工艺文化的系列主题交互媒体，该产品本着宣传传统文化的初心，从当下传统文化传承艰难的现状出发，开发出一系列宣扬传统文化的交互产品。用户可以通过点击按钮左右滑动观看宣传内容，并且通过配套开发的手机应用扫描网页上的图片，观看该主题网页所展示的传统工艺品的仿真模型。','无','无',NULL,5,11,0,0,0,86.500000,0,'2019-09-28 00:24:41'),(190,1,161,'不拘-UI设计在线教育平台','天马UI工作室',5,1,'随着移动互联网、云计算、大数据等技术的应用与发展，互联网再次成为社会和业界关注的热点，基于近年来想从事互联网行业以及设计行业的人员越来越多，该项目以网上教程微课的形式，利用各大视频、直播和社交网站为基础，结合微信公众号。推出一系列围绕UI设计与交互设计的网络教程，加以手绘图文展现，并邀请知名行业人士与在校老师定期教学以及分享行业趣事与自身经验。让读者深入了解这首诗以及其背后的故事，颠覆以往需要高昂费用与时间地点都有很大限制的线下教学班，使得设计教学变得更加自由灵活，更加适合在这个信息碎片化的时代下学习。本团队也希望借此项目可以以一个低廉的价格让更多的群众可以享受高质量的设计课程。','无','无',NULL,5,10,0,0,0,76.000000,0,'2019-09-28 00:24:41'),(191,1,138,'智惠生活———人工智能动画短片制作','兔机工作室',5,1,'现如今\"人工智能\"已经连续两年被写入政府工作报告，人工智能已上升为国家战略。2019将会加强新一代人工智能研发应用，在医疗、养老、教育、文化、体育等多领域推进智能+。发展智能产业，拓展智能生活。\n制作出有关于人工智能的动画，将高深莫测的技术知识让人能够更直观的了解，增加趣味性。\n随着人工智能技术的日渐成熟，人类的生活将进一步提升，由此人工智能服务生活动画模拟能直观地反应科技数据的变化，具有广泛的应用前景。\n','无','无',NULL,5,10,0,0,0,72.250000,0,'2019-09-28 00:24:41'),(193,1,228,'致乐创新科技有限公司','致乐无人机',3,1,'本项目的目的在于研发一种适用于各年龄阶段安全可靠的娱乐无人机。通过创新，超强的控制系统，简单操控无人就可以在空中自由翱翔。无人机带载北斗和气压计，通过差分定点和估算三阶互补定高 ，可以实现精准定点，定高，返航功能。采用PID控制器与ADRC控制器相互嵌套的新型联合控制器，解决传统PID控制器抗干扰软弱问题，改善飞行姿态的控制，使其具有强自抗干扰能力。加大地面人员的生命财产安全。','占无','占无',NULL,1,NULL,0,0,1,NULL,0,'2019-09-28 00:24:41'),(194,1,162,'疾病智能约诊系统','创梦之航',5,1,'随着移动互联网的日益普及，互联网一直是人们关注的热点，在现在，很多行业都已经离不开互联网，“互联网+”的时代也在飞速发展，正在快速的进入我们的生活，而我们这次的重点是“互联网+医疗”。\n“互联网+医疗”系统应用为人们带来就医的便捷以及医院就诊的场地问题，该系统目的在于节约看病人员以及医护人员的时间，还能诊断患者的病情，用来初步判断患者的病情严重性。该系统不仅推动“互联网+”时代前进一步，更是医疗方面的服务升级，为医疗的转型提供动力。\n面对人们的需要，更基于“互联网+”时代的发展，我们研发了一款疾病智能约诊系统，极大的节约人们在看病过程中的等候时间及社会资源。','无','无',NULL,5,10,0,0,0,74.750000,0,'2019-09-28 00:24:41'),(195,1,283,'广西梧州明澈设计有限公司','明澈大队',5,2,'我们明澈眼镜设计有限公司是以客户满意、客户放心为导向，打造时尚，前卫的眼镜公司，这也是我们公司的目标。\n由于学习的压力，我国学生近视的人数在逐年增加，而且随着社会的发展，眼镜已不再是近视患者的专属品，为了美观，越来越多的非近视人员也戴起了眼镜，眼镜似乎已成为了人们生活中不可或缺的物品。\n在需求上，我们以“设计定制眼镜框”的创新想法，可以根据不同的形状，图案，文字雕刻于镜框上，为消费者提供独一无二的眼镜，进一步的满足了学生消费者的需求。\n在价格上，我们坚持“从学生中来，到学生中去的”理念。明澈眼镜设计有限公司作为学生品牌，我们所经营的眼镜一定会比其他商家给学生让利更多。我们以“无中间商赚差价”的方式经营，即确保了质量又让消费者用最少的钱买到最满意的眼镜。','暂无','暂无',NULL,3,NULL,0,0,1,NULL,0,'2019-09-28 00:24:41'),(197,1,228,'致乐无人机','致乐团队',3,1,'本项目的目的在于研发一种适用于各年龄阶段安全可靠的娱乐无人机。通过创新，超强的控制系统，简单操控无人就可以在空中自由翱翔。无人机带载北斗和气压计，通过差分定点和估算三阶互补定高 ，可以实现精准定点，定高，返航功能。采用PID控制器与ADRC控制器相互嵌套的新型联合控制器，解决传统PID控制器抗干扰软弱问题，改善飞行姿态的控制，使其具有强自抗干扰能力。加大地面人员的生命财产安全。','国家级大创','占无',NULL,5,11,0,0,0,83.000000,0,'2019-09-28 00:24:41'),(198,1,271,'摄影机运动镜头虚拟仿真教学软件','绿水晶',5,1,'本项目以影视摄影摄像课程的运动镜头为例，通过搭建三维虚拟场景，以创新的形式设计适合影视摄影摄像课程教学提纲的软件。针对目前三维虚拟教学辅助软件存在问题进行设计，项目以三维虚拟仿真的方式制作教学辅助软件，主要运用了3ds Max和VRP编辑器，实现了推镜头、拉镜头、摇镜头、移镜头、跟镜头这五种基本运动镜头的教学资源。针对当前的设备教学，本项目的实现解决了媒体教学的场地问题，同时减少了实验设备的耗损，也能提高教学质量。','无','无',NULL,5,11,0,0,0,84.250000,0,'2019-09-28 00:24:41'),(199,1,147,'交互式微课教学设计与应用','智维团队',2,1,'本项目针对微课教学中存在的知识点不明确、教学难点多以及学生对知识理解不透彻等问题，影视课程编导理念把教师授课内容视为基础素材，对其进行二次创意，强调工科问题文科化，文科问题戏剧化，复杂问题简单化，加入有趣的交互式功能，增强学生学习主动性。在进行教学内容转换上，主要是将知识进行联通和分解。将影视中的冲突、悬念、多条叙事线、移情等技法运用到微课教学策略中，以改善传统微课教学中存在的问题。制造正面、反面问题，突发性问题，应用多种反应镜头、蒙太奇等影视编导理念来创作微课，从而充分调动学生的主动性，以学习者为中心，充分调动学习者的积极性，让学习者全身心投入到学习中，真正达到良好的教学效果。','无','无',NULL,5,10,0,0,0,71.500000,0,'2019-09-28 00:24:41'),(201,1,285,'校园三维可视化数字沙盘','Top team',3,1,'对当前数字沙盘存在的不足，设计了一套成本低廉、应用范围广的虚拟数字沙盘，即设计并研发一个三维全景系统，该系统操作简单、特效丰富、拓展性强。本团队设计制作的三维全景系统，不仅具备了传统的功能，同时融入了建+筑物内部展示、静态寻路导航、信息查询等功能，因此命名为三维可视化静态导航系统。能够广泛应用于商业地产、医院、园区、景区等场景。三维可视化静态导航是指在一个三维的场景中，实现一个可视化的静态导航功能。它使导航这一功能的使用更直观，更逼真。','无','无',NULL,5,11,0,0,0,85.000000,0,'2019-09-28 00:24:41'),(202,1,112,'护航——多元媒体技术于反恐宣传的不同应用','护航',5,1,'新媒体技术是指基于互联网技术下的新媒体具有先天的技术优势与作为媒体的信息服务功能，是网络经济与传媒产业实现对接的最佳选择。\n本项目主要研究MG动画、表情包制作、H5微信程序的原理、技术以及教育宣传等诸多方面。\n1.	本项目制作了一套共14个动态表情包，每一个表情包由一些反恐标语和特警等组成。\n2.	反恐MG动画设计。由《广西壮族自治区群众举报涉恐涉暴奖励办法》为主要剧本，确定动画风格。以角色骨骼为主，研究人物的运动形态；以场景设计为辅，研究三维渲二维的材质贴图设置、摄像机运动等，最终输出成影片格式。\n3.	HTML5答题微信小程序设计。由《反恐知识竞赛》题目为主，准备50道不同的题目，每次随机抽出十道问答，满分100分。\n','无','无',NULL,5,10,0,0,0,79.750000,0,'2019-09-28 00:24:41'),(205,1,299,'小型自动跟踪 式太阳能电池板系统','lzl',5,1,'常规的太阳能电池板是固定不动的，这就造成了阳光无法长时间直射到电池板上，光照不够就会造成发电量不够，尤其是在冬天的时候，因阳光斜射北半球，阳光需要穿透更厚的大气层才能到达地面，这时阳光就更弱了。本设计产品主要针对一些小型太阳能电池板的应用场所，如太阳能路灯、太阳能信号灯、户外运动太阳能电源灯。设计产品在简便、灵活、易操作的前提下，降低制作成本和难度，利用光电传感器感应太阳的位置，并控制电机使电池板自动完成跟踪后能正对阳光直射方向，提高发电效率。','无','无',NULL,5,11,0,0,0,74.500000,0,'2019-09-28 00:24:41'),(207,1,295,'现代视听媒体MV设计','訫',5,1,'近些年,数字网络媒体的发展颠覆了人们对音乐的想象,新媒体制作的 MV 促使音乐和视频得到完美结合,在这些 MV 中,音乐成为视频画面的根本依据,并在 MV 中占据主要地位,视频画面中的色彩、图像都为音乐服务。MV并非是单一的听觉艺术，是与音乐、画面、歌词融为一体的艺术。随着网络媒体的发展，MV也逐渐变成新媒体MV，开始在电脑、手机等移动媒介上进行传播，使得受众的视听感官变得愉悦。\n本团队围绕现阶段处于数字化时代的音乐，拍摄和制作一系列的现代视听媒体的主题MV。\n','无','无',NULL,5,11,0,0,0,81.250000,0,'2019-09-28 00:24:41'),(210,1,303,'全景相机vr仿真教学','微光',3,1,'在当前的全景摄影教学过程中，教师需要先讲授全景摄影知识，然后让学生进行摄影实践，以达到掌握摄影技术的目的。由于普通学校教学资源匮乏，摄影设备不足，教师的现场示范无法满足众多学生同时观察的需求。因此，教学效果一般。如何让学生快速了解全景相机的构造，理解全景摄影技术中的难点，从而提升教学质量，是目前亟需解决的问题。\n虚拟仿真教学系统通过交互式、沉浸式的教学形式应用到高校教学过程中，学生可以使用该系统反复练习，教学效率更好，同时避免了摄影过程中的安全隐患，提升了教学质量。\n','无','无',NULL,5,11,0,0,0,84.000000,0,'2019-09-28 00:24:41'),(212,1,308,'基于51单片机家居安防系统','家居安防',4,1,'本项目是基于51单片机智能家居安防系统。该安防系统主要包括感应卡门禁系统，门磁模块，烟雾感应器模块，有毒气体感应模块，采用无线模块（nrf2401）实现门禁系统和门磁与单片机之间数据互通。通过传感器采集烟雾浓度、温度和煤气浓度对室内烟雾温度和煤气的监测，除此之外，通过WIFI模块实现单片机与手机进行通信，主人可以通过手机接收到警报信息以及将消除警报的指令传给单片机，单片机实行相应指令将警报解除。该项目操作简单方便，适合居家使用。','无','无',NULL,5,11,0,0,0,77.500000,0,'2019-09-28 00:24:41'),(213,1,307,'梧院人家六堡茶叶店','梧院人家',5,1,'梧州茶文化历史悠久，源远流长，清朝同治年间修编的《苍梧县志》中的“茶产多贤乡六堡，味厚，隔宿而不变”，就是梧州苍梧六堡茶的真实记载，显示着梧州茶文化的深厚历史及文化底蕴。但有着如此深厚历史及文化底蕴的梧州茶文化，它不应该仅限于梧州，而是要把它推广到全中国甚至全世界，在这个大数据的时代，作为一名大学生我们就应该利用大数据科技继承和发扬梧州茶文化。\n本项目以线上线下销售为营销模式，线下将以梧州学院大益爱心茶室为创业工作室，面向全校师生进行茶叶销售，线上通过淘宝网店和微信以梧州学院大益爱心茶室为货源地面向全国各地进行网络销售，在销售茶产品的同时，通过信件、外包装等方式发展与传播梧州茶文化。\n同时梧州学院大益爱心茶室作为一个由学生自主经营和管理的大学生爱心公益平台，我们在继承和发扬梧州茶文化的同时，我们也能很好的培养奉献爱心、帮助他人的公益意识，实现投身公益、服务他人、回报社会的愿望。  kikm','6千','无',NULL,3,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(217,1,46,'“互联网 扶贫”扶贫精准数据协同平台','开发中心先锋队',3,1,'2017年2月12日，中央第三巡视组向广西壮族自治区党委反馈巡视“回头看”情况。情况通报的主要问题中有“扶贫脱困存在数据失真”的问题。本项目以“互联网+”的技术优势和结合扶贫工作中贫困户与帮扶干部之间的结对关系解决贫困户数据精准、实时采集问题。主要特点如下：\n（1）利用“互联网+”技术优势，贫困户帮扶干部通过手机等移动终端设备实时采集贫困户信息，并实时更新。同时搭建起帮扶干部之间的沟通桥梁；\n（2）采集的数据实时记录共享，各级领导干部能查阅贫困户数据的实时动态，解决以往贫困户数据手工采集并层层上报带来的数据失真问题；\n使用该平台可促进精准扶贫工作的高效开展，轻松实现贫困户数据数字化、可视化和数据变化历史曲线。','无','无',NULL,5,10,0,0,0,83.750000,0,'2019-09-28 00:24:41'),(219,1,320,'GPS+充电宝+重量显示旅行箱','成功队',3,1,'随着人们生活水平都在不断的提高，生活的节奏也越来越快，人们经常需要去外地出差或者假期观光旅游，在出行的时候都会带上许多的生活用品，因为重量问题人们一般会为旅行箱办理托运，有的时候容易造成物品的损坏。出门在外，手机是必不可少的，但是一直使用手机会很耗电，这个时候旅行箱上自带的充电宝可以为手机补充电量。这款旅行箱上设有GPS定位系统，通过一个手机APP就可以随时知道自己的旅行箱在哪，可以减少丢失的概率。用户也可以在手机上查看旅行箱的重量等。此系统操作简单，设计智能人性化。','没有','没有',NULL,5,11,0,0,0,81.500000,0,'2019-09-28 00:24:41'),(220,1,324,'党建信息管理平台','软件开发中心二连',3,2,'我们的产品是一款基于Spring Boot的党建信息管理平台，它能够系统化地开展党的建设及其管理工作。同时实现党建工作的科学现代化，减轻党组织内部工作的繁冗的环节。快速建立一个基于现代信息理论，构建公开而面向大众的党建信息管理平台是现代党建工作的大趋势，并且具有引领时代的意义。提高工作效率的关键是面向政府及全国各级党群工作部门，开发适用于党建工作管理体系化建设的平台，减轻党务工作者的负担、优化党建工作信息的存储、规范党建工作。','无','无',NULL,3,NULL,0,0,1,NULL,0,'2019-09-28 00:24:41'),(221,1,296,'苍海旅游区的全景漫游设计与实现','识图团队',5,1,'本项目服务于旅游行业，通过全景漫游技术对景区的全方位进行展示漫游，为游客提供一个沉浸式体验效果的景点。全景漫游是利用真实的图像经过处理的一种虚拟漫游技术，利用相机对真实环境进行拍摄，通过计算机将采集到的图像从2D的平面化转化为三维的立体效果。相对于普通的照片，全景照片的视角更为广阔，用户可以在水平方向上360度，上下180度观看。\n预计完成一个苍海旅游区全景漫游系统。该系统百分之百的还原了现场真实的环境，它依靠自身的沉浸感和临场感对各个场景进行漫游，真正的做到了身临其境。在其基础上添加了场景动效效果，使得整个场景灵动起来，还设计实现导航、热点、地图、场景的切换、场景建模的360环物展示等交互设计，其人性化的交互全面提升旅游服务质量。此漫游系统将发布成两个版本，一是线上的链接版本，通过自动生成的链接，在浏览器中输入链接即可观赏本次漫游。二是线下的版本，用户只需下载，就可在手机或是网页端观看。','无','无',NULL,5,11,0,0,0,87.000000,0,'2019-09-28 00:24:41'),(223,1,221,'基于对抗神经网络GAN的培训机构测评平台','软件开发中心六连',3,1,'在大数据时代背景下，职业发展与就业教育存在许多问题，这些问题主要表现在就业需求呈现多样化，个性化发展趋势和就业指导受到新时代网络平台的挑战等，我们的产品以培训机构为背景，利用GAN对抗神经网络算法的特性，通过不断的迭代优化来训练判别模型，直到最终收敛在各式各样，鱼龙混杂的培训市场中，并根据获取样本的差异来评测培训机构，并设计开发一套优质的IT培训机构评测系统。\n我们这款产品的优势是在于面向全国各个地区城市的培训机构和大多数就业需求人员，该产品覆盖范围广，例如教育，IT，体育，传媒等多个领域，我们通过相关数据分析，可以准确，有效地筛选具有特色的培训机构，为不同就业需求人员提供服务。我们不仅与各培训机构进行合作，极大地减少培训机构与不同就业需求人员的不必要开支费用，同时在未来我们利用微信平台可以将数据分析的结果与政府相关机构进行共享，以此来扩大该平台的适用范围。\n','无','无',NULL,2,NULL,0,0,0,NULL,1,'2019-09-28 00:24:41'),(226,1,333,'交通执法预警平台','Bigdate',3,2,'本项目结合梧州市公安局视频监控和道路交通监控系统数据，通过对道路交通视频、图像的特征信息分析，提取和分析小汽车、摩托车、助力车、电动车、三轮车、小型货车、大型货车的特征信息，达到道路交通执法部门开展的“交通违法”、“套牌车预警”、“助力车收缴”、“泥头车集中整治”等执法目的，通过对实时或非实时车辆特征的提取与分析，达到目标或嫌疑车辆的查找与分析，并通过执法设备的地理位置标注，利用百度地图等地图API接口实现在地图上目标或嫌疑车辆的轨迹标注和描述。对于“车辆套牌”、“集中整治”通过实时分析和提取车辆特征，对满足特征的车辆实时推送到执法警务端，执法人员可根据警务端推送信息实时控制嫌疑车辆，达到快速、准确的执法目的。','无','无',NULL,2,NULL,0,0,1,NULL,0,'2019-09-28 00:24:41'),(228,1,331,'智能水表管理系统','智能水表队',3,1,'随着我国的经济快速发展，造就了如此庞大的城市，水表数目也越来越多。传统的抄表方式已经不足以满足这种需求了，人工抄表还存在着工作量大、效率低下以及收费困难等缺点。因此智能水表就应运而生了。智能水表作为现今家庭与工厂常用的智能化仪表,已经在渐渐地替代了传统水表，也克服了传统水表带来的缺点，除此之外还能提高仪表的可靠性，简化仪表电路，更容易实现高性能、多功能、高精度的目的。\n本项目是关于智能水表管理系统的设计与实现，是采用zigbee无线传感技术采集数据，利用数据服务器对收集的数据进行分析与处理，并使用网络编程技术来实现节点间的通信，以及数据服务器与管理用户端、网关端、Android移动用户端之间的通信，该系统可以实现远程抄读水表的实时数据，远程查询水表使用情况和停断水表供水以及缴费等功能，同时也对节点功耗问题进行了科学的研究和设计。','本项目在终端节点的设计采用zigbee通信技术，以解决节点的功耗问题，可实现多年无需更换电池，减少维护成本。\n   水厂管理员可通过移动客户端以及数据服务器，对本片区的智能水表进行检查和维修，维护效率相对传统机械水表有较大的提升。通过对数据的分析，可知片区在管网中的漏水、损坏等情况，从而可快速锁定具体的位置进而实行维护抢修，提高工作效率。\n用户可以通过APP移动客户端实时查看自家的用水量，也可用客户端进行网上缴费，再也不用到固定地点去缴纳费用了，省时省力，进一步提高了生活效率。','本项目所设计的智能水表管理系统，将可满足供水部门对片区的用水量的实时监控、简化对用户的管理；通过网络采集数据，解决人工抄表存在的一系列问题；实时的数据，能够实现对水管损漏的快速诊断，减少企业的损失，方便企业管理，提高企业效率。居民可以通过下载APP移动客户端实时查看自家的用水量，并根据用水情况做相应的分析和处理，实现节约用水，同时居民可以通过支付宝在线缴费，不用再到固定的地点缴纳费用，节省时间，提高生活水平，同时保证用户的财产安全以及供水部门的管理。',NULL,5,11,0,0,0,82.500000,0,'2019-09-28 00:24:41'),(229,1,258,'广西至诚科技有限公司','至诚团队',5,1,'本项目主要是一家集IT综合性人才培训、少儿机器人编程培训、少儿课外多向发展培新、计算机软硬件技术开发、新媒体推广、广告设计与一体的综合性教育培训机构。','无','无',NULL,5,11,0,0,0,77.500000,0,'2019-09-28 00:24:41'),(231,1,87,'罗汉果线上销售工作室','无名小卒',3,1,'随着移动互联网的发展，各大网络销售平台层次不穷，越来越多的人依靠线上消费的途径来购买自己的生活需求。这不算一个新兴长产业，但却在茁壮成长。\n广西永福和龙胜是罗汉果的发源地，近几年开始才有的线上销售，未来前景可观。我们主要做的就是线上销售罗汉果，收集农户手中的罗汉果，对它们进行包装，在线上面对全国销售。可以带动一些贫困家庭，让他们多一份收入。\n','无','无',NULL,5,10,0,0,0,71.250000,0,'2019-09-28 00:24:41'),(234,1,244,'高校应届毕业生就业专业对口度的调查分析——以梧州学院2015-2017届毕业生为例','百事可乐',1,2,'专业对口程度作为就业质量的重要评价指标是衡量大学生人力资源开发与利用有效程度的重要标准。对专业对口问题的探究有助于深层次了解毕业生所在岗位上对于高校培养的真正需求，对高校培养的调整有着深刻的意义。\r\n基于此，本研究试图采用问卷调查法对工作1-3年的本科毕业生就业与专业对口程度进行调查，了解毕业生的总体对口情况；进一步站在学生的角度，对12名毕业生进行深度访谈，借鉴扎根理论编码方式对访谈资料进行分析、归纳和整合，探究毕业生对于专业对口的态度、对口程度低的原因及对职业生涯的影响，并对高校提出相关的建议。','无','无',NULL,3,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(235,1,345,'基于互联网+建立的客户联系网络','v58q',4,1,'随着人们生活的水平越来越高，对于生活的情感也有更高的追求，本项目追求帮助企业对客户的日常活动联系包括（日常节日祝福、生日及重要活动维持）给客户最大的尊重以及敬意，使客户增加对企业的依赖，不仅如此在平时生活中家庭的和睦也至关重要，本团队可接受家庭的预约在家庭重要的节日上策划活动使家庭更温馨，随着男女比例失调，女生对男生的要求也越来越高，本团队会有各种个样的策划创意给你心爱的“她”一个难忘的活动。','个人投资2万元成立项目小组。','尚无',NULL,3,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(236,1,337,'无忧衣橱','梦想派',4,1,'“无忧衣橱”坐落于梧州学院内，面向消费群体主要为于梧州梧州市区里面的学生，本企业主要以服装租赁为主，销售、咨询、代理订做为铺的服务性公司，主要业务为：演出服装、戏剧服饰、职业正装、婚礼礼服、舞蹈用品（舞蹈鞋、训练服）、表演道具（木刀、帽子）等租赁、订做、销售。本公司采用线上线下的模式，拥有自己公司的APP、微信小程序，线上下单，线下送货，“梦想派品牌”以其考究的面料、新颖的款式、精致的工艺、卫生的环境、完善的售后服务，专业的服饰选购咨询打造租赁行业的精品。','无','无',NULL,2,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(238,1,347,'基于语音识别的入户门禁','学无止境',5,1,'随着物联网技术的发展与应用推广，智能家居系统逐渐被人们认可和应用。家庭入户门禁系统作为智能家居不可缺少的一部分，目前针对其研究较广。本项目通过运用语音识别技术和移动通信技术实现家庭入户门禁的智能化控制，将普通家庭的入户门禁的安全性、快捷性大幅提升。项目功能包括：1.通过语音识别技术，先学习合法用户的语音，或者特定节奏式的敲门声进行通过学习，然后可以通过特定的声音控制门的打开；2.通过智能手机或其他移动设备充当钥匙，可以通过相关的软件与通信技术控制门的打开。3.实现报警功能，如有非法人员试图开门，会及时向用户手机发送报警信号。','无','无',NULL,5,11,0,0,0,77.000000,0,'2019-09-28 00:24:41'),(239,1,348,'基于ZigBee通信的室内智能电灯控制','IOT战队',3,1,'   现在家庭或者其他场所都是使用按键开关来控制电灯的亮灭，而有时寻找按键却不那么容易，本团队设计的智能电灯控制系统通过无线技术解决了电灯按键开关不方便所带来的问题。系统通过在入室门口安装红外传感器，用来检测是否有人进出，同时在室内中心位置再安装另一红外传感器，用来检测是否有人在室内，室内还用到光敏传感器检测环境的光照，当门口的红外传感器受到触发，同时室内红外传感器检测到室内有人，光敏传感器又检测到环境光线不充足，这时室内电灯自动打开。\n      本团队的设计除了无线控制电灯之外，同时用户还可以设置电灯定时开关，让电灯根据用户所设定的时间自动关闭，达到节约能源效果。\n     为了实现人为操作电灯，本方案的设计还会增加用户手机端，用来手动控制室内的电灯以及对电灯定时开关功能的设置，同时也会保留传统的开关控制。\n','无','无',NULL,5,11,0,0,0,76.000000,0,'2019-09-28 00:24:41'),(243,1,122,'基于STM32 CAN总线的医药柜校验系统','医疗项目组',5,1,'本项目主要介绍基于STM32和CAN总线的重量校验系统的设计，通过上位机的通信，实现对特殊药品（比如麻醉药品、精神药品、毒性药品）重量数据的校验，并经过初步实验达到设计的要求。上位机是总的控制和显示系统，其通过 CAN 总线与各种传感器的感应模块连接。本系统采用主站+从站的结构，CAN主站主要实现重量数据的存储以及CAN总线协议和串口协议之间的桥接，CAN从站主要实现重量的采集。CAN从站采集的重量，经CAN总线传送到CAN主站，主站将各从站的重量值传送到系统上位机中。通过上位机显示出来的数据可知取出的药品是否有多拿，从而实现对一些特殊药品的用量的管理。','无','无',NULL,5,11,0,0,0,81.250000,0,'2019-09-28 00:24:41'),(245,1,319,'绩效任务监管平台','软件开发中心一连',3,1,'我们的产品是一款基于移动云平台的绩效任务监管软件，它的优势在于能最大程度地解决各单位绩效任务监管、沟通和协调等问题。目前适用各级政府部门对绩效任务进行有效监管，已在多个县市区应用。我们与中国移动充分合作，利用中国移动云平台，极大减少用户单位信息化建设费用。未来，通过扩展用户单位类型和用户单位数量，在充分调研的基础上，完善和丰富产品功能，以扩大该产品的适用范围，使得用户能自主选择软件功能。','无','无',NULL,5,10,0,0,0,73.750000,0,'2019-09-28 00:24:41'),(251,1,350,'平面设计、广告海报设计','圆点工作室',3,1,'工作室根据成员个人专业及特点主要从事从事平面设计、广告海报设计，平面广告设计与广告海报设计是在电脑上进行制作绘画，实地考察取材，通广告的形式进行宣传，作为艺术品设置于人类生存的环境之中。\n    本项目是对大学生资源和社会需求进行有效配置，把大学生已有知识运用到创业中，增强社会实践能力，提升综合能力，以便更好的适应社会！\n\n二、申请理由（包括自身/团队具备的知识、条件、特长、兴趣、已有的成果、前期准备、项目研究的国内外研究现状和发展动态等）\n1.团队情况：我们这个团队成员各有特点，都能够与同伴之间融洽的沟通协作，具备了广告海报设计与制作的基本要求\n罗鑫创新能力较强；肖颖手绘能力过人；梁媛媛电脑技术突出；王康统筹策划较强。\n2.前期准备：本团队已经形成了合作创业的共识,并积极进行项目筹备。\n3.市场广阔：广告海报目前在国内属于需求较高的行业，很有市场。经调查，在梧州本地这种需求不少。本项目\n','四台笔记本电脑，佳能相机一台','暂无',NULL,1,NULL,0,0,1,NULL,0,'2019-09-28 00:24:41'),(252,1,355,'无人水果摊','果果派',4,1,'因为校园内没有售卖水果的摊位，所以同学们大多情况下吃水果都是去外面买，这样一来同学们吃水果就很不方便。而我们的这个无人水果摊就是为了针对解决这个问题而提出来的，我们也从这个问题中看到了商机。','无','无',NULL,1,NULL,0,0,1,NULL,0,'2019-09-28 00:24:41'),(257,1,359,'留学生来华适应性的调查研究-以梧州学院为例','一世长安',5,2,'近年来，梧州以其独特的文化历史与地理位置的优势吸引着来自世界各地的外国留学生，随着中国与东盟、中亚、欧盟等国家教育交流的进一步开展，来梧州学院留学生人数正处于不断增长的趋势，成为沟通中国与外国合作共进的重要桥梁。然而，由于留学生来梧之后必然会经历从一种熟悉的环境到另一种陌生的社会环境中生活和适应的过程，宗教信仰、风俗习惯、文化价值观等各方面的差异会让他们在这个过程中面临着不同程度的困难和问题。因此本文以梧州学院留学生为对象进行调查研究，从生活适应、语言适应、心理适应、文化适应这四个方面探讨他们在梧州学习生活中存在的问题和影响因素，希望可以进一步了解留学生文化适应的现状和特点，也希望对跨文化适应研究有所补充和帮助。\n\n','梧州学院投资','无',NULL,3,NULL,0,0,1,NULL,0,'2019-09-28 00:24:41'),(268,1,366,'智能仓库管理系统 ','努力加油',5,1,'本系统是对仓库和仓库中储存的物资进行管理，以及管理仓库人员、库存、工作时间和设备的应用软件备份系统。系统按照常规和用户自行确定的优先原则，来优化仓库的空间利用和全部仓储作业。对上，系统通过电子数据交换（EDI）等电子媒介，与企业的计算机主机联网，由主机下达收货和订单的原始数据；对下，系统通过无线网络、手提终端、条码系统和射频数据通信（RFDC）等信息技术与仓库的员工联系。上下相互作用，传达指令，反馈信息，更新数据库并生成所需的条码和单据文件。系统总体实现对仓库日常活动的智能化管理。','无','无',NULL,5,11,0,0,0,79.500000,0,'2019-09-28 00:24:41'),(273,1,384,'便携式多功能示波器','we are one',5,1,'本项目是基于STM32微控制器与FPGA为控制核心的基于嵌入式技术的便捷式多功能示波器。该数字示波器主要包括TFT的驱动及显示，输入信号衰减，放大，偏置；采用FPGA作为数据采集， FPGA和STM32F407通信，实现数据的转移，STM32得到数据提取峰峰值，平均值，周期，占空比各种参数及波形。除此之外，通过USB2.0使示波器与电脑进行通信，在上位机显示、操作和记录数据，电路设计部分有：电源部分，FPGA和STM32设计部分，触发电路，TFT设计部分等。','无','无',NULL,2,NULL,0,0,1,NULL,0,'2019-09-28 00:24:41'),(278,1,372,'基于视觉的危险家电智能识别 ','风火轮',5,1,'本项目基于MATLAB下的危险家用电器的识别。随着科学技术的迅猛发展，家用电器的种类和功能越来越多，可随之而来的，家用电器的隐患也接踵而至。当家里有儿童或者老年人的情况下，某些家电便成了安全隐患。本项目基于模式识别，首先通过对家用电器的采样，对这些样品进行图像分割，即检测出各个物体，并把它们的图像和其他景物分离；然后特征抽取，即对物品进行度量，通过程序算法最终将家里的某些危险家电进行识别，从而达到解决对儿童和老人安全隐患的作用。','无','本项目正处于开发阶段，还无独有的知识产权。',NULL,5,11,0,0,0,78.250000,0,'2019-09-28 00:24:41'),(281,1,266,'基于STM32的智能家居','红鲤鱼与绿鲤鱼',1,1,'本项目利用手机通过WiFi访问STM32单片机，通过传感器实现环境监控、照明、窗户、窗帘的智能控制，并将监控结果在手机上显示出来。控制中心由STM32微控制器、无线收发模块、传感器等组成。STM32通过和WiFi无线通信网络收发信号对家居生活中的各种电器进行控制和检测。控制中心将家庭中的各种电器连成网络，对用电设备的工作状态进行最大限度的节省能源。并且通过传感器对家居环境中的温度、湿度、有毒气体含量进行检测，保证居住的舒适与安全。用户可通过手机了解家庭情况。','大创报销资金6000','无申请',NULL,5,11,0,0,0,77.000000,0,'2019-09-28 00:24:41'),(282,1,204,'全自动洗衣晾衣一体机','智能家居团',1,1,'目前家用的洗衣机大多都是如出一辙的“先洗衣再晾衣或烘衣”。为提高人们的生活质量，家电产品的升级改造和创新就成了关注点。为此设计一款“先挂衣再洗衣后晾衣”的一体化全自动洗衣机。该机结构分上下两层，上层是U形的输送带和进、出衣口，在进衣口把脏衣物挂好，缓慢输送到下层的洗衣室进行清洗，清洗干净后自动把衣物从出衣口带到晾衣杆进行晾晒。它的清洗方式采用波动式，衣物在清洗过程中被洗衣板反复拍打与擦洗。整个过程尤如流水线，脏衣物从进衣口进洗衣室清洗，而干净衣物就从出衣口出且带到晾衣杆上。其优点为操作简单，耗电量低，用水量少，净化率较高，衣物不易变形。','暂时除区级得奖，暂无投资','无',NULL,5,11,0,0,0,81.250000,0,'2019-09-28 00:24:41'),(286,1,385,'地方高校大学生班级自主管理研究——以梧州学院国际交流学院为例','真迹',4,1,'大学本身是社会大系统中的一个子系统，它与社会这个大系统及其他子系统之间存在着相互影响与相互制约的必然联系，大学的管理应根据当前社会环境情况结合学校的教学环境与师资力量管理。本研究是对国际交流学院英语专业开展个案研究，研发方法主要运用文献分析法、问卷调查法、个别访谈法等对班级自主管理情况进行研究。研究内容主要从学生的生活自主管理与学习的自主管理情况进行研究。','无','无',NULL,0,NULL,0,0,0,NULL,1,'2019-09-28 00:24:41'),(287,1,378,'梧州博物馆数字动画表现研究','创战',2,1,'对梧州博物馆进行考察，并运用三维的知识以模型的方式建造出梧州博物馆的各个建筑物、道具，以及特色设施。本团队将在用所学的动画设计为专业基础，在虚拟世界中重现出梧州博物馆的样貌。','无','无',NULL,1,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(288,1,312,'非遗锤揲工艺在现代茶具设计中的应用','器曰茶情',4,1,'新潮时代的到来，意味着市场的热潮，产品更迭迅速，在面对消费选择时，往往会根据产品品质及适用度进行对比来选择，有特色的产品会从中脱颖而出，而消费者潜意识中对特色的产品存有理智性的分析，从而选择适合自己且价格合理的商品。所以产品必须以更具艺术感的设计，更好的品质胜出。\n本项目创新之处在于把非物质文化遗产——锤揲工艺技术引进高校，通过与学校多专业教学资源相结合，更好的让学生发挥对工艺的传承和对产品造型的创新设计，以及产品在茶文化领域的市场开拓。项目组成员已在传统手工艺制作，有一定经验基础独立完成手工茶具制作，努力实现传承发扬创新。\n','无','无',NULL,1,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(289,1,261,'基于机器学习的自动化舆情搜索监测系统','Look At Me Now',3,1,'舆情监测是指整合互联网信息采集技术及信息智能处理技术，通过对互联网海量信息自动抓取、自动分类聚类、主题检测、专题聚焦，实现用户的网络舆情监测和新闻专题追踪等信息需求，形成简报、报告、图表等分析结果，为客户全面掌握群众思想动态，做出正确舆论引导，提供分析依据。行业化、服务化是舆情监测分析的发展趋势，将文本分类、文本聚类、文本摘要、倾向性分析等结合语料库和知识库，建立基于SaaS模式的舆情语义分析基础设施，可更好的实现人机结合，提高舆情研判的准确率。','暂无投资','暂无专利',NULL,5,11,0,0,0,88.000000,0,'2019-09-28 00:24:41'),(292,1,385,'地方高校大学生自主管理研究——以梧州学院国际交流学院为例','真迹',4,1,'大学本身是社会大系统中的一个子系统，它与社会这个大系统及其他子系统之间存在着相互影响与相互制约的必然联系，大学的管理应根据当前社会环境情况结合学校的教学环境与师资力量管理。本研究是对国际交流学院英语专业开展个案研究，研发方法主要运用文献分析法、问卷调查法、个别访谈法等对班级自主管理情况进行研究。研究内容主要从学生的生活自主管理与学习的自主管理情况进行研究。','无','无',NULL,1,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(293,1,398,'“不二侣行”导游人力资源共享中心','不二团队',5,3,'以旅本专业同学考取了导游资格证不被搁置的契机下，融入最新人力共享理念，搭建一个学生和社会人力资源共享的导游兼职平台。','未获得投资','未申请专利',NULL,0,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(295,1,391,'广绘墙绘','墙绘联盟',5,1,'近几年墙绘业务很热门，人们都很喜欢，我们几名同学在艺术生的基础上，努力发展墙体绘画。','以有','还没有',NULL,2,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(297,1,394,'利用氢键超分子合成子改善氟比洛芬药物理化性质','氟比洛芬队',5,2,'很多候选药物虽然有很好的疗效，但由于其溶解度、渗透性、稳定性和机械加工性能等理化性质达不到上市的要求而最终被淘汰。而氢键超分子作用能够将药物分子（API）与共晶物质（CCF）相连接，形成新的共晶或盐型，从而在一定程度上改善药物的溶解度、渗透性、稳定性或机械加工性能等理化性质，进而达到提高药物生物利用度的目的。氟比洛芬是非甾类抗炎药物，属于BCSII类药物，具有低溶解性，高渗透性，是一个典型的水溶性较差的药物。本文期望通过氢键超分子合成子作用将氟比洛芬与咪唑系列形成新盐，或者与联吡啶系列形成新的共晶，从而在一定程度上改善氟比洛芬药物的溶解度、提高其稳定性，从而达到增加其体内吸收的目的。','无','无',NULL,1,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(298,1,387,'梧州市中山纪念堂数字动画表现研究','我已无言以队',5,1,'  本项目是对梧州市孙中山历史博物馆进行研究。依托团队对动画设计基础和对实地考察研究，对它进行3D动画在设计，从而能从另外一个角度更好的对它进行更细致的观察。通过这一项目的设计能很好的提高团队的实践能力，同时又是对孙文精神一种很好的宣扬','特色：  将是首次用数字动画的形式对梧州市孙中山纪念堂进行研究。\n创新点：数字动画与孙中山纪念堂的一次实地与虚拟的结合','在制作的整个过程中，我们团队认真的完成每一个步骤，在不懂的地方经过学习也掌握了相关的技术操作，如max模型制作、LUMION的运用等。经过团队努力制作出三D中山纪念堂小视频。',NULL,1,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(299,2,403,'基于新媒体时代下六堡茶文化的再现与重生 ','旋风',3,2,'项目剪纸动画短片《六堡茶》借剪纸动画的形式演绎梧州六堡茶的百年沉浮史，用数字媒体动画技艺再现六堡茶文化的同时，使赋有中国元素符号的“茶道”以新生的意义。广西梧州的六堡茶蕴含着中国南方“怡情养生”小调的韵味，而这种小情调的茶文化却在众多的南方红茶、绿茶或黑茶类别中不被赋有别样的关注，这也是项目选择用淳朴憨厚风格的北方剪纸艺术的原因，两种文化都已被列为中国非物质文化遗产，通过南北文化的洽接，希望能碰撞出璀璨的艺术火花。\n项目通过实地考察，利用互联网、微信公众号、新媒体等途径，发起民众对六堡茶文化的关注，以终端设备形成“行走的六堡茶文化”，使赋有中国元素符号的“茶道”有新时代的意义，借此达成保护、传承六堡茶文化的目的。\n\n','无','无',NULL,1,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(300,1,250,'基于spark+hive+hbase的租房市场的数据分析平台','软件开发中心七连',3,1,'基于spark+hive+hbase的租房市场的数据分析平台是采用大数据技术spark+hive+hbase为租房市场的数据分析处理提供了有力的技术支撑。以的Linux 集群硬件为基础，通过对互联网租房市场信息的采集、预处理、分析来形成高可靠的统计性数据分析报表，并采用 HDFS 实现特有的高响应、高容错、高并发支持以及集群内数据均衡来架构租房市场数据。最终为找房用户提供可靠且价格合适的房源信息，让租房市场跟上信息化时代的发展。\n主要特点如下：\n（1）利用“互联网+”技术优势，采用spark+hive+hbase大数据技术监控国内互联网各租赁平台以获取租房市场信息数据，并利用自然语言处理技术以及数据挖掘技术对互联网租房市场信息进行采集、预处理、分析来形成高可靠的统计性数据分析报表，为找房用户提供可靠且价格合适的房源信息，让租房市场跟上信息化时代的发展。\n（2）采集的租房市场信息数据实时记录','无','无',NULL,5,10,0,0,0,71.250000,0,'2019-09-28 00:24:41'),(302,1,338,'策划者','策划人',3,1,'“策划者”将为客户提供国内一百万家酒店，一百万家餐厅，还有当地周边度假村等的活动场地选择，还有演职人员，主持，模特礼仪，歌手舞蹈，特色节目，会务活动相关设备物料，舞台搭建，灯光音响及所需礼品供应。通过“策划者”移动客户端的APP,官网，微信公众号等全平台覆盖，随时随地享受我们的策划小精灵“小策”给你带来的最优质独特的活动风格策划案，并以实体店探店场景化的体验推荐，满足你的活动需求。大到公司年会，婚宴策划，小到三两旧友重聚，帮助客户搭配出性价比高的策划，更好的安排活动的进行。口号：“今天，你策划了吗？”','无','无',NULL,5,11,0,0,0,87.250000,0,'2019-09-28 00:24:41'),(303,1,363,'久石文化传媒工作室','久石文化传媒',5,1,'久石文化传媒工作室成立于2018年8月，是梧州新兴的一家基于网络传媒和实践创新传媒公司，致力于在梧州传媒行业中打造一个独树一帜的网络新媒体和实践创新新媒体。\n久石文化传媒工作室主要从事型舞美设计与设备租赁、商业演出，文艺活动，组织、策划与宣传、艺人经纪等众多活动。工作室可独立制作音乐与视频，既为专业机构提供宣传推广，又为优秀个人提供个人展示、就业与商业合作的机会，同时也让商家发现更好的人才，实现真正的双赢。','无','无',NULL,2,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(304,1,304,'暗场宝石显微镜','天天向上',3,1,'宝石显微镜通过放大观察宝石的内含物和表面特征，是区分天然宝石、合成宝石及仿制宝石的重要手段。传统的宝石显微镜带有物镜，是常规仪器中体积比较大的一种，不方便人们携带。本项目利用光学暗场技术设计一种外形可爱的暗场宝石显微镜，省略物镜，使其结构简略，且配有可充电的照明系统方便人们携带。在方便人们随时随地观察宝石的品质的同时，外观做成寓意吉祥的造型，使其本身也是一件艺术品，适合各种场合摆设。','区级以上大创项目经费和学校配套经费来源','已获得发明专利证书',NULL,3,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(306,1,349,'“Karelu”珠宝首饰推广营销策略','青春创新团队',4,2,'结合当代高校毕业纪念品的市场需求，设计制作专属该校的毕业首饰纪念品。结合年轻消费者心理需求设计制作情侣款、兄弟款、闺蜜款、班级款、宿舍款等系列产品，并在该项目后期加入中国传统元素设计，实行中国传统风格与当代风格相结合。利用所学的珠宝设计加工知识与珠宝营销知识相结合。充分利用地区珠宝产业的优势（梧州人工宝石、广东四会玉石批发市场）及本校成熟的珠宝首饰加工技术，并结合电商、微商、实体等经营模式进行珠宝首饰从原材料加工、设计制作到营销的一条龙服务。\n','1.充分利用学校便利的资源优势——校内大学生创业发展中心，选择online与offline相结合的营销模式，创立微信公众号，定期发布新品珠宝首饰的推文介绍以及珠宝相关知识，充分发挥各平台的功能；\n2.形成从原材料加工设计制作到营销一条龙服务，在条件允许范围内可让消费者参观珠宝首饰制作过程；\n3.抓住高校毕业纪念品的市场需求，设计制作专属该校的毕业首饰纪念品；\n4.利用珠宝首饰的情感消费，结合大学生心理需求提供设计制作情侣款、兄弟款、闺蜜款、班级款、宿舍款等系列产品；\n5.注重中国传统元素在首饰设计中的运用，将大学生喜欢的传统元素运用到首饰设计中，并组织团队调研学习传统元素在首饰设计上的运用以及了解中国传统工艺。','2017年3月-5月：设计工作室logo，搭建微信公众平台以及淘宝网店的建设。\n2017年6月-7月：通过社交平台进行“karelu”品牌的推广宣传；确定产品的进货渠道。\n2017年8月-9月：团队成员进行暑期调研学习各方面知识。\n中期：\n2017年10月-12月：正式进行产品的销售与宣传，在微信、淘宝同时上线相关产品；同时开启定制设计服务；\n2018年1月-3月：着重学习中国传统元素在珠宝首饰设计方面的知识；\n后期：\n2018年3月-2019年6月：设计本校毕业纪念品；同时联系其他高校尝试设计合作。',NULL,2,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(307,1,306,'半自动茶叶采摘机 ','拥抱未来',4,1,'茶叶采摘不仅关系到制茶原料的质量，而且影响茶树的生长发育。合理的采茶，在一定程度上能促进茶叶的增产，并有防治病虫害的作用。全自动茶叶采摘机包括行走传动系统、采茶刀具传动系统、采茶工作台升降系统、茶叶采摘喂料系统、茶叶收集系统等系统。采茶工作台升降到合适的采摘高度，刀具传动系统开始工作，茶叶喂料采摘系统开始喂料采摘，收集系统收集采摘到的茶叶。','学校经费','暂无',NULL,0,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(308,1,409,'跨境电商运营站','追梦青年团',5,1,'把握家居行业的跨境热潮这一机遇，项目选择了敦煌网运营家居园艺饰品，完美的将理论运用于实践，深入学习跨境电子商务的内涵和工作内容。项目涉及专业性、应用性、创新性等方面，结合了国内与国际“一带一路”经济形势的发展。涉及丰富的业务内容，包括与供货商洽谈、寻找货代、平台实操、运营平台、售后服务、客户沟通等实操性岗位内容。在项目的运作过程中，参与人可以熟悉对外贸易业务，训练跨境电子商务平台店铺运营实操能力。','暂无','暂无',NULL,3,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(309,1,402,'佳思商城华倍广创业实践平台','华倍广创业团队',5,4,'华倍广创业实践平台是由16级电子商务专业、16级市场营销专业、17级软件工程专业的九名学生提出并计划实施的创业项目，此项目主营各大品牌电脑、手机、相机、电子产品配件、驾校的销售。我们与广西南宁佳思体系公司进行了长期战略合作，故可以得到稳定、正品、有保障、官方标配的货源，所有产品全新、未拆封，官方标配，质量有保障。目前我们的创业团队规模在我校达到了一百二十多号人。\n我们的创业项目采取“新零售”的销售模式，线上与线下结合搭配新型物流方式进行直销。华广有着独特的核心竞争优势:采取正品产品+舒心优质售后服务(全国联保，三年免费上门处理系统软件问题，支持货到付款，七天无理由退换货）打造自己的品牌形象。','广西佳佳思商城提供稳定货源和技术支持','1、实现在校打响我们的品牌的目标，让更多人了解我们，接受我们。\n\n与电子商务学会及大学生职业导航学会进行深度合作，加强学校组织社团之间的交流，合作，实现双赢，为学会和社团提供一个创业实践平台，通过成员们在我们商城开展实战销售进行锻炼。\n为学校创造兼职机会，让学有余力，课余时间多的大学生能在我们商城进行销售工作，通过自己的努力赚取生活费，得到能力上锻炼。\n为有创新创业想法的大学生提供一个锻炼实践的平台，真正深入了解创业的过程，增强大学生自主创新创业的能力，共同打造大学生的专属创业平台。\n\n\n',NULL,0,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(310,2,401,'佛教文化为什么能在这么短的时间里传播如此之快?','素年锦时',1,1,'佛教文化很早就传入中国了，可是为什么佛教文化没有像现在一样，传播的这么快速？指在探讨广西北流这个地方的佛教文化，是什么因素能让它在短短的这几年的时间里，从无到有，受众由少变多，辐射范围越来越大。','无','无',NULL,1,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(311,2,401,'佛教文化为什么能在这么短的时间里传播如此之快?','素年锦时',1,1,'佛教文化很早就传入中国了，可是为什么佛教文化没有像现在一样，传播的这么快速？指在探讨广西北流这个地方的佛教文化，是什么因素能让它在短短的这几年的时间里，从无到有，受众由少变多，辐射范围越来越大。','无','无',NULL,1,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(312,1,355,'无人水果摊','果果派',4,1,'我们这个项目主要是服务于在校大学生，因为校内没有水果售卖处，所以学生买水果很不方便，因此我们的这个项目就是为了解决这个问题而提出来的。我们也从这个问题中看到了商机，而且我们也将会在网上弄一个自己的app专门为校内大学生提供网上选购的条件，我们也会有个自己的送货上门的服务，这样也可以让学生足不出户就可以吃到新鲜的水果。','无','无',NULL,3,NULL,0,0,1,NULL,0,'2019-09-28 00:24:41'),(313,1,96,'广西梧州特色中草药凉茶文化的市场价值发掘与推广路径研究','拓路先锋队',1,1,'凉茶是梧州人的情结，是一个地域聚居人口的饮食文化构成部分，也是中华民族饮食文化的组成部分，其具有明显的地域性、传承性、稳定性和民族性特征。本文将着重从梧州中草药凉茶的历史渊源、地理因素、社会阶层的不同需求和社会生产力不断发展下的凉茶嬗变着手，研究梧州中草药凉茶的传承与发展方向，进行市场价值发掘与推广路径研究。同时对比广东知名凉茶“王老吉”品牌的发展，分析梧州中草药凉茶缺乏大力发展、推广的现实条件。将梧州龟苓膏的营销成功作为梧州中草药凉茶发展的侧面例子，借鉴两方在现代化快节奏生活下、饮食文化推广和随着社会发展做出的积极转变入手，通过总结可复制和可推广的经验为梧州凉茶作出建设性发展对策。\n','无','无',NULL,3,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(316,1,221,'基于对抗神经网络GAN的培训机构测评平台','软件开发中心六连',3,1,'在大数据时代背景下，职业发展与就业教育存在许多问题，这些问题主要表现在就业需求呈现多样化，个性化发展趋势和就业指导受到新时代网络平台的挑战等，我们的产品以培训机构为背景，利用GAN对抗神经网络算法的特性，通过不断的迭代优化来训练判别模型，直到最终收敛在各式各样，鱼龙混杂的培训市场中，并根据获取样本的差异来评测培训机构，并设计开发一套优质的IT培训机构评测系统。\n我们这款产品的优势是在于面向全国各个地区城市的培训机构和大多数就业需求人员，该产品覆盖范围广，例如教育，IT，体育，传媒等多个领域，我们通过相关数据分析，可以准确，有效地筛选具有特色的培训机构，为不同就业需求人员提供服务。我们不仅与各培训机构进行合作，极大地减少培训机构与不同就业需求人员的不必要开支费用，同时在未来我们利用微信平台可以将数据分析的结果与政府相关机构进行共享，以此来扩大该平台的适用范围。\n','无','无',NULL,5,10,0,0,0,71.000000,0,'2019-09-28 00:24:41'),(317,1,350,'圆点广告设计工作室','圆点设计工作室',3,1,'工作室根据成员个人专业及特点主要从事从事平面设计、广告海报设计，平面广告设计与广告海报设计是在电脑上进行制作绘画，实地考察取材，通广告的形式进行宣传，作为艺术品设置于人类生存的环境之中。 本项目是对大学生资源和社会需求进行有效配置，把大学生已有知识运用到创业中，增强社会实践能力，提升综合能力，以便更好的适应社会！ 二、申请理由（包括自身/团队具备的知识、条件、特长、兴趣、已有的成果、前期准备、项目研究的国内外研究现状和发展动态等） 1.团队情况：我们这个团队成员各有特点，都能够与同伴之间融洽的沟通协作，具备了广告海报设计与制作的基本要求 罗鑫创新能力较强；肖颖手绘能力过人；梁媛媛电脑技术突出；王康统筹策划较强。 2.前期准备：本团队已经形成了合作创业的共识,并积极进行项目筹备。 3.市场广阔：广告海报目前在国内属于需求较高的行业，很有市场。经调查，在梧州本地这种需求不少。本项目 ','四台笔记本电脑，一台佳能相机','暂无',NULL,1,NULL,0,0,1,NULL,0,'2019-09-28 00:24:41'),(320,1,395,'探究粤剧文化的传承与创新发展','粤知小组',1,2,'习近平在十九大报告中提出，要坚定文化自信，推动社会主义文化繁荣兴盛。习近平指出，中国特色社会主义文化，源自于中华民族五千多年文明历史所孕育的中华优秀传统文化，熔铸于党领导人民在革命、建设、改革中创造的革命文化和社会主义先进文化，植根于中国特色社会主义伟大实践。\r\n梧州粤剧文化历史悠久，且其种类丰富，在当地人民的日常生活中是必不可缺的，是宝贵的文化艺术遗产。\r\n   本项目通过对梧州粤剧的研究，通过实地走访，查阅文献等方式，发掘弘扬民族文化，振兴粤剧粤曲艺术，使传统艺术焕发新的青春和生命力。使更多的梧州人民了解粤剧文化，感受粤剧文化的魅力。并且让更多的新一代年轻人接触粤剧，为粤剧的传承注入新鲜血液。将粤剧文化推进校园文化，在促进校园文化建设的同时弘扬粤剧文化。发扬梧州粤剧文化有利于提升梧州人民的文化生活水平，还可以提升梧州的知名度，为梧州文化增添一张亮丽的城市名片。','无','无',NULL,3,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(321,1,395,'探究粤剧文化的继承与创新发展','粤知小组',1,2,'习近平在十九大报告中提出，要坚定文化自信，推动社会主义文化繁荣兴盛。习近平指出，中国特色社会主义文化，源自于中华民族五千多年文明历史所孕育的中华优秀传统文化，熔铸于党领导人民在革命、建设、改革中创造的革命文化和社会主义先进文化，植根于中国特色社会主义伟大实践。\r\n梧州粤剧文化历史悠久，且其种类丰富，在当地人民的日常生活中是必不可缺的，是宝贵的文化艺术遗产。\r\n   本项目通过对梧州粤剧的研究，通过实地走访，查阅文献等方式，发掘弘扬民族文化，振兴粤剧粤曲艺术，使传统艺术焕发新的青春和生命力。使更多的梧州人民了解粤剧文化，感受粤剧文化的魅力。并且让更多的新一代年轻人接触粤剧，为粤剧的传承注入新鲜血液。将粤剧文化推进校园文化，在促进校园文化建设的同时弘扬粤剧文化。发扬梧州粤剧文化有利于提升梧州人民的文化生活水平，还可以提升梧州的知名度，为梧州文化增添一张亮丽的城市名片。','无','无',NULL,1,NULL,0,0,0,NULL,0,'2019-09-28 00:24:41'),(322,1,395,'探究粤剧文化的继承与创新发展','粤知小组',1,1,'习近平在十九大报告中提出，要坚定文化自信，推动社会主义文化繁荣兴盛。习近平指出，中国特色社会主义文化，源自于中华民族五千多年文明历史所孕育的中华优秀传统文化，熔铸于党领导人民在革命、建设、改革中创造的革命文化和社会主义先进文化，植根于中国特色社会主义伟大实践。\r\n梧州粤剧文化历史悠久，且其种类丰富