--
-- Table structure for table `innovate_match_review`
--

DROP TABLE IF EXISTS `innovate_match_review`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `innovate_match_review` (
  `review_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '评审主键',
  `apply` varchar(100) DEFAULT NULL COMMENT '所属流程：1、工位申请；2、比赛；3大创申请；4、结题',
  `match_id` bigint(20) NOT NULL COMMENT '比赛ID（外键）',
  `user_id` bigint(20) NOT NULL COMMENT '用户ID（外键）',
  `referee_no` bigint(20) DEFAULT NULL COMMENT '评委号',
  `score` decimal(10,2) DEFAULT NULL COMMENT '分数',
  `opinion` varchar(1000) DEFAULT NULL COMMENT '评审意见',
  `is_del` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`review_id`),
  KEY `innovate_project_review_innovate_project_info_project_id_fk` (`match_id`),
  KEY `innovate_project_review_sys_user_user_id_fk` (`user_id`),
  CONSTRAINT `innovate_match_review_ibfk_1` FOREIGN KEY (`match_id`) REFERENCES `innovate_match_info` (`match_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `innovate_match_review_ibfk_2` FOREIGN KEY (`user_id`) REFERENCES `sys_user` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=903 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

