INSERT INTO `innovate_match_review` VALUES (1,'project_match_apply_status',38,417,NULL,88.00,'项目选择的技术领域较好,项目的方案详尽,如能在拓展应用领域项目较有前途。',0),(2,'project_match_apply_status',38,106,NULL,81.00,'技术点不错，创意好',0),(3,'project_match_apply_status',38,109,NULL,93.00,'创意不错，团队单一',0),(4,'project_match_apply_status',38,245,NULL,64.00,'网络技术革新理念强烈，但成员技术能力及具备条件陈述较为模糊，对竞争形势的突破手段及营销手法仍稍欠缺',0),(5,'project_match_apply_status',39,419,NULL,95.00,'该项目具备一定的创新性，成品化后可占据一定的市场份额，在产品研发过程中可同步进行市场开发，建议从小型超市先行先试，点、面逐步铺开。关于资金问题，建议尽快注册成立公司，各大银行针对微小企业有相应的融资扶持，意见仅供参考。',0),(6,'project_match_apply_status',39,94,NULL,91.00,'项目有一定的创新性和实用性，方案还需进一步优化，超市等地方人流量多，干扰也大，如何真正的保证运行，还需要大量的实测和改进。',0),(7,'project_match_apply_status',39,435,NULL,83.00,'此项目有较好的创新性，填补室内导航欠缺的一个空白，有一定的实用价值。',0),(8,'project_match_apply_status',39,437,NULL,80.00,'1、该项目通过STM32单片机控制，利用UWB无线通信技术实现室内导航，将室内定位、人机互动、智能导航等技术有效结合起来，设计成一个能够在室内实时显示使用者的位置并且拥有智能导航的产品。该项目具有一定的创新性和实践性，项目计划书内容完整，项目组成员搭配合理，充分具备技术优势，相信能很好地完成该项目。',0),(9,'project_match_apply_status',40,417,NULL,68.00,'项目所属领域较为成熟，项目方案编写质量不高，如不进一步突出技术和经营模式的特点，预期是市场前景一般',0),(10,'project_match_apply_status',40,106,NULL,73.00,'项目内容太单一',0),(11,'project_match_apply_status',40,109,NULL,73.00,'项目较单一',0),(12,'project_match_apply_status',40,245,NULL,61.00,'运用较好的3d技术软件，但缺乏对需求的深入分析，对客户群体的分析较弱，营销手段及产品价格未明，公司财务状况不明',0),(21,'project_match_apply_status',43,419,NULL,92.00,'该项目是目前的朝阳产业，但目前市场关于这类产品越来越多，建议提高研发产品的独特性和相比其他类似产品的优越性，意见仅供参考。',0),(22,'project_match_apply_status',43,94,NULL,81.00,'该项目有实用价值，但是设计的方案简单了一点，如果专为老人设计的生命特征测试仪的话，需要考虑便携等实际需求，现在通话都很方便，该方案中的通信只是考虑GSM，建议从实际出发确定方案和功能。',0),(23,'project_match_apply_status',43,435,NULL,80.00,'此项目具有很强的商业价值，但在研究实践方面还缺少有效的成果展示，还需要有更进一步的内容。',0),(24,'project_match_apply_status',43,437,NULL,66.00,'该项目能运用多种传感器对人体的不同生理参数进行采集，并对采集数据进行分析，当发生异常情况时能通过语音进行提示或者电话报警。该项目研究内容比较充实，拟解决的问题突出，具备项目研究和实施的基本条件，具有可操作性和实用性。',0),(25,'project_match_apply_status',44,419,NULL,90.00,'创新性有待提高，同类型产品中占据优势不大，建议研究增加智能系统，紧贴现代化智能生活，提高产品市场竞争力，意见仅供参考。',0),(26,'project_match_apply_status',44,435,NULL,73.00,'此项目具有一定的创意与创新性，并且具有较高的实用价值，但在与互联网之间的还需有更多的切合点。',0),(27,'project_match_apply_status',44,437,NULL,68.00,'该项目以ATMEGA16单片机为控制核心，通过一定浓度的气味信号引诱苍蝇进捕捉器，并利用高压输出模块产生高压以电击苍蝇，使之击毙，从而达到自动捕捉苍蝇的目的。该项目从生活实际出发，利用所学知识解决实际需要，有较强的实用性。',0),(28,'project_match_apply_status',46,419,NULL,94.00,'项目前景较好，符合国家鼓励的新能源配套项目，但预估要从研发阶段、产品实施、再到市场开拓，投入资金较大，需提前考虑融资问题。',0),(29,'project_match_apply_status',46,94,NULL,93.00,'无线充电是目前全社会研究的热点，需要解决充电的效率，这是一个难点，若果能解决这个问题，该项目成功一大半，公司的理念：充电十分钟，行驶百公里，需要数据支撑，这里面看不出来。',0),(30,'project_match_apply_status',46,435,NULL,78.00,'此项目具有较高的创意和创新性，并且具有较高的商业价值，在与互联网之间的还需有更多的切合点。',0),(31,'project_match_apply_status',46,437,NULL,88.00,'该项目采用无线充电技术给小车充电，充电效率达到80%以上，续航时间长，能实现定时充电及自启动的功能。该项目立意新颖，且能做到节能环保，符合社会实际需要。项目计划书内容完整，项目组成员搭配合理，充分具备技术优势，相信能很好地完成该项目。',0),(32,'project_match_apply_status',47,419,NULL,91.00,'多肉市场已盛行多年，但由于天气环境因素影响，多肉在云南等地种植品质最好，两广属于亚热带气候，闷热潮湿，培育多肉植物需在种植技术上加强创新。目前大型的多肉市场在广西乃至梧州本地是几乎是空白的，柳州的多肉基地也是小打小闹，建议增加技术投入，提高种植技术含量，可考虑往多肉大棚基地方向发展，意见仅供参考。',0),(33,'project_match_apply_status',47,94,NULL,78.00,'该项目创新性不够，如果真是开这种店的话，可以通过扫码进入店内查看该植物的作用和如何养？就真正做到互联网+了。',0),(34,'project_match_apply_status',47,435,NULL,69.00,'此项目还缺乏一些与互联网相结合的创新内容。',0),(35,'project_match_apply_status',47,437,NULL,84.00,'项目以种植室内绿植与销售为主。通过种植与销售不同的绿植，满足现代人健康生活，同时还能向顾客提供最基础的培育知识。该项目组成员具备较成熟的企业经营理念，对今后的发展也有了深入的规划，相信该项目能顺利进行。',0),(40,'project_match_apply_status',49,419,NULL,90.00,'项目普及性有待提高，可适当考虑面向的对象不仅限于儿童。',0),(41,'project_match_apply_status',49,94,NULL,79.00,'创新不够，需要和目前市面上的电子琴做比较后改进，改进的功能需要有很好的实用性。这里虽说有改进的功能，但是这些功能不够实用和创新。',0),(42,'project_match_apply_status',49,435,NULL,72.00,'此项目有较好的创意和创新性，亦具有一定的商业价值，但与互联网之间仍需要有更多的切合点。',0),(43,'project_match_apply_status',49,437,NULL,86.00,'本项目力图设计一个儿童智能教学电子琴系统，硬件电路简单，功能完善，性价比较高，有较强的实用性和趣味性。该项目组成员能利用所学知识完成实际需求，对项目规划做了深入的调查和研究。',0),(48,'project_match_apply_status',52,417,NULL,80.00,'项目切入的应用领域较好，项目方案较为详细，但市场存在大量同质化产品，如果本项目在技术上没有新的突破，竞争上可能存在问题。',0),(49,'project_match_apply_status',52,109,NULL,94.00,'技术点较强，商业性比较局限',0),(50,'project_match_apply_status',52,245,NULL,58.00,'产品的自身优势没有进行很好的阐述，